INSERT INTO `abilities` VALUES (1,'stench','This Pokémon\'s damaging moves have a 10% chance to make the target flinch with each hit if they do not already cause flinching as a secondary effect.\n\nThis ability does not stack with a held item.\n\nOverworld: The wild encounter rate is halved while this Pokémon is first in the party.','2023-11-22 07:21:03','2023-11-22 07:21:03'),(2,'drizzle','The weather changes to rain when this Pokémon enters battle and does not end unless replaced by another weather condition.\n\nIf multiple Pokémon with this ability, drought, sand stream, or snow warning are sent out at the same time, the abilities will activate in order of Speed, respecting trick room.  Each ability\'s weather will cancel the previous weather, and only the weather summoned by the slowest of the Pokémon will stay.','2023-11-22 07:21:03','2023-11-22 07:21:03'),(3,'speed-boost','This Pokémon\'s Speed rises one stage after each turn.','2023-11-22 07:21:03','2023-11-22 07:21:03'),(4,'battle-armor','Moves cannot score critical hits against this Pokémon.\n\nThis ability functions identically to shell armor.','2023-11-22 07:21:03','2023-11-22 07:21:03'),(5,'sturdy','When this Pokémon is at full HP, any hit that would knock it out will instead leave it with 1 HP.  Regardless of its current HP, it is also immune to the one-hit KO moves: fissure, guillotine, horn drill, and sheer cold.\n\nIf this Pokémon is holding a focus sash, this ability takes precedence and the item will not be consumed.','2023-11-22 07:21:03','2023-11-22 07:21:03'),(6,'damp','While this Pokémon is in battle, self destruct and explosion will fail and aftermath will not take effect.','2023-11-22 07:21:03','2023-11-22 07:21:03'),(7,'limber','This Pokémon cannot be paralyzed.\n\nIf a Pokémon is paralyzed and acquires this ability, its paralysis is healed; this includes when regaining a lost ability upon leaving battle.','2023-11-22 07:21:03','2023-11-22 07:21:03'),(8,'sand-veil','During a sandstorm, this Pokémon has 1.25× its evasion, and it does not take sandstorm damage regardless of type.\n\nThe evasion bonus does not count as a stat modifier.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is halved in a sandstorm.','2023-11-22 07:21:03','2023-11-22 07:21:03'),(9,'static','Whenever a move makes contact with this Pokémon, the move\'s user has a 30% chance of being paralyzed.\n\nPokémon that are immune to electric-type moves can still be paralyzed by this ability.\n\nOverworld: If the lead Pokémon has this ability, there is a 50% chance that encounters will be with an electric Pokémon, if applicable.','2023-11-22 07:21:04','2023-11-22 07:21:04'),(10,'volt-absorb','Whenever an electric-type move hits this Pokémon, it heals for 1/4 of its maximum HP, negating any other effect on it.\n\nThis ability will not take effect if this Pokémon is ground-type and thus immune to Electric moves.  Electric moves will ignore this Pokémon\'s substitute.\n\nThis effect includes non-damaging moves, i.e. thunder wave.','2023-11-22 07:21:04','2023-11-22 07:21:04'),(11,'water-absorb','Whenever a water-type move hits this Pokémon, it heals for 1/4 of its maximum HP, negating any other effect on it.\n\nWater moves will ignore this Pokémon\'s substitute.','2023-11-22 07:21:04','2023-11-22 07:21:04'),(12,'oblivious','This Pokémon cannot be infatuated and is immune to captivate.\n\nIf a Pokémon is infatuated and acquires this ability, its infatuation is cleared.','2023-11-22 07:21:04','2023-11-22 07:21:04'),(13,'cloud-nine','While this Pokémon is in battle, weather can still be in play, but will not have any of its effects.\n\nThis ability functions identically to air lock.','2023-11-22 07:21:04','2023-11-22 07:21:04'),(14,'compound-eyes','This Pokémon\'s moves have 1.3× their accuracy.\n\nThis ability has no effect on the one-hit KO moves (fissure, guillotine, horn drill, and sheer cold).\n\nOverworld: If the first Pokémon in the party has this ability, the chance of a wild Pokémon holding a particular item is raised from 50%, 5%, or 1% to 60%, 20%, or 5%, respectively.','2023-11-22 07:21:04','2023-11-22 07:21:04'),(15,'insomnia','This Pokémon cannot be asleep.\n\nThis causes rest to fail altogether.  If a Pokémon is asleep and acquires this ability, it will immediately wake up; this includes when regaining a lost ability upon leaving battle.\n\nThis ability functions identically to vital spirit in battle.','2023-11-22 07:21:04','2023-11-22 07:21:04'),(16,'color-change','Whenever this Pokémon takes damage from a move, the Pokémon\'s type changes to match the move.\n\nIf the Pokémon has two types, both are overridden.  The Pokémon must directly take damage; for example, moves blocked by a substitute will not trigger this ability, nor will moves that deal damage indirectly, such as spikes.\n\nThis ability takes effect on only the last hit of a multiple-hit attack.\n\nIn Pokémon Colosseum and XD: Gale of Darkness, this ability does not take effect on Shadow-type moves.','2023-11-22 07:21:04','2023-11-22 07:21:04'),(17,'immunity','This Pokémon cannot be poisoned.  This includes bad poison.\n\nIf a Pokémon is poisoned and acquires this ability, its poison is healed; this includes when regaining a lost ability upon leaving battle.','2023-11-22 07:21:04','2023-11-22 07:21:04'),(18,'flash-fire','This Pokémon is immune to fire-type moves.  Once this Pokémon has been hit by a Fire move, its own Fire moves will inflict 1.5× as much damage until it leaves battle.\n\nThis ability has no effect while the Pokémon is frozen.  The Fire damage bonus is retained even if the Pokémon is frozen and thawed or the ability is lost or disabled.  Fire moves will ignore this Pokémon\'s substitute.  This ability takes effect even on non-damaging moves, i.e. will o wisp.','2023-11-22 07:21:05','2023-11-22 07:21:05'),(19,'shield-dust','This Pokémon is immune to the extra effects of moves used against it.\n\nAn extra effect is a move\'s chance, listed as an \"effect chance\", to inflict a status ailment, cause a stat change, or make the target flinch in addition to the move\'s main effect.  For example, thunder shock\'s paralysis is an extra effect, but thunder wave\'s is not, nor are knock off\'s item removal and air cutter\'s increased critical hit rate.','2023-11-22 07:21:05','2023-11-22 07:21:05'),(20,'own-tempo','This Pokémon cannot be confused.\n\nIf a Pokémon is confused and acquires this ability, its confusion will immediately be healed.','2023-11-22 07:21:05','2023-11-22 07:21:05'),(21,'suction-cups','This Pokémon cannot be forced out of battle by moves such as whirlwind.\n\ndragon tail and circle throw still inflict damage against this Pokémon.\n\nOverworld: If the lead Pokémon has this ability, the success rate while fishing is increased.','2023-11-22 07:21:05','2023-11-22 07:21:05'),(22,'intimidate','When this Pokémon enters battle, the opponent\'s Attack is lowered by one stage.  In a double battle, both opponents are affected.\n\nThis ability also takes effect when acquired during a battle, but will not take effect again if lost and reobtained without leaving battle.\n\nThis ability has no effect on an opponent that has a substitute.\n\nOverworld: If the first Pokémon in the party has this ability, any random encounter with a Pokémon five or more levels lower than it has a 50% chance of being skipped.','2023-11-22 07:21:05','2023-11-22 07:21:05'),(23,'shadow-tag','While this Pokémon is in battle, opposing Pokémon cannot flee or switch out.\n\nOther Pokémon with this ability are unaffected.  Pokémon with run away can still flee.  Pokémon can still switch out with the use of a move or item.','2023-11-22 07:21:05','2023-11-22 07:21:05'),(24,'rough-skin','Whenever a move makes contact with this Pokémon, the move\'s user takes 1/8 of its maximum HP in damage.\n\nThis ability functions identically to iron barbs.','2023-11-22 07:21:05','2023-11-22 07:21:05'),(25,'wonder-guard','This Pokémon is immune to damaging moves that are not super effective against it.\n\nMoves that inflict fixed damage, such as night shade or seismic toss, are considered super effective if their types are.  Damage not directly dealt by moves, such as damage from weather, a status ailment, or spikes, is not prevented.\n\nThis ability cannot be copied with role play or traded away with skill swap, but it can be copied with trace, disabled with gastro acid, or changed with worry seed.  This Pokémon can still use Role Play itself to lose this ability, but not Skill Swap.\n\nIf this Pokémon has a substitute, this ability will block moves as usual and any moves not blocked will react to the Substitute as usual.','2023-11-22 07:21:05','2023-11-22 07:21:05'),(26,'levitate','This Pokémon is immune to ground-type moves, spikes, toxic spikes, and arena trap.\n\nThis ability is disabled during gravity or ingrain, or while holding an iron ball.  This ability is not disabled during roost.','2023-11-22 07:21:05','2023-11-22 07:21:05'),(27,'effect-spore','Whenever a move makes contact with this Pokémon, the move\'s user has a 30% chance of being paralyzed, poisoned, or put to sleep, chosen at random.\n\nNothing is done to compensate if the move\'s user is immune to one of these ailments; there is simply a lower chance that the move\'s user will be affected.','2023-11-22 07:21:06','2023-11-22 07:21:06'),(28,'synchronize','Whenever this Pokémon is burned, paralyzed, or poisoned, the Pokémon who gave this Pokémon that ailment is also given the ailment.\n\nThis ability passes back bad poison when this Pokémon is badly poisoned.  This ability cannot pass on a status ailment that the Pokémon did not directly receive from another Pokémon, such as the poison from toxic spikes or the burn from a flame orb.\n\nOverworld: If the lead Pokémon has this ability, wild Pokémon have a 50% chance of having the lead Pokémon\'s nature, and a 50% chance of being given a random nature as usual, including the lead Pokémon\'s nature.  This does not work on Pokémon received outside of battle or roaming legendaries.','2023-11-22 07:21:06','2023-11-22 07:21:06'),(29,'clear-body','This Pokémon cannot have its stats lowered by other Pokémon.\n\nThis ability does not prevent any stat losses other than stat modifiers, such as the Speed cut from paralysis.  This Pokémon can still be passed negative stat modifiers through guard swap, heart swap, or power swap.\n\nThis ability functions identically to white smoke in battle.','2023-11-22 07:21:06','2023-11-22 07:21:06'),(30,'natural-cure','This Pokémon is cured of any major status ailment when it is switched out for another Pokémon.\n\nIf this ability is acquired during battle, the Pokémon is cured upon leaving battle before losing the temporary ability.','2023-11-22 07:21:06','2023-11-22 07:21:06'),(31,'lightning-rod','All other Pokémon\'s single-target electric-type moves are redirected to this Pokémon if it is an eligible target.  Other Pokémon\'s Electric moves raise this Pokémon\'s Special Attack one stage, negating any other effect on it, and cannot miss it.\n\nIf the move\'s intended target also has this ability, the move is not redirected.  When multiple Pokémon with this ability are possible targets for redirection, the move is redirected to the one with the highest Speed stat, or, in the case of a tie, to a random tied Pokémon.  follow me takes precedence over this ability.\n\nIf the Pokémon is a ground-type and thus immune to Electric moves, its immunity prevents the Special Attack boost.','2023-11-22 07:21:06','2023-11-22 07:21:06'),(32,'serene-grace','This Pokémon\'s moves have twice their usual effect chance.\n\nAn effect chance is a move\'s chance to inflict a status ailment, cause a stat change, or make the target flinch in addition to the move\'s main effect.  For example, flamethrower\'s chance of burning the target is doubled, but protect\'s chance of success and air cutter\'s increased critical hit rate are unaffected.\n\nsecret power is unaffected.','2023-11-22 07:21:06','2023-11-22 07:21:06'),(33,'swift-swim','This Pokémon\'s Speed is doubled during rain.\n\nThis bonus does not count as a stat modifier.','2023-11-22 07:21:06','2023-11-22 07:21:06'),(34,'chlorophyll','This Pokémon\'s Speed is doubled during strong sunlight.\n\nThis bonus does not count as a stat modifier.','2023-11-22 07:21:06','2023-11-22 07:21:06'),(35,'illuminate','Overworld: If the lead Pokémon has this ability, the wild encounter rate is doubled.\n\nThis ability has no effect in battle.','2023-11-22 07:21:07','2023-11-22 07:21:07'),(36,'trace','When this Pokémon enters battle, it copies a random opponent\'s ability.\n\nThis ability cannot copy flower gift, forecast, illusion, imposter, multitype, trace, wonder guard, or zen mode.','2023-11-22 07:21:07','2023-11-22 07:21:07'),(37,'huge-power','This Pokémon\'s Attack is doubled while in battle.\n\nThis bonus does not count as a stat modifier.\n\nThis ability functions identically to pure power.','2023-11-22 07:21:07','2023-11-22 07:21:07'),(38,'poison-point','Whenever a move makes contact with this Pokémon, the move\'s user has a 30% chance of being poisoned.','2023-11-22 07:21:08','2023-11-22 07:21:08'),(39,'inner-focus','This Pokémon cannot flinch.','2023-11-22 07:21:08','2023-11-22 07:21:08'),(40,'magma-armor','This Pokémon cannot be frozen.\n\nIf a Pokémon is frozen and acquires this ability, it will immediately thaw out; this includes when regaining a lost ability upon leaving battle.\n\nOverworld: If any Pokémon in the party has this ability, each egg in the party has its hatch counter decreased by 2 (rather than 1) each step cycle, making eggs hatch roughly twice as quickly.  This effect does not stack if multiple Pokémon have this ability or flame body.','2023-11-22 07:21:08','2023-11-22 07:21:08'),(41,'water-veil','This Pokémon cannot be burned.\n\nIf a Pokémon is burned and acquires this ability, its burn is healed; this includes when regaining a lost ability upon leaving battle.','2023-11-22 07:21:08','2023-11-22 07:21:08'),(42,'magnet-pull','While this Pokémon is in battle, opposing steel-type Pokémon cannot flee or switch out.\n\nPokémon with run away can still flee.  Pokémon can still switch out with the use of a move or item.\n\nOverworld: If the lead Pokémon has this ability, Steel-type Pokémon have a higher encounter rate.','2023-11-22 07:21:08','2023-11-22 07:21:08'),(43,'soundproof','This Pokémon is immune to moves flagged as being sound-based.\n\nheal bell is unaffected.  uproar still prevents this Pokémon from sleeping.  This Pokémon can still receive a Perish Song counter through baton pass, and will retain a Perish Song counter if it acquires this ability after Perish Song is used.\n\nhowl, roar of time, sonic boom, and yawn are not flagged as sound-based.','2023-11-22 07:21:09','2023-11-22 07:21:09'),(44,'rain-dish','This Pokémon heals for 1/16 of its maximum HP after each turn during rain.','2023-11-22 07:21:09','2023-11-22 07:21:09'),(45,'sand-stream','The weather changes to a sandstorm when this Pokémon enters battle and does not end unless cancelled by another weather condition.\n\nIf multiple Pokémon with this ability, drizzle, drought, or snow warning are sent out at the same time, the abilities will activate in order of Speed, respecting trick room.  Each ability\'s weather will cancel the previous weather, and only the weather summoned by the slowest of the Pokémon will stay.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is halved in a sandstorm.','2023-11-22 07:21:09','2023-11-22 07:21:09'),(46,'pressure','Moves targetting this Pokémon use one extra PP.\n\nThis ability stacks if multiple targets have it.  This ability still affects moves that fail or miss.  This ability does not affect ally moves that target either the entire field or just its side, nor this Pokémon\'s self-targetted moves; it does, however, affect single-targetted ally moves aimed at this Pokémon, ally moves that target all other Pokémon, and opponents\' moves that target the entire field.  If this ability raises a move\'s PP cost above its remaining PP, it will use all remaining PP.\n\nWhen this Pokémon enters battle, all participating trainers are notified that it has this ability.\n\nOverworld: If the lead Pokémon has this ability, higher-levelled Pokémon have their encounter rate increased.','2023-11-22 07:21:09','2023-11-22 07:21:09'),(47,'thick-fat','This Pokémon takes half as much damage from fire- and ice-type moves.','2023-11-22 07:21:09','2023-11-22 07:21:09'),(48,'early-bird','This Pokémon\'s remaining sleep turn count falls by 2 rather than 1.\n\nIf this Pokémon\'s sleep counter is at 1, it will fall to 0 and then the Pokémon will wake up.','2023-11-22 07:21:10','2023-11-22 07:21:10'),(49,'flame-body','Whenever a move makes contact with this Pokémon, the move\'s user has a 30% chance of being burned.\n\nOverworld: If any Pokémon in the party has this ability, each egg in the party has its hatch counter decreased by 2 (rather than 1) each step cycle, making eggs hatch roughly twice as quickly.  This effect does not stack if multiple Pokémon have this ability or magma armor.','2023-11-22 07:21:10','2023-11-22 07:21:10'),(50,'run-away','This Pokémon is always successful fleeing from wild battles, even if trapped by a move or ability.','2023-11-22 07:21:10','2023-11-22 07:21:10'),(51,'keen-eye','This Pokémon cannot have its accuracy lowered.\n\nThis ability does not prevent any accuracy losses other than stat modifiers, such as the accuracy cut from fog; nor does it prevent other Pokémon\'s evasion from making this Pokémon\'s moves less accurate.  This Pokémon can still be passed negative accuracy modifiers through heart swap.\n\nOverworld: If the first Pokémon in the party has this ability, any random encounter with a Pokémon five or more levels lower than it has a 50% chance of being skipped.','2023-11-22 07:21:10','2023-11-22 07:21:10'),(52,'hyper-cutter','This Pokémon\'s Attack cannot be lowered by other Pokémon.\n\nThis ability does not prevent any Attack losses other than stat modifiers, such as the Attack cut from a burn.  This Pokémon can still be passed negative Attack modifiers through heart swap or power swap.','2023-11-22 07:21:10','2023-11-22 07:21:10'),(53,'pickup','At the end of each turn, if another Pokémon consumed or Flung a held item that turn, this Pokémon picks up the item if it is not already holding one.  After each battle, this Pokémon has a 10% chance of picking up an item if it is not already holding one.\n\nThe air balloon and eject button cannot be picked up.\n\nThe items that may be found vary by game, and, since Pokémon Emerald, by the Pokémon\'s level.  This ability is checked after the battle ends, at which point any temporary ability changes have worn off.','2023-11-22 07:21:10','2023-11-22 07:21:10'),(54,'truant','Every second turn on which this Pokémon should attempt to use a move, it will instead do nothing (\"loaf around\").\n\nLoafing around interrupts moves that take multiple turns the same way paralysis, flinching, etc do.  Most such moves, for example bide or rollout, are simply cut off upon loafing around.  Attacks with a recharge turn, such as hyper beam, do not have to recharge; attacks with a preparation turn, such as fly, do not end up being used.  Moves that are forced over multiple turns and keep going through failure, such as outrage, uproar, or any move forced by encore, keep going as usual.\n\nIf this Pokémon is confused, its confusion is not checked when loafing around; the Pokémon cannot hurt itself, and its confusion does not end or come closer to ending.\n\nIf this Pokémon attempts to move but fails, e.g. because of paralysis or gravity, it still counts as having moved and will loaf around the next turn.  If it does not attempt to move, e.g. because it is asleep or frozen, whatever it would have done will be postponed until its next attempt; that is, it will either loaf around or move as usual, depending on what it last did.\n\nThis ability cannot be changed with worry seed, but it can be disabled with gastro acid, changed with role play, or traded away with skill swap.','2023-11-22 07:21:10','2023-11-22 07:21:10'),(55,'hustle','This Pokémon\'s physical moves do 1.5× as much regular damage, but have 0.8× their usual accuracy.\n\nSpecial moves are unaffected.  Moves that do set damage, such as seismic toss, have their accuracy affected, but not their damage.\n\nOverworld: If the lead Pokémon has this ability, higher-levelled Pokémon have their encounter rate increased.','2023-11-22 07:21:10','2023-11-22 07:21:10'),(56,'cute-charm','Whenever a move makes contact with this Pokémon, the move\'s user has a 30% chance of being infatuated.\n\nOverworld: If the first Pokémon in the party has this ability, any wild Pokémon whose species can be either gender has a 2/3 chance of being set to the opposite gender, and a 1/3 chance of having a random gender as usual.','2023-11-22 07:21:10','2023-11-22 07:21:10'),(57,'plus','This Pokémon has 1.5× its Special Attack if any friendly Pokémon has plus or minus.\n\nThis bonus does not count as a stat modifier.  If either ability is disabled by gastro acid, both lose their effect.','2023-11-22 07:21:10','2023-11-22 07:21:10'),(58,'minus','This Pokémon has 1.5× its Special Attack if any friendly Pokémon has plus or minus.\n\nThis bonus does not count as a stat modifier.  If either ability is disabled by gastro acid, both lose their effect.','2023-11-22 07:21:11','2023-11-22 07:21:11'),(59,'forecast','During rain, strong sunlight, or hail, this Pokémon\'s type changes to water, fire, or ice, respectively, and its form changes to match.\n\nThis ability has no effect for any Pokémon other than castform.\n\nIf the weather ends or becomes anything that does not trigger this ability, or a Pokémon with air lock or cloud nine enters battle, this Pokémon\'s type and form revert to their default.  If this ability is lost or disabled, this Pokémon cannot change its current type and form until it regains its ability.','2023-11-22 07:21:11','2023-11-22 07:21:11'),(60,'sticky-hold','This Pokémon\'s hold item cannot be removed by other Pokémon.\n\nDamaging moves that would remove this Pokémon\'s item can still inflict damage against this Pokémon, e.g. knock off or pluck.  This Pokémon can still use moves that involve the loss of its own item, e.g. fling or trick.\n\nOverworld: If the lead Pokémon has this ability, the encounter rate while fishing is increased.','2023-11-22 07:21:11','2023-11-22 07:21:11'),(61,'shed-skin','After each turn, this Pokémon has a 33% of being cured of any major status ailment.','2023-11-22 07:21:11','2023-11-22 07:21:11'),(62,'guts','Whenever this Pokémon is asleep, burned, paralyzed, or poisoned, it has 1.5× its Attack.  This Pokémon is not affected by the usual Attack cut from a burn.\n\nThis bonus does not count as a stat modifier.','2023-11-22 07:21:11','2023-11-22 07:21:11'),(63,'marvel-scale','Whenever this Pokémon has a major status ailment, it has 1.5× its Defense.\n\nThis bonus does not count as a stat modifier.','2023-11-22 07:21:12','2023-11-22 07:21:12'),(64,'liquid-ooze','Whenever a Pokémon would heal after hitting this Pokémon with a leeching move like absorb, it instead loses as many HP as it would usually gain.\n\ndream eater is unaffected.','2023-11-22 07:21:12','2023-11-22 07:21:12'),(65,'overgrow','When this Pokémon has 1/3 or less of its HP remaining, its grass-type moves inflict 1.5× as much regular damage.','2023-11-22 07:21:12','2023-11-22 07:21:12'),(66,'blaze','When this Pokémon has 1/3 or less of its HP remaining, its fire-type moves inflict 1.5× as much regular damage.','2023-11-22 07:21:12','2023-11-22 07:21:12'),(67,'torrent','When this Pokémon has 1/3 or less of its HP remaining, its water-type moves inflict 1.5× as much regular damage.','2023-11-22 07:21:13','2023-11-22 07:21:13'),(68,'swarm','When this Pokémon has 1/3 or less of its HP remaining, its bug-type moves inflict 1.5× as much regular damage.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is increased.','2023-11-22 07:21:13','2023-11-22 07:21:13'),(69,'rock-head','This Pokémon does not receive recoil damage from its recoil moves.\n\nstruggle\'s recoil is unaffected.  This ability does not prevent crash damage from missing with jump kick or high jump kick.','2023-11-22 07:21:14','2023-11-22 07:21:14'),(70,'drought','The weather changes to strong sunlight when this Pokémon enters battle and does not end unless cancelled by another weather condition.\n\nIf multiple Pokémon with this ability, drizzle, sand stream, or snow warning are sent out at the same time, the abilities will activate in order of Speed, respecting trick room.  Each ability\'s weather will cancel the previous weather, and only the weather summoned by the slowest of the Pokémon will stay.','2023-11-22 07:21:14','2023-11-22 07:21:14'),(71,'arena-trap','While this Pokémon is in battle, opposing Pokémon cannot flee or switch out.  flying-type Pokémon and Pokémon in the air, e.g. due to levitate or magnet rise, are unaffected.\n\nPokémon with run away can still flee.  Pokémon can still switch out with the use of a move or item.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is doubled.','2023-11-22 07:21:14','2023-11-22 07:21:14'),(72,'vital-spirit','This Pokémon cannot be asleep.\n\nThis causes rest to fail altogether.  If a Pokémon is asleep and acquires this ability, it will immediately wake up; this includes when regaining a lost ability upon leaving battle.\n\nThis ability functions identically to insomnia in battle.\n\nOverworld: If the lead Pokémon has this ability, higher-levelled Pokémon have their encounter rate increased.','2023-11-22 07:21:14','2023-11-22 07:21:14'),(73,'white-smoke','This Pokémon cannot have its stats lowered by other Pokémon.\n\nThis ability does not prevent any stat losses other than stat modifiers, such as the Speed cut from paralysis; nor self-inflicted stat drops, such as the Special Attack drop from overheat; nor opponent-triggered stat boosts, such as the Attack boost from swagger.  This Pokémon can still be passed negative stat modifiers through guard swap, heart swap, or power swap.\n\nThis ability functions identically to clear body in battle.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is halved.','2023-11-22 07:21:14','2023-11-22 07:21:14'),(74,'pure-power','This Pokémon\'s Attack is doubled in battle.\n\nThis bonus does not count as a stat modifier.\n\nThis ability functions identically to huge power.','2023-11-22 07:21:15','2023-11-22 07:21:15'),(75,'shell-armor','Moves cannot score critical hits against this Pokémon.\n\nThis ability functions identically to battle armor.','2023-11-22 07:21:15','2023-11-22 07:21:15'),(76,'air-lock','While this Pokémon is in battle, weather can still be in play, but will not have any of its effects.\n\nThis ability functions identically to cloud nine.','2023-11-22 07:21:15','2023-11-22 07:21:15'),(77,'tangled-feet','When this Pokémon is confused, it has twice its evasion.','2023-11-22 07:21:15','2023-11-22 07:21:15'),(78,'motor-drive','Whenever an electric-type move hits this Pokémon, its Speed rises one stage, negating any other effect on it.\n\nThis ability will not take effect if this Pokémon is immune to Electric moves.  Electric moves will ignore this Pokémon\'s substitute.\n\nThis effect includes non-damaging moves, i.e. thunder wave.','2023-11-22 07:21:15','2023-11-22 07:21:15'),(79,'rivalry','This Pokémon inflicts 1.25× as much regular damage against Pokémon of the same gender and 0.75× as much regular damage against Pokémon of the opposite gender.\n\nIf either Pokémon is genderless, damage is unaffected.','2023-11-22 07:21:15','2023-11-22 07:21:15'),(80,'steadfast','Whenever this Pokémon flinches, its Speed rises one stage.','2023-11-22 07:21:15','2023-11-22 07:21:15'),(81,'snow-cloak','During hail, this Pokémon has 1.25× its evasion, and it does not take hail damage regardless of type.\n\nThe evasion bonus does not count as a stat modifier.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is halved in snow.','2023-11-22 07:21:15','2023-11-22 07:21:15'),(82,'gluttony','This Pokémon eats any held Berry triggered by low HP when it falls below 50% of its HP, regardless of the Berry\'s usual threshold.','2023-11-22 07:21:16','2023-11-22 07:21:16'),(83,'anger-point','Whenever this Pokémon receives a critical hit, its Attack rises to the maximum of 6 stages.\n\nThis ability will still take effect if the critical hit is received by a substitute.','2023-11-22 07:21:16','2023-11-22 07:21:16'),(84,'unburden','When this Pokémon uses or loses its held item, its Speed is doubled.  If it gains another item or leaves battle, this bonus is lost.\n\nThis includes when the Pokémon drops its item because of knock off.  This bonus does not count as a stat modifier.  There is no notification when this ability takes effect.','2023-11-22 07:21:16','2023-11-22 07:21:16'),(85,'heatproof','This Pokémon takes half as much damage from fire-type moves and burns.','2023-11-22 07:21:16','2023-11-22 07:21:16'),(86,'simple','Each stage of this Pokémon\'s stat modifiers acts as two stages.  These doubled stages are still limited to a minimum of -6 and a maximum of 6.\n\nThis Pokémon can still accumulate less than -3 or more than 3 stages of stat modifiers, even though the extra ones have no effect after doubling.','2023-11-22 07:21:16','2023-11-22 07:21:16'),(87,'dry-skin','This Pokémon takes 1/8 of its maximum HP in damage after each turn during strong sunlight, but it heals for 1/8 of its HP each turn during rain.  This Pokémon takes 1.25× as much damage from fire-type moves, but whenever a water move hits it, it heals for 1/4 its maximum HP instead.','2023-11-22 07:21:16','2023-11-22 07:21:16'),(88,'download','When this Pokémon enters battle, its Attack or Special Attack, whichever corresponds to its opponents\' weaker total defensive stat, rises one stage.  In the event of a tie, Special Attack is raised.\n\nThis ability also takes effect when acquired during a battle.','2023-11-22 07:21:17','2023-11-22 07:21:17'),(89,'iron-fist','Moves flagged as being punch-based have 1.2× their base power for this Pokémon.\n\nsucker punch is not flagged as punch-based; its original, Japanese name only means \"surprise attack\".','2023-11-22 07:21:17','2023-11-22 07:21:17'),(90,'poison-heal','If this Pokémon is poisoned, it will heal for 1/8 of its maximum HP after each turn rather than taking damage.  This includes bad poison.','2023-11-22 07:21:17','2023-11-22 07:21:17'),(91,'adaptability','This Pokémon inflicts twice as much damage with moves whose types match its own, rather than the usual same-type attack bonus of 1.5×.','2023-11-22 07:21:17','2023-11-22 07:21:17'),(92,'skill-link','This Pokémon always hits five times with two-to-five-hit moves, such as icicle spear.  It also bypasses the accuracy checks on triple kick\'s second and third hits.','2023-11-22 07:21:17','2023-11-22 07:21:17'),(93,'hydration','This Pokémon is cured of any major status ailment after each turn during rain.','2023-11-22 07:21:17','2023-11-22 07:21:17'),(94,'solar-power','During strong sunlight, this Pokémon has 1.5× its Special Attack but takes 1/8 of its maximum HP in damage after each turn.','2023-11-22 07:21:18','2023-11-22 07:21:18'),(95,'quick-feet','Whenever this Pokémon has a major status ailment, it has 1.5× its Speed.  This Pokémon is not affected by the usual Speed cut from paralysis.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is halved.','2023-11-22 07:21:18','2023-11-22 07:21:18'),(96,'normalize','This Pokémon\'s moves all act as if they were normal-type.\n\nMoves that inflict typeless damage do so as usual.  Moves of variable type, such as hidden power, are affected.  They otherwise work as usual, however; weather ball, for example, is always forced to be Normal, but it still has doubled power and looks different during weather.\n\nAs thunder wave is prevented by immunities, unlike most non-damaging moves, it does not affect ghost-type Pokémon under the effect of this ability.','2023-11-22 07:21:18','2023-11-22 07:21:18'),(97,'sniper','This Pokémon inflicts triple damage with critical hits, rather than the usual double damage.','2023-11-22 07:21:18','2023-11-22 07:21:18'),(98,'magic-guard','This Pokémon is immune to damage not directly caused by a move.\n\nFor example, this Pokémon takes no damage from from weather, recoil, status ailments, or spikes, but it still suffers from the Attack cut when burned, and a life orb will still power up this Pokémon\'s moves without damaging it.  Anything that directly depends on such damage will also not happen; for example, leech seed will neither hurt this Pokémon nor heal the opponent, and Pokémon with a jaboca berry or rowap berry will not consume the berry when hit by this Pokémon.\n\nThe following are unaffected: struggle, pain split (whether used by or against this Pokémon), belly drum, substitute, curse, moves that knock the user out, and damage from confusion.\n\nThis Pokémon will neither lose nor regain HP if it drains HP from a Pokémon with liquid ooze.\n\nIf this Pokémon is badly poisoned, the poison counter is still increased each turn; if the Pokémon loses this ability, it will begin taking as much damage as it would be if it had been taking increasing damage each turn.','2023-11-22 07:21:19','2023-11-22 07:21:19'),(99,'no-guard','Moves used by or against this Pokémon never miss.\n\nOne-hit KO moves are unaffected.  Moves affected by this ability can hit Pokémon during the preparation turn of moves like dig or fly.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is doubled.','2023-11-22 07:21:19','2023-11-22 07:21:19'),(100,'stall','This Pokémon moves last within its priority bracket.\n\nMultiple Pokémon with this ability move in order of Speed amongst themselves.\n\nThe full incense and lagging tail take precedence over this ability; that is, Pokémon with these items move after Pokémon with this ability.  Pokémon with both this ability and one of these items are delayed as much as if they had only the item.\n\nThis ability works as usual during trick room: Pokémon with this ability will move in reverse order of Speed after Pokémon without it.','2023-11-22 07:21:19','2023-11-22 07:21:19'),(101,'technician','This Pokémon\'s moves have 1.5× their power if their base power is 60 or less.\n\nThis includes moves of variable power, such as hidden power and magnitude, when their power is 60 or less.  helping hand\'s power boost is taken into account for any move, as is defense curl\'s power boost for rollout.','2023-11-22 07:21:19','2023-11-22 07:21:19'),(102,'leaf-guard','This Pokémon cannot be given a major status ailment during strong sunlight.\n\nThis ability does not heal prior status ailments.  rest will fail altogether with this ability in effect.  yawn will immediately fail if used on this Pokémon during strong sunlight, and an already-used Yawn will fail if the weather turns to strong sunlight in the meantime.','2023-11-22 07:21:19','2023-11-22 07:21:19'),(103,'klutz','In battle, this Pokémon cannot use its held item, nor will the item have any passive effect on the battle, positive or negative.  This Pokémon also cannot use fling.\n\nThe Speed cut from the iron ball and the effort items (the macho brace, power weight, power bracer, power belt, power lens, power band, and power anklet) is unaffected.  Items that do not directly affect the battle, such as the exp share, the amulet coin, or the soothe bell, work as usual.  All held items work as usual out of battle.\n\nOther moves that use the held item, such as natural gift and switcheroo, work as usual.','2023-11-22 07:21:19','2023-11-22 07:21:19'),(104,'mold-breaker','This Pokémon\'s moves completely ignore abilities that could hinder or prevent their effect on the target.\n\nFor example, this Pokémon\'s moves ignore abilities that would fully negate them, such as water absorb; abilities that would prevent any of their effects, such as clear body, shell armor, or sticky hold; and abilities that grant any general protective benefit, such as simple, snow cloak, or thick fat.  If an ability could either hinder or help this Pokémon\'s moves, e.g. dry skin or unaware, the ability is ignored either way.\n\nAbilities that do not fit this description, even if they could hinder moves in some other way, are not affected.  For example, cursed body only affects potential future uses of the move, while liquid ooze and shadow tag can only hinder a move\'s effect on the user.  This ablity cannot ignore type or form changes granted by abilities, for example color change or forecast; nor effects that were caused by abilities but are no longer tied to an ability, such as the rain from drizzle.  This ability cannot ignore multitype at all.\n\nAn ability ignored by this ability is only nullified while the move is being used.  For example, this Pokémon\'s moves can paralyze a Pokémon with limber, but Limber will activate and heal the paralysis immediately thereafter, and this Pokémon\'s spikes are not affected by this ability after they have been placed.\n\nWhen this Pokémon enters battle, all participating trainers are notified that it has this ability.\n\nThis ability functions identically to teravolt and turboblaze.','2023-11-22 07:21:19','2023-11-22 07:21:19'),(105,'super-luck','This Pokémon\'s moves have critical hit rates one stage higher than normal.','2023-11-22 07:21:19','2023-11-22 07:21:19'),(106,'aftermath','When this Pokémon is knocked out by a move that makes contact, the move\'s user takes 1/4 its maximum HP in damage.','2023-11-22 07:21:19','2023-11-22 07:21:19'),(107,'anticipation','When this Pokémon enters battle, if one of its opponents has a move that is super effective against it, self destruct, explosion, or a one-hit knockout move, all participating trainers are notified.\n\nThe move itself is not revealed; only that there is such a move.  Moves that inflict typeless damage, such as future sight, and moves of variable type, such as hidden power, count as their listed types.  counter, metal burst, mirror coat, and one-hit KO moves to which this Pokémon is immune do not trigger this ability.','2023-11-22 07:21:19','2023-11-22 07:21:19'),(108,'forewarn','When this Pokémon enters battle, it reveals the move with the highest base power known by any opposing Pokémon to all participating trainers.\n\nIn the event of a tie, one is chosen at random.\n\nMoves without a listed base power are assigned one as follows:\n\nPower | Moves\n----: | -----\n  160 | One-hit KO moves: fissure, guillotine, horn drill, and sheer cold\n  120 | Counter moves: counter, metal burst, and mirror coat\n   80 | Variable power or set damage: crush grip, dragon rage, electro ball, endeavor, final gambit, flail, frustration, grass knot, gyro ball, heat crash, heavy slam, hidden power, low kick, natural gift, night shade, psywave, return, reversal, seismic toss, sonic boom, trump card, and wring out\n    0 | Any such move not listed\n','2023-11-22 07:21:19','2023-11-22 07:21:19'),(109,'unaware','This Pokémon ignores other Pokémon\'s stat modifiers for the purposes of damage and accuracy calculation.\n\nEffectively, this affects modifiers of every stat except Speed.\n\nThe power of punishment and stored power is calculated as usual.  When this Pokémon hurts itself in confusion, its stat modifiers affect damage as usual.','2023-11-22 07:21:20','2023-11-22 07:21:20'),(110,'tinted-lens','This Pokémon deals twice as much damage with moves that are not very effective against the target.','2023-11-22 07:21:20','2023-11-22 07:21:20'),(111,'filter','This Pokémon takes 0.75× as much damage from moves that are super effective against it.\n\nThis ability functions identically to solid rock.','2023-11-22 07:21:20','2023-11-22 07:21:20'),(112,'slow-start','This Pokémon\'s Attack and Speed are halved for five turns upon entering battle.\n\nThis ability also takes effect when acquired during battle.  If this Pokémon loses its ability before the five turns are up, its Attack and Speed return to normal; if it then regains this ability without leaving battle, its Attack and Speed are halved again, but the counter keeps counting from where it was.','2023-11-22 07:21:20','2023-11-22 07:21:20'),(113,'scrappy','This Pokémon ignores ghost-type Pokémon\'s immunity to normal- and fighting-type moves.\n\nGhost Pokémon\'s other types affect damage as usual.','2023-11-22 07:21:20','2023-11-22 07:21:20'),(114,'storm-drain','All other Pokémon\'s single-target water-type moves are redirected to this Pokémon, if it is an eligible target.  Other Pokémon\'s Water moves raise this Pokémon\'s Special Attack one stage, negating any other effect on it, and cannot miss it.\n\nIf the move\'s intended target also has this ability, the move is not redirected.  When multiple Pokémon with this ability are possible targets for redirection, the move is redirected to the one with the highest Speed stat, or, in the case of a tie, to a random tied Pokémon.  follow me takes precedence over this ability.','2023-11-22 07:21:20','2023-11-22 07:21:20'),(115,'ice-body','This Pokémon heals for 1/16 of its maximum HP after each turn during hail, and it does not take hail damage regardless of type.','2023-11-22 07:21:20','2023-11-22 07:21:20'),(116,'solid-rock','This Pokémon takes 0.75× as much damage from moves that are super effective against it.\n\nThis ability functions identically to filter.','2023-11-22 07:21:21','2023-11-22 07:21:21'),(117,'snow-warning','The weather changes to hail when this Pokémon enters battle and does not end unless cancelled by another weather condition.\n\nIf multiple Pokémon with this ability, drizzle, drought, or sand stream are sent out at the same time, the abilities will activate in order of Speed, respecting trick room.  Each ability\'s weather will cancel the previous weather, and only the weather summoned by the slowest of the Pokémon will stay.','2023-11-22 07:21:21','2023-11-22 07:21:21'),(118,'honey-gather','This Pokémon has a chance of picking up honey after each battle.  This chance starts at 5% and rises another 5% after every tenth level: 5% from level 1–10, 10% from 11–20, and so on, up to 50% from 91–100.\n\nThis ability is checked after the battle ends, at which point any temporary ability changes have worn off.','2023-11-22 07:21:21','2023-11-22 07:21:21'),(119,'frisk','When this Pokémon enters battle, it reveals an opposing Pokémon\'s held item to all participating trainers.\n\nIn a double battle, if one opponent has an item, this Pokémon will Frisk that Pokémon; if both have an item, it will Frisk one at random.','2023-11-22 07:21:21','2023-11-22 07:21:21'),(120,'reckless','This Pokémon\'s recoil moves and crash moves have 1.2× their base power.\n\nstruggle is unaffected.\n\nThe \"crash moves\" are the moves that damage the user upon missing: jump kick and high jump kick.','2023-11-22 07:21:21','2023-11-22 07:21:21'),(121,'multitype','If this Pokémon is holding an elemental Plate, its type and form change to match the Plate.\n\nThis Pokémon\'s held item, whether or not it is a Plate, cannot be taken by covet or thief, nor removed by knock off, nor traded by switcheroo or trick.  Covet, Thief, and Knock Off still inflict damage against this Pokémon.  Unlike with sticky hold, this Pokémon cannot use fling, Switcheroo, or Trick to lose its item itself, nor gain an item through Switcheroo or Trick if it does not have one.\n\nThis ability has no effect for any Pokémon other than arceus.  This ability cannot be traded with skill swap, nor copied with role play or trace, nor disabled with gastro acid, nor changed with worry seed.  This Pokémon cannot use Skill Swap or Role Play to lose its ability itself.  mold breaker cannot ignore this ability.\n\nIf a Pokémon Transforms into an Arceus with this ability, it will Transform into Arceus\'s default, normal-type form.  If the Transforming Pokémon is holding a Plate, this ability will then activate and change the Pokémon into the corresponding form.','2023-11-22 07:21:21','2023-11-22 07:21:21'),(122,'flower-gift','Friendly Pokémon have 1.5× their Attack and Special Defense during strong sunlight if any friendly Pokémon has this ability.\n\nUnlike forecast, multitype, and zen mode, this ability is not tied to its Pokémon\'s form change; cherrim will switch between its forms even if it loses this ability.  As such, this ability also works if obtained by a Pokémon other than Cherrim.','2023-11-22 07:21:22','2023-11-22 07:21:22'),(123,'bad-dreams','Opposing Pokémon take 1/8 of their maximum HP in damage after each turn while they are asleep.','2023-11-22 07:21:22','2023-11-22 07:21:22'),(124,'pickpocket','Whenever a move makes contact with this Pokémon, if it does not have a held item, it steals the attacker\'s held item.\n\nThis Pokémon cannot steal upon being knocked out.  It can steal if the attacker has a substitute, but cannot steal when its own Substitute is hit.  If a move hits multiple times, only the last hit triggers this ability.  If this Pokémon is wild, it cannot steal from a trained Pokémon.','2023-11-22 07:21:22','2023-11-22 07:21:22'),(125,'sheer-force','This Pokémon\'s moves with extra effects have 1.3× their power, but lose their extra effects.\n\nAn effect chance is a move\'s chance to inflict a status ailment, cause a stat change, or make the target flinch in addition to the move\'s main effect. For example, thunder shock\'s paralysis is an extra effect, but thunder wave\'s is not, nor are knock off\'s item removal and air cutter\'s increased critical hit rate.\n\nMoves that lower the user\'s stats are unaffected.','2023-11-22 07:21:23','2023-11-22 07:21:23'),(126,'contrary','Whenever this Pokémon\'s stats would be raised, they are instead lowered by the same amount, and vice versa.','2023-11-22 07:21:23','2023-11-22 07:21:23'),(127,'unnerve','Opposing Pokémon cannot eat held Berries while this Pokémon is in battle.\n\nAffected Pokémon can still use bug bite or pluck to eat a target\'s Berry.','2023-11-22 07:21:23','2023-11-22 07:21:23'),(128,'defiant','When any of this Pokémon\'s stats are lowered, its Attack rises by two stages.\n\nIf multiple stats are lowered at once, this ability takes effect with each stat lowered.','2023-11-22 07:21:23','2023-11-22 07:21:23'),(129,'defeatist','This Pokémon\'s Attack and Special Attack are halved when it has half its HP or less.','2023-11-22 07:21:23','2023-11-22 07:21:23'),(130,'cursed-body','Moves that hit this Pokémon have a 30% chance of being Disabled afterward.','2023-11-22 07:21:23','2023-11-22 07:21:23'),(131,'healer','Friendly Pokémon next to this Pokémon in double and triple battles each have a 30% chance of being cured of any major status ailment after each turn.','2023-11-22 07:21:24','2023-11-22 07:21:24'),(132,'friend-guard','All friendly Pokémon take 0.75× as much direct damage from moves while this Pokémon is in battle.\n\nThis effect stacks if multiple allied Pokémon have it.','2023-11-22 07:21:24','2023-11-22 07:21:24'),(133,'weak-armor','Whenever a physical move hits this Pokémon, its Speed rises one stage and its Defense falls one stage.\n\nThis ability triggers on every hit of a multiple-hit move.','2023-11-22 07:21:24','2023-11-22 07:21:24'),(134,'heavy-metal','This Pokémon has double the usual weight for its species.','2023-11-22 07:21:24','2023-11-22 07:21:24'),(135,'light-metal','This Pokémon has half the usual weight for its species.','2023-11-22 07:21:24','2023-11-22 07:21:24'),(136,'multiscale','This Pokémon takes half as much damage when it is hit having full HP.','2023-11-22 07:21:25','2023-11-22 07:21:25'),(137,'toxic-boost','This Pokémon has 1.5× its Attack when poisoned.','2023-11-22 07:21:25','2023-11-22 07:21:25'),(138,'flare-boost','This Pokémon has 1.5× its Special Attack when burned.','2023-11-22 07:21:25','2023-11-22 07:21:25'),(139,'harvest','After each turn, if the last item this Pokémon consumed was a Berry and it is not currently holding an item, it has a 50% chance of regaining that Berry, or a 100% chance during strong sunlight.','2023-11-22 07:21:25','2023-11-22 07:21:25'),(140,'telepathy','This Pokémon does not take damage from friendly Pokémon\'s moves, including single-target moves aimed at it.','2023-11-22 07:21:25','2023-11-22 07:21:25'),(141,'moody','After each turn, one of this Pokémon\'s stats at random rises two stages, and another falls one stage.\n\nIf a stat is already at 6 or -6 stages, it will not be chosen to be increased or decreased, respectively.','2023-11-22 07:21:25','2023-11-22 07:21:25'),(142,'overcoat','This Pokémon does not take damage from weather.','2023-11-22 07:21:25','2023-11-22 07:21:25'),(143,'poison-touch','This Pokémon\'s contact moves have a 30% chance of poisoning the target with each hit.\n\nThis counts as an extra effect for the purposes of shield dust.  This ability takes effect before mummy.','2023-11-22 07:21:26','2023-11-22 07:21:26'),(144,'regenerator','This Pokémon regains 1/3 of its maximum HP when it is switched out for another Pokémon under any circumstances other than having fainted.\n\nThis ability does not take effect when a battle ends.','2023-11-22 07:21:26','2023-11-22 07:21:26'),(145,'big-pecks','This Pokémon\'s Defense cannot be lowered by other Pokémon.\n\nThis Pokémon can still be passed negative Defense modifiers through heart swap or guard swap.','2023-11-22 07:21:26','2023-11-22 07:21:26'),(146,'sand-rush','This Pokémon\'s Speed is doubled during a sandstorm, and it does not take sandstorm damage, regardless of type.','2023-11-22 07:21:26','2023-11-22 07:21:26'),(147,'wonder-skin','Non-damaging moves have exactly 50% base accuracy against this Pokémon.','2023-11-22 07:21:26','2023-11-22 07:21:26'),(148,'analytic','This Pokémon\'s moves have 1.3× their power when it moves last in a turn.\n\nfuture sight and doom desire are unaffected.','2023-11-22 07:21:26','2023-11-22 07:21:26'),(149,'illusion','This Pokémon, upon being sent out, appears to have the species, nickname, and Poké Ball of the last Pokémon in the party that is able to battle.  This illusion breaks upon being hit by a damaging move.\n\nOther damage, e.g. from weather or spikes, does not break the illusion, nor does damage done to a substitute.\n\nIf the party order becomes temporarily shuffled around as Pokémon are switched out in battle, this ability chooses the last Pokémon according to that shuffled order.','2023-11-22 07:21:26','2023-11-22 07:21:26'),(150,'imposter','This Pokémon transforms into a random opponent upon entering battle.  This effect is identical to the move transform.','2023-11-22 07:21:26','2023-11-22 07:21:26'),(151,'infiltrator','This Pokémon\'s moves ignore light screen, reflect, and safeguard.','2023-11-22 07:21:27','2023-11-22 07:21:27'),(152,'mummy','Whenever a contact move hits this Pokémon, the attacking Pokémon\'s ability changes to Mummy.\n\nmultitype is unaffected.  If a Pokémon with moxie knocks this Pokémon out, the former\'s ability will change without taking effect.','2023-11-22 07:21:27','2023-11-22 07:21:27'),(153,'moxie','This Pokémon\'s Attack rises one stage upon knocking out another Pokémon, even a friendly Pokémon.\n\nThis ability does not take effect when the Pokémon indirectly causes another Pokémon to faint, e.g. through poison or spikes.\n\nIf this Pokémon knocks out a Pokémon with mummy, the former\'s ability will change without taking effect.','2023-11-22 07:21:27','2023-11-22 07:21:27'),(154,'justified','Whenever a dark-type move hits this Pokémon, its Attack rises one stage.\n\nThe move is not negated in any way.','2023-11-22 07:21:27','2023-11-22 07:21:27'),(155,'rattled','This Pokémon\'s Speed rises one stage with each hit from a damaging dark-, ghost-, or bug-type move.','2023-11-22 07:21:27','2023-11-22 07:21:27'),(156,'magic-bounce','When this Pokémon is targeted by a move flagged as being reflectable, the move is redirected to its user.\n\nAll reflectable moves are non-damaging, and most non-damaging moves that target other Pokémon are reflectable.\n\nA move reflected by this ability or magic coat cannot be reflected back.','2023-11-22 07:21:27','2023-11-22 07:21:27'),(157,'sap-sipper','Whenever a grass-type move hits this Pokémon, its Attack rises one stage, negating any other effect on it.','2023-11-22 07:21:27','2023-11-22 07:21:27'),(158,'prankster','This Pokémon\'s non-damaging moves have their priority increased by one stage.','2023-11-22 07:21:27','2023-11-22 07:21:27'),(159,'sand-force','During a sandstorm, this Pokémon\'s rock-, ground-, and steel-type moves have 1.3× their base power.  This Pokémon does not take sandstorm damage, regardless of type.','2023-11-22 07:21:27','2023-11-22 07:21:27'),(160,'iron-barbs','Whenever a move makes contact with this Pokémon, the move\'s user takes 1/8 of its maximum HP in damage.\n\nThis ability functions identically to rough skin.','2023-11-22 07:21:28','2023-11-22 07:21:28'),(161,'zen-mode','This Pokémon switches between Standard Mode and Zen Mode after each turn depending on its HP.  Below 50% of its maximum HP, it switches to Zen Mode, and at 50% or above, it switches to Standard Mode.\n\nThis Pokémon returns to Standard Mode upon leaving battle or losing this ability.  This ability has no effect if this Pokémon is not a darmanitan.','2023-11-22 07:21:28','2023-11-22 07:21:28'),(162,'victory-star','All friendly Pokémon\'s moves, including this Pokémon\'s own moves, have 1.1× their usual accuracy while this Pokémon is in battle.','2023-11-22 07:21:28','2023-11-22 07:21:28'),(163,'turboblaze','This Pokémon\'s moves completely ignore abilities that could hinder or prevent their effect on the target.\n\nFor example, this Pokémon\'s moves ignore abilities that would fully negate them, such as water absorb; abilities that would prevent any of their effects, such as clear body, shell armor, or sticky hold; and abilities that grant any general protective benefit, such as simple, snow cloak, or thick fat.  If an ability could either hinder or help this Pokémon\'s moves, e.g. dry skin or unaware, the ability is ignored either way.\n\nAbilities that do not fit this description, even if they could hinder moves in some other way, are not affected.  For example, cursed body only affects potential future uses of the move, while liquid ooze and shadow tag can only hinder a move\'s effect on the user.  This ablity cannot ignore type or form changes granted by abilities, for example color change or forecast; nor effects that were caused by abilities but are no longer tied to an ability, such as the rain from drizzle.  This ability cannot ignore multitype at all.\n\nAn ability ignored by this ability is only nullified while the move is being used.  For example, this Pokémon\'s moves can paralyze a Pokémon with limber, but Limber will activate and heal the paralysis immediately thereafter, and this Pokémon\'s spikes are not affected by this ability after they have been placed.\n\nWhen this Pokémon enters battle, all participating trainers are notified that it has this ability.\n\nThis ability functions identically to mold breaker and teravolt.','2023-11-22 07:21:28','2023-11-22 07:21:28'),(164,'teravolt','This Pokémon\'s moves completely ignore abilities that could hinder or prevent their effect on the target.\n\nFor example, this Pokémon\'s moves ignore abilities that would fully negate them, such as water absorb; abilities that would prevent any of their effects, such as clear body, shell armor, or sticky hold; and abilities that grant any general protective benefit, such as simple, snow cloak, or thick fat.  If an ability could either hinder or help this Pokémon\'s moves, e.g. dry skin or unaware, the ability is ignored either way.\n\nAbilities that do not fit this description, even if they could hinder moves in some other way, are not affected.  For example, cursed body only affects potential future uses of the move, while liquid ooze and shadow tag can only hinder a move\'s effect on the user.  This ablity cannot ignore type or form changes granted by abilities, for example color change or forecast; nor effects that were caused by abilities but are no longer tied to an ability, such as the rain from drizzle.  This ability cannot ignore multitype at all.\n\nAn ability ignored by this ability is only nullified while the move is being used.  For example, this Pokémon\'s moves can paralyze a Pokémon with limber, but Limber will activate and heal the paralysis immediately thereafter, and this Pokémon\'s spikes are not affected by this ability after they have been placed.\n\nWhen this Pokémon enters battle, all participating trainers are notified that it has this ability.\n\nThis ability functions identically to mold breaker and turboblaze.','2023-11-22 07:21:28','2023-11-22 07:21:28'),(165,'aroma-veil','Protects allies against moves that affect their mental state.','2023-11-22 07:21:28','2023-11-22 07:21:28'),(166,'flower-veil','Protects friendly grass Pokémon from having their stats lowered by other Pokémon.','2023-11-22 07:21:28','2023-11-22 07:21:28'),(167,'cheek-pouch','Restores HP upon eating a Berry, in addition to the Berry\'s effect.','2023-11-22 07:21:28','2023-11-22 07:21:28'),(168,'protean','Changes the bearer\'s type to match each move it uses.\n\nThe type change takes place just before the move is used.','2023-11-22 07:21:28','2023-11-22 07:21:28'),(169,'fur-coat','Halves damage from physical attacks.','2023-11-22 07:21:28','2023-11-22 07:21:28'),(170,'magician','Steals the target\'s held item when the bearer uses a damaging move.','2023-11-22 07:21:28','2023-11-22 07:21:28'),(171,'bulletproof','Protects