  anticipation and stealth rock are not affected.\n\nThe mysterious air current ends when this Pokémon leaves battle or loses this ability, or when this ability is nullified.  The weather cannot otherwise be changed except by the effects of desolate land and primordial sea.\n\nair lock and cloud nine will prevent the effect of a mysterious air current, but will not allow the weather to be changed.','2023-11-22 07:21:33','2023-11-22 07:21:33'),(192,'stamina','Raises this Pokémon\'s Defense by one stage when it takes damage from a move.','2023-11-22 07:21:33','2023-11-22 07:21:33'),(193,'wimp-out','After this Pokémon is hit by a move, if that move caused this Pokémon\'s HP to drop below half, it switches out.','2023-11-22 07:21:33','2023-11-22 07:21:33'),(194,'emergency-exit','After this Pokémon is hit by a move, if that move caused this Pokémon\'s HP to drop below half, it switches out.','2023-11-22 07:21:33','2023-11-22 07:21:33'),(195,'water-compaction','Raises this Pokémon\'s Defense by two stages when it\'s hit by a Water move.','2023-11-22 07:21:33','2023-11-22 07:21:33'),(196,'merciless','This Pokémon\'s moves critical hit against poisoned targets.','2023-11-22 07:21:33','2023-11-22 07:21:33'),(197,'shields-down','When this Pokémon enters battle and at the end of each turn, if its HP is 50% or above, it changes into Meteor Form; otherwise, it changes into Core Form.  In Meteor Form, it cannot be given a major status ailment (though existing ones are not cured), cannot become drowsy from yawn, and cannot use rest (which will simply fail).\n\nThis ability cannot be copied, replaced, or nullified.  This ability only takes effect for Minior.','2023-11-22 07:21:33','2023-11-22 07:21:33'),(198,'stakeout','This Pokémon\'s moves have double power against Pokémon that switched in this turn.','2023-11-22 07:21:34','2023-11-22 07:21:34'),(199,'water-bubble','When this Pokémon is hit by a Fire move, the damage is halved.  When this Pokémon uses a Water move, the power is doubled. This Pokémon cannot be burned, and if it becomes burned, the burn is immediately cured.','2023-11-22 07:21:34','2023-11-22 07:21:34'),(200,'steelworker','This Pokémon\'s Steel moves have 1.5× power.','2023-11-22 07:21:34','2023-11-22 07:21:34'),(201,'berserk','Whenever this Pokémon takes damage from a move that causes its HP to drop below 50%, its Special Attack rises by one stage.','2023-11-22 07:21:34','2023-11-22 07:21:34'),(202,'slush-rush','During Hail, this Pokémon has double Speed.','2023-11-22 07:21:34','2023-11-22 07:21:34'),(203,'long-reach','A move used by this Pokémon will not make contact.','2023-11-22 07:21:34','2023-11-22 07:21:34'),(204,'liquid-voice','When this Pokémon uses a move that is sound-based, that move\'s type is Water.','2023-11-22 07:21:34','2023-11-22 07:21:34'),(205,'triage','This Pokémon\'s healing moves have their priority increased by 3.','2023-11-22 07:21:34','2023-11-22 07:21:34'),(206,'galvanize','When this Pokémon uses a Normal moves, that move is Electric its power is 1.2×.','2023-11-22 07:21:35','2023-11-22 07:21:35'),(207,'surge-surfer','Doubles this Pokémon\'s Speed on Electric Terrain.','2023-11-22 07:21:35','2023-11-22 07:21:35'),(208,'schooling','If this Pokémon is a wishiwashi and level 20 or above, then when it enters battle and at the start of each turn, it becomes Schooling Form if its HP is 25% or higher and Solo Form otherwise.\n\nThis ability cannot be replaced, copied, or nullified.','2023-11-22 07:21:35','2023-11-22 07:21:35'),(209,'disguise','If this Pokémon is in its Disguised Form and takes damage from a move, it switches to its Busted Form and the damage is prevented.  Other effects are not prevented.\n\nThis ability cannot be copied or replaced.  This ability only takes effect for Mimikyu.','2023-11-22 07:21:35','2023-11-22 07:21:35'),(210,'battle-bond','Transforms this Pokémon into Ash-Greninja after fainting an opponent.  Water Shuriken\'s power is 20 and always hits three times.\n\nThis ability can