INSERT INTO `items` VALUES (1,'master-ball','Used in battle\n:   Catches a wild Pokémon without fail.\n\n    If used in a trainer battle, nothing happens and the ball is lost.','The best Poké Ball with the ultimate level of\nperformance. With it, you will catch any wild\nPokémon without fail.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/master-ball.png','2023-11-22 07:51:16','2023-11-22 07:51:16'),(2,'ultra-ball','Used in battle\n:   Attempts to catch a wild Pokémon, using a catch rate of 2×.\n\n    If used in a trainer battle, nothing happens and the ball is lost.','An ultra-high-performance Poké Ball that provides\na higher success rate for catching Pokémon than\na Great Ball.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/ultra-ball.png','2023-11-22 07:51:16','2023-11-22 07:51:16'),(3,'great-ball','Used in battle\n:   Attempts to catch a wild Pokémon, using a catch rate of 1.5×.\n\n    If used in a trainer battle, nothing happens and the ball is lost.','A good, high-performance Poké Ball that provides\na higher success rate for catching Pokémon than\na standard Poké Ball.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/great-ball.png','2023-11-22 07:51:16','2023-11-22 07:51:16'),(4,'poke-ball','Used in battle\n:   Attempts to catch a wild Pokémon, using a catch rate of 1×.\n\n    If used in a trainer battle, nothing happens and the ball is lost.','A device for catching wild Pokémon. It’s thrown like\na ball at a Pokémon, comfortably encapsulating\nits target.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/poke-ball.png','2023-11-22 07:51:16','2023-11-22 07:51:16'),(5,'safari-ball','Used in battle\n:   Attempts to catch a wild Pokémon, using a catch rate of 1.5×.\n\nThis item can only be used in the great marsh or kanto safari zone.','A special Poké Ball that was used in the Safari Zone\nin the Kanto region and in the Great Marsh in the\nSinnoh region.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/safari-ball.png','2023-11-22 07:51:16','2023-11-22 07:51:16'),(6,'net-ball','Used in battle\n:   Attempts to catch a wild Pokémon.  If the wild Pokémon is water- or bug-type, this ball has a catch rate of 3×.  Otherwise, it has a catch rate of 1×.\n\n    If used in a trainer battle, nothing happens and the ball is lost.','A somewhat different Poké Ball that is more\neffective when attempting to catch Water- or\nBug-type Pokémon.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/net-ball.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(7,'dive-ball','Used in battle\n:   Attempts to catch a wild Pokémon.  If the wild Pokémon was encountered by surfing or fishing, this ball has a catch rate of 3.5×.  Otherwise, it has a catch rate of 1×.\n\n    If used in a trainer battle, nothing happens and the ball is lost.','A somewhat different Poké Ball that works\nespecially well when catching Pokémon that\nlive underwater.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/dive-ball.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(8,'nest-ball','Used in battle\n:   Attempts to catch a wild Pokémon.  Has a catch rate of given by `(40 - level) / 10`, where `level` is the wild Pokémon\'s level, to a maximum of 3.9× for level 1 Pokémon.  If the wild Pokémon\'s level is higher than 30, this ball has a catch rate of 1×.\n\n    If used in a trainer battle, nothing happens and the ball is lost.','A somewhat different Poké Ball that becomes more\neffective the lower the level of the wild Pokémon.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/nest-ball.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(9,'repeat-ball','Used in battle\n:   Attempts to catch a wild Pokémon.  If the wild Pokémon\'s species is marked as caught in the trainer\'s Pokédex, this ball has a catch rate of 3×.  Otherwise, it has a catch rate of 1×.\n\n    If used in a trainer battle, nothing happens and the ball is lost.','A somewhat different Poké Ball that works\nespecially well on a Pokémon species that has been\ncaught before.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/repeat-ball.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(10,'timer-ball','Used in battle\n:   Attempts to catch a wild Pokémon.  Has a catch rate of 1.1× on the first turn of the battle and increases by 0.1× every turn, to a maximum of 4× on turn 30.\n\n    If used in a trainer battle, nothing happens and the ball is lost.','A somewhat different Poké Ball that becomes\nprogressively more effective at catching Pokémon\nthe more turns that are taken in battle.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/timer-ball.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(11,'luxury-ball','Used in battle\n:   Attempts to catch a wild Pokémon, using a catch rate of 1×.  Whenever the caught Pokémon\'s happiness increases, it increases by one extra point.\n\n    If used in a trainer battle, nothing happens and the ball is lost.','A particularly comfortable Poké Ball that makes a\nwild Pokémon quickly grow friendlier after\nbeing caught.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/luxury-ball.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(12,'premier-ball','Used in battle\n:   Attempts to catch a wild Pokémon, using a catch rate of 1×.\n\n    If used in a trainer battle, nothing happens and the ball is lost.','A somewhat rare Poké Ball that was made as a\ncommemorative item used to celebrate an event of\nsome sort.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/premier-ball.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(13,'dusk-ball','Used in battle\n:   Attempts to catch a wild Pokémon.  If it\'s currently nighttime or the wild Pokémon was encountered while walking in a cave, this ball has a catch rate of 3.5×.  Otherwise, it has a catch rate of 1×.\n\n    If used in a trainer battle, nothing happens and the ball is lost.','A somewhat different Poké Ball that makes it\neasier to catch wild Pokémon at night or in dark\nplaces such as caves.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/dusk-ball.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(14,'heal-ball','Used in battle\n:   Attempts to catch a wild Pokémon, using a catch rate of 1×.  The caught Pokémon\'s HP is immediately restored, PP for all its moves is restored, and any status ailment is cured.\n\n    If used in a trainer battle, nothing happens and the ball is lost.','A remedial Poké Ball that restores the HP of a\nPokémon caught with it and eliminates any\nstatus conditions.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/heal-ball.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(15,'quick-ball','Used in battle\n:   Attempts to catch a wild Pokémon, using a catch rate of 4× on the first turn of a battle, but 1× any other time.\n\n    If used in a trainer battle, nothing happens and the ball is lost.','A somewhat different Poké Ball that has a more\nsuccessful catch rate if used at the start of a\nwild encounter.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/quick-ball.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(16,'cherish-ball','Used in battle\n:   Attempts to catch a wild Pokémon, using a catch rate of 1×.\n\n    If used in a trainer battle, nothing happens and the ball is lost.','A quite rare Poké Ball that has been crafted in\norder to commemorate a special occasion of\nsome sort.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/cherish-ball.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(17,'potion','Used on a friendly Pokémon\n:   Restores 20 HP.','A spray-type medicine for treating wounds. It can\nbe used to restore 20 HP to a single Pokémon.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/potion.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(18,'antidote','Used on a party Pokémon\n:   Cures poison.','A spray-type medicine for treating poisoning. It can be\nused to lift the effects of being poisoned from\na single Pokémon.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/antidote.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(19,'burn-heal','Used on a party Pokémon\n:   Cures a burn.','A spray-type medicine for treating burns. It can be\nused to heal a single Pokémon suffering from a burn.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/burn-heal.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(20,'ice-heal','Used on a party Pokémon\n:   Cures freezing.','A spray-type medicine for treating freezing. It can be\nused to thaw out a single Pokémon that has been\nfrozen solid.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/ice-heal.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(21,'awakening','Used on a party Pokémon\n:   Cures sleep.','A spray-type medicine to wake the sleeping. It can be used\nto rouse a single Pokémon from the clutches of sleep.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/awakening.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(22,'paralyze-heal','Used on a party Pokémon\n:   Cures paralysis.','A spray-type medicine for treating paralysis. It can be\nused to free a single Pokémon that has been paralyzed.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/paralyze-heal.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(23,'full-restore','Used on a party Pokémon\n:   Restores HP to full and cures any status ailment and confusion.','A medicine that can be used to fully restore the HP of\na single Pokémon and heal any status conditions it has.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/full-restore.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(24,'max-potion','Used on a party Pokémon\n:   Restores HP to full.','A spray-type medicine for treating wounds. It can\nbe used to completely restore the max HP of\na single Pokémon.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/max-potion.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(25,'hyper-potion','Used on a party Pokémon\n:   Restores 200 HP.','A spray-type medicine for treating wounds. It can\nbe used to restore 120 HP to a single Pokémon.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/hyper-potion.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(26,'super-potion','Used on a party Pokémon\n:   Restores 50 HP.','A spray-type medicine for treating wounds. It can\nbe used to restore 60 HP to a single Pokémon.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/super-potion.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(27,'full-heal','Used on a party Pokémon\n:   Cures any status ailment and confusion.','A spray-type medicine that is broadly effective.\nIt can be used to heal all the status conditions\nof a single Pokémon.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/full-heal.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(28,'revive','Used on a party Pokémon\n:   Revives the Pokémon and restores half its HP.','A medicine that can be used to revive a single\nPokémon that has fainted. It also restores half of\nthe Pokémon’s max HP.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/revive.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(29,'max-revive','Used on a party Pokémon\n:   Revives the Pokémon and restores its HP to full.','A medicine that can be used to revive a single\nPokémon that has fainted. It also fully restores\nthe Pokémon’s max HP.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/max-revive.png','2023-11-22 07:51:17','2023-11-22 07:51:17'),(30,'fresh-water','Used on a party Pokémon\n:   Restores 50 HP.','Water with high min