rites/items/macho-brace.png','2023-11-22 07:51:27','2023-11-22 07:51:27'),(193,'exp-share','Held\n:   Experience is split across two groups: Pokémon who participated in battle, and Pokémon holding this item.  Each Pokémon earns experience as though it had battled alone, divided by the number of Pokémon in its group, then divided by the number of groups. Pokémon holding this item who also participated in battle effectively earn experience twice.\n\n    Fainted Pokémon never earn experience, and empty groups are\nignored; thus, if a single Pokémon is holding this item and the only Pokémon who battled faints from explosion, the holder will gain full experience.','Turning on this special device will allow all the Pokémon\non your team to receive Exp. Points from battles.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/exp-share.png','2023-11-22 07:51:27','2023-11-22 07:51:27'),(194,'quick-claw','Held in battle\n:   Whenever the holder attempts to use a move, it has a 3/16 chance to act first among moves with the same priority.  If multiple Pokémon have this effect at the same time, Speed is the tie-breaker as normal, but the effect of trick room is ignored.','An item to be held by a Pokémon. This light, sharp\nclaw lets the bearer move first occasionally.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/quick-claw.png','2023-11-22 07:51:27','2023-11-22 07:51:27'),(195,'soothe-bell','Held\n:   When the holder would earn happiness for any reason, it earns twice that amount instead.','An item to be held by a Pokémon. The comforting\nchime of this bell calms the holder, making\nit friendly.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/soothe-bell.png','2023-11-22 07:51:27','2023-11-22 07:51:27'),(196,'mental-herb','Held in battle\n:   When the holder is attracted, it consumes this item to cure the attraction.','An item to be held by a Pokémon. The holder\nshakes off move-binding effects to move freely.\nIt can be used only once.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/mental-herb.png','2023-11-22 07:51:27','2023-11-22 07:51:27'),(197,'choice-band','Held in battle\n:   Holder has 1.5× its Attack.  When the holder attempts to use a move, all its other moves are disabled until it leaves battle or loses this item.\n\n    The restriction ends even if this item is swapped for another Choice item\nvia trick or switcheroo.','An item to be held by a Pokémon. This curious\nheadband boosts Attack but only allows the use of\none move.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/choice-band.png','2023-11-22 07:51:27','2023-11-22 07:51:27'),(198,'kings-rock','Held in battle\n:   Holder\'s damaging moves have a 10% chance to make their target flinch.  This chance applies independently to each hit of a multi-hit move.\n\n    This item\'s chance is rolled independently of any other move effects;\ne.g., a move with a 30% chance to flinch normally will have a 37% total chance to flinch when used with this item, because 3% of the time, both effects activate.\n\nHeld by poliwhirl or slowbro\n:   Holder evolves into politoed or slowking, respectively, when traded.','An item to be held by a Pokémon. When the holder\nsuccessfully inflicts damage, the target may\nalso flinch.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/kings-rock.png','2023-11-22 07:51:27','2023-11-22 07:51:27'),(199,'silver-powder','Held in battle\n:   Holder\'s bug-type moves have 1.2× their power.\n','An item to be held by a Pokémon. It’s a shiny\nsilver powder that will boost the power of\nBug-type moves.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/silver-powder.png','2023-11-22 07:51:28','2023-11-22 07:51:28'),(200,'amulet-coin','Held\n:   If the holder participated in a trainer battle, the trainer earns twice the usual prize money.  This effect applies even if the holder fainted.\n\n    This e