okeAPI/sprites/master/sprites/items/galactic-key.png','2023-11-22 07:51:54','2023-11-22 07:51:54'),(418,'red-chain','Unused.','A mythical chain that is said to link the\nLegendary Pokémon that created the Sinnoh region.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/red-chain.png','2023-11-22 07:51:54','2023-11-22 07:51:54'),(419,'town-map','Displays a map of the region including the trainer\'s position, location names, visited towns, gym locations, and where the trainer has been walking recently.','A very convenient map that can be viewed anytime.\nIt even shows you your present location in the region.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/town-map.png','2023-11-22 07:51:54','2023-11-22 07:51:54'),(420,'vs-seeker','Reveals trainers who want a rematch, by showing !! over their heads.  Each use drains the battery; requires 100 steps to charge.','A device that indicates Trainers who want to\nbattle. Its battery charges while you walk.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/vs-seeker.png','2023-11-22 07:51:54','2023-11-22 07:51:54'),(421,'coin-case','Contains the Coins used by the Game Corner, to a maximum of 50,000.','A case for holding coins obtained at the\nGame Corner. It can hold up to 50,000 coins.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/coin-case.png','2023-11-22 07:51:54','2023-11-22 07:51:54'),(422,'old-rod','Used to find Pokémon on the Old Rod list for an area, which are generally Magikarp or similar.','An old and beat-up fishing rod. Use it at any body\nof water to fish for wild aquatic Pokémon.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/old-rod.png','2023-11-22 07:51:54','2023-11-22 07:51:54'),(423,'good-rod','Used to find Pokémon on the Good Rod list for an area, which are generally mediocre.','A new, good-quality fishing rod. Use it at any body\nof water to fish for wild aquatic Pokémon.','https://ra