.  When you enter the Union Room or connect to Wi-Fi, this item returns to your bag.','A glowing orb to be held by Giratina. It boosts the\npower of Dragon- and Ghost-type moves when it\nis held.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/griseous-orb.png','2023-11-22 07:51:56','2023-11-22 07:51:56'),(443,'vs-recorder','Optionally records wireless, Wi-Fi, and Battle Frontier battles.\n\nTracks Battle Points earned in the Battle Frontier, and stores commemorative prints.','An amazing device that can record a battle\nbetween friends or the battles at certain special\nbattle facilities.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/vs-recorder.png','2023-11-22 07:51:56','2023-11-22 07:51:56'),(444,'gracidea','Used by trainer on a shaymin\n:   Changes the target Shaymin from Land Forme to Sky Forme.\n\n    This item cannot be used on a frozen Shaymin or at night.  Sky Forme Shaymin will revert to Land Forme overnight, when frozen, and upon entering a link battle.  This item must be used again to change it back.','A flower sometimes bundled in bouquets to convey\ngratitude on special occasions, such as birthdays.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/gracidea.png','2023-11-22 07:51:56','2023-11-22 07:51:56'),(445,'secret-key','Used by trainer in the Galactic Eterna Building, on the ground floor, to the left of the TV\n:   Unlocks the secret rotom room, in which there are five appliances which can change Rotom\'s form.','A high-tech key that has to be used at a specific\nlocation. It emits a special electronic signal to open\na door.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/secret-key.png','2023-11-22 07:51:57','2023-11-22 07:51:57'),(446,'apricorn-box','Stores Apricorns.','A handy box where you can store up to 99 of each\nkind of Apricorn.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/apricorn-box.png','2023-11-22 07:51:57','2023-11-22 07:51:57'),(447,'berry-pots','Contains four portable pots of soil suitable for growing berries.','Handy containers for cultivating Berries wherever\nyou go.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/berry-pots.png','2023-11-22 07:51:57','2023-11-22 07:51:57'),(448,'squirt-bottle','Required to water berries within the berry pots.\n\nRequired to battle the sudowoodo on johto route 36.\n\nThis item cannot be directly used from the bag.','A bottle used for watering plants in the Berry Pots.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/squirt-bottle.png','2023-11-22 07:51:57','2023-11-22 07:51:57'),(449,'lure-ball','Used by trainer in battle\n:   Attempts to catch a wild Pokémon.  If used in a trainer battle, nothing happens and the ball is lost.\n\n    If the wild Pokémon was encountered by fishing, the wild Pokémon\'s catch rate is 3× normal.','A Poké Ball that is good for catching Pokémon that\nyou reel in with a rod while out fishing.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/lure-ball.png','2023-11-22 07:51:57','2023-11-22 07:51:57'),(450,'level-ball','Used by trainer in battle\n:   Attempts to catch a wild Pokémon.  If used in a trainer battle, nothing happens and the ball is lost.\n\n    If the trainer\'s Pokémon\'s level is higher than:\n\n    * four times the wild Pokémon\'s, the wild Pokémon\'s catch rate is 8× normal.\n    * than twice the wild Pokémon\'s, the wild Pokémon\'s catch rate is 4× normal.\n    * the wild Pokémon\'s, the wild Pokémon\'s catch rate is 2× normal.','A Poké Ball that makes it easier to catch Pokémon\nthat are at a lower level than your own Pokémon.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/level-ball.png','2023-11-22 07:51:57','2023-11-22 07:51:57'),(451,'moon-ball','Used by trainer in battle\n:   Attempts to catch a wild Pokémon.  If used in a trainer battle, nothing happens and the ball is lost.\n\n    If the wild Pokémon is a clefairy, nidoran m, nidoran f, jigglypuff, skitty, or any evolution thereof, the wild Pokémon has 4× its catch rate.','A Poké Ball that will make it easier to catch\nPokémon that can evolve using a Moon Stone.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/moon-ball.png','2023-11-22 07:51:57','2023-11-22 07:51:57'),(452,'heavy-ball','Used by a trainer in battle\n:   Attempts to catch a wild Pokémon.  If used in a trainer battle, nothing happens and the ball is lost.\n\n    If the wild Pokémon weighs:\n\n    * 409.6 kg (903.0 lb) or more, its catch rate is 40 more than normal.\n    * 307.2 kg (677.3 lb) or more, its catch rate is 30 more than normal.\n    * 204.8 kg (451.5 lb) or more, its catch rate is 20 more than normal.\n    * less than 204.8 kg (451.5 lb), its catch rate is 20 less than normal.','A Poké Ball that is better than usual at catching\nvery heavy Pokémon.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/heavy-ball.png','2023-11-22 07:51:57','2023-11-22 07:51:57'),(453,'fast-ball','Used by a trainer in battle\n:   Attempts to catch a wild Pokémon.  If used in a trainer battle, nothing happens and the ball is lost.\n\n:   If the wild Pokémon\'s base speed is 100 or more, its catch rate is 4× normal.','A Poké Ball that makes it easier to catch Pokémon\nthat are usually very quick to run away.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/fast-ball.png','2023-11-22 07:51:58','2023-11-22 07:51:58'),(454,'friend-ball','Used by a trainer in battle\n:   Attempts to catch a wild Pokémon.  If used in a trainer battle, nothing happens and the ball is lost.\n\n    If caught, the wild Pokémon\'s happiness starts at 200.','A strange Poké Ball that will make the wild\nPokémon caught with it more friendly toward\nyou immediately.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/friend-ball.png','2023-11-22 07:51:58','2023-11-22 07:51:58'),(455,'love-ball','Used by a trainer in battle\n:   Attempts to catch a wild Pokémon.  If used in a trainer battle, nothing happens and the ball is lost.\n\n    If the trainer\'s Pokémon and wild Pokémon are of the same species but opposite genders, the wild Pokémon\'s catch rate is 8× normal.','A Poké Ball that works best when catching a\nPokémon that is of the opposite gender of\nyour Pokémon.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/love-ball.png','2023-11-22 07:51:58','2023-11-22 07:51:58'),(456,'park-ball','Used by a trainer in battle\n:   Catches a wild Pokémon.\n\nThis item can only be used in pal park.','A special Poké Ball for the Pal Park.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/park-ball.png','2023-11-22 07:51:58','2023-11-22 07:51:58'),(457,'sport-ball','Used by a trainer in battle\n:   Attempts to catch a wild Pokémon.\n\n    The wild Pokémon\'s catch rate is 1.5× normal.','A special Poké Ball that was used during the\nBug-Catching Contest in the Johto region.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/sport-ball.png','2023-11-22 07:51:58','2023-11-22 07:51:58'),(458,'red-apricorn','May be given to Kurt in azalea town to produce a level ball.','A red Apricorn. It assails your nostrils.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/red-apricorn.png','2023-11-22 07:51:58','2023-11-22 07:51:58'),(459,'blue-apricorn','May be given to Kurt in azalea town to produce a lure ball.','A blue Apricorn. It smells a bit like grass.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/blue-apricorn.png','2023-11-22 07:51:58','2023-11-22 07:51:58'),(460,'yellow-apricorn','May be given to Kurt in azalea town to produce a moon ball.','A yellow Apricorn. It has an invigorating scent.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/yellow-apricorn.png','2023-11-22 07:51:58','2023-11-22 07:51:58'),(461,'green-ap