.png','2023-11-22 07:52:23','2023-11-22 07:52:23'),(659,'tm93','Teaches wild charge to a compatible Pokémon.','The user’s body generates an eerie impulse.\nExposing the target to it harshly lowers the target’s\nSp. Atk stat.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/tm-normal.png','2023-11-22 07:52:23','2023-11-22 07:52:23'),(660,'tm94','Teaches rock smash to a compatible Pokémon.','A restrained attack that prevents the target from\nfainting. The target is left with at least 1 HP.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/tm-normal.png','2023-11-22 07:52:23','2023-11-22 07:52:23'),(661,'tm95','Teaches snarl to a compatible Pokémon.','The user attacks with a blade of air that slices even\nthe sky. This may also make the target flinch.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/tm-normal.png','2023-11-22 07:52:23','2023-11-22 07:52:23'),(662,'xtransceiver','Makes four-way video calls.  Used for plot advancement in-game, but also works with other players via the C-Gear.','A high-tech transceiver with a camera function.\nIt allows up to four-way calls.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/xtransceiver.png','2023-11-22 07:52:23','2023-11-22 07:52:23'),(663,'god-stone','Unknown.  Currently unused.','A rare stone.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/god-stone.png','2023-11-22 07:52:23','2023-11-22 07:52:23'),(664,'gram-1','Give to the wingull on unova route 13, along with gram 2 and gram 3, to receive tm89.','An important letter that Wingull delivers.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/gram-1.png','2023-11-22 07:52:23','2023-11-22 07:52:23'),(665,'gram-2','Give to the wingull on unova route 13, along with gram 1 and gram 3, to receive tm89.','An important letter that Wingull delivers.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/gram-2.png','2023-11-22 07:52:24','2023-11-22 07:52:24'),(666,'gram-3','Give to the wingull on unova route 13, along with gram 1 and gram 2, to receive tm89.','An important letter that Wingull delivers.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/gram-3.png','2023-11-22 07:52:24','2023-11-22 07:52:24'),(667,'dragon-gem','Held\n:   When the holder uses a damaging dragon-type move, the move has 1.5× power and this item is consumed.','A gem with a draconic essence. When held, it\nstrengthens the power of a Dragon-type move\none time.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/dragon-gem.png','2023-11-22 07:52:24','2023-11-22 07:52:24'),(668,'normal-gem','Held\n:   When the holder uses a damaging normal-type move, the move has 1.5× power and this item is consumed.','A gem with an ordinary essence. When held, it\nstrengthens the power of a Normal-type move\none time.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/normal-gem.png','2023-11-22 07:52:24','2023-11-22 07:52:24'),(669,'medal-box','','A box-shaped machine that stores Medals and\nMedal information.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/medal-box.png','2023-11-22 07:52:24','2023-11-22 07:52:24'),(670,'dna-splicers','','A splicer that fuses Kyurem and a certain Pokémon.\nThey are said to have been one in the beginning.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/dna-splicers.png','2023-11-22 07:52:24','2023-11-22 07:52:24'),(671,'permit','','A permit that is needed to enter the\nNature Preserve. Not many know about it.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/permit.png','2023-11-22 07:52:24','2023-11-22 07:52:24'),(672,'oval-charm','','An oval charm said to increase the chance of\nPokémon Eggs being found at the Nursery.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/oval-charm.png','2023-11-22 07:52:24','2023-11-22 07:52:24'),