.',NULL,'2023-11-22 07:53:18','2023-11-22 07:53:18'),(1141,'tr04',NULL,'The user attacks everything around it by swamping\nits surroundings with a giant wave.',NULL,'2023-11-22 07:53:18','2023-11-22 07:53:18'),(1142,'tr05',NULL,'The target is struck with an icy-cold beam of energy.\nThis may also leave the target frozen.',NULL,'2023-11-22 07:53:18','2023-11-22 07:53:18'),(1143,'tr06',NULL,'A howling blizzard is summoned to strike opposing\nPokémon. This may also leave the opposing\nPokémon frozen.',NULL,'2023-11-22 07:53:18','2023-11-22 07:53:18'),(1144,'tr07',NULL,'A powerful low kick that makes the target fall over.\nThe heavier the target, the greater the move’s power.',NULL,'2023-11-22 07:53:18','2023-11-22 07:53:18'),(1145,'tr08',NULL,'A strong electric blast crashes down on the target.\nThis may also leave the target with paralysis.',NULL,'2023-11-22 07:53:18','2023-11-22 07:53:18'),(1146,'tr09',NULL,'A wicked thunderbolt is dropped on the target to\ninflict damage. This may also leave the target\nwith paralysis.',NULL,'2023-11-22 07:53:18','2023-11-22 07:53:18'),(1147,'tr10',NULL,'The user sets off an earthquake that strikes every\nPokémon around it.',NULL,'2023-11-22 07:53:18','2023-11-22 07:53:18'),(1148,'tr11',NULL,'The target is hit by a strong telekinetic force.\nThis may also lower the target’s Sp. Def stat.',NULL,'2023-11-22 07:53:18','2023-11-22 07:53:18'),(1149,'tr12',NULL,'The user relaxes and lightens its body to move\nfaster. This sharply raises the Speed stat.',NULL,'2023-11-22 07:53:18','2023-11-22 07:53:18'),(1150,'tr13',NULL,'The user takes a deep breath and focuses so that\ncritical hits land more easily.',NULL,'2023-11-22 07:53:18','2023-11-22 07:53:18'),(1151,'tr14',NULL,'The user waggles a finger and stimulates its brain\ninto randomly using nearly any move.',NULL,'2023-11-22 07:53:18','2023-11-22 07:53:18'),(1152,'tr15',NULL,'The target is attacked with an intense blast of\nall-consuming fire. This may also leave the target\nwith a burn.',NULL,'2023-11-22 07:53:18','2023-11-22 07:53:18'),(1153,'tr16',NULL,'The user charges at the target and may make\nit flinch.',NULL,'2023-11-22 07:53:19','2023-11-22 07:53:19'),(1154,'tr17',NULL,'The user temporarily empties its mind to forget its\nconcerns. This sharply raises the user’s Sp. Def stat.',NULL,'2023-11-22 07:53:19','2023-11-22 07:53:19'),(1155,'tr18',NULL,'The user drains the target’s blood. The user’s HP is\nrestored by half the damage taken by the target.',NULL,'2023-11-22 07:53:19','2023-11-22 07:53:19'),(1156,'tr19',NULL,'The user strikes with a simultaneous three-beam attack.\nThis may also burn, freeze, or paralyze the target.',NULL,'2023-11-22 07:53:19','2023-11-22 07:53:19'),(1157,'tr20',NULL,'The user creates a substitute for itself using some of\nits HP. The substitute serves as the user’s decoy.',NULL,'2023-11-22 07:53:19','2023-11-22 07:53:19'),(1158,'tr21',NULL,'An all-out attack that becomes more powerful the\nless HP the user has.',NULL,'2023-11-22 07:53:19','2023-11-22 07:53:19'),(1159,'tr22',NULL,'Unsanitary sludge is hurled at the target. This may\nalso poison the target.',NULL,'2023-11-22 07:53:19','2023-11-22 07:53:19'),(1160,'tr23',NULL,'The user lays a trap of spikes at the opposing\nteam’s feet. The trap hurts Pokémon that switch\ninto battle.',NULL,'2023-11-22 07:53:19','2023-11-22 07:53:19'),(1161,'tr24',NULL,'The user rampages and attacks for two to three\nturns. The user then becomes confused.',NULL,'2023-11-22 07:53:19','2023-11-22 07:53:19'),(1162,'tr25',NULL,'The user materializes an odd psychic wave to attack\nthe target. This attack does physical damage.',NULL,'2023-11-22 07:53:19','2023-11-22 07:53:19'),(1163,'tr26',NULL,'The user endures any attack with at least 1 HP.\nIts chance of failing rises if it is used in succession.',NULL,'2023-11-22 07:53:19','2023-11-22 07:53:19'),(1164,'tr27',NULL,'While it is asleep, the user randomly uses one of the\nmoves it knows.',NULL,'2023-11-22 07:53:19','2023-11-22 07:53:19'),(116