e of Armor. Show it to the rail\nstaff at Wedgehurst Station.',NULL,'2023-11-22 07:53:55','2023-11-22 07:53:55'),(1585,'rotom-bike--sparkling-white',NULL,'This bike can do a turbo boost and run on the water\nusing Rotom’s power. It’s a sparkling white that\nshines brilliantly.',NULL,'2023-11-22 07:53:55','2023-11-22 07:53:55'),(1586,'rotom-bike--glistening-black',NULL,'This bike can do a turbo boost and run on the water\nusing Rotom’s power. It’s a glistening black that\nshines reddish-black.',NULL,'2023-11-22 07:53:55','2023-11-22 07:53:55'),(1587,'exp-charm',NULL,'A charm that increases the Exp. Points that Pokémon\ncan get. A machine-like object is inside the charm.',NULL,'2023-11-22 07:53:55','2023-11-22 07:53:55'),(1588,'armorite-ore',NULL,'Rare ore that can be obtained on the Isle of Armor.\nSomething good will happen if you give it to a collector\non the Isle of Armor.',NULL,'2023-11-22 07:53:56','2023-11-22 07:53:56'),(1589,'mark-charm',NULL,'A mysterious and unique charm that increases the\nchance of finding a Pokémon with a mark.',NULL,'2023-11-22 07:53:56','2023-11-22 07:53:56'),(1590,'reins-of-unity--merge',NULL,'Reins that people presented to the king. They enhance\nCalyrex’s power over bountiful harvests and unite\nCalyrex with its beloved steed.',NULL,'2023-11-22 07:53:56','2023-11-22 07:53:56'),(1591,'reins-of-unity--split',NULL,'Reins that people presented to the king. They enable\nthose who are connected to communicate with each\nother. The reins separate Calyrex and its beloved steed.',NULL,'2023-11-22 07:53:56','2023-11-22 07:53:56'),(1592,'galarica-wreath',NULL,'A wreath made from woven-together Galarica Twigs.\nPlacing it on the head of a Galarian Slowpoke makes\nthe Pokémon very happy.',NULL,'2023-11-22 07:53:56','2023-11-22 07:53:56'),(1593,'legendary-clue-1',NULL,'A clue about the King of Bountiful Harvests. It’s written\nby Peony, and an old photo is attached to it.',NULL,'2023-11-22 07:53:56','2023-11-22 07:53:56'),(1594,'legendary-clue-2'