INSERT INTO `species` VALUES (1,'bulbasaur','While it is young, it uses the nutrients that are\nstored in the seed on its back in order to grow.','green','#0b120e','quadruped',50,45,'grassland','medium-slow',0,0,0,'2023-11-22 07:27:02','2023-11-22 07:27:02'),(2,'ivysaur','Exposure to sunlight adds to its strength.\nSunlight also makes the bud on its back\ngrow larger.','green','#15201b','quadruped',50,45,'grassland','medium-slow',0,0,0,'2023-11-22 07:27:02','2023-11-22 07:27:02'),(3,'venusaur','A bewitching aroma wafts from its flower.\nThe fragrance becalms those engaged\nin a battle.','green','#384535','quadruped',50,45,'grassland','medium-slow',0,0,0,'2023-11-22 07:27:03','2023-11-22 07:27:03'),(4,'venusaur-mega','A bewitching aroma wafts from its flower.\nThe fragrance becalms those engaged\nin a battle.','green','#384535','quadruped',50,45,'grassland','medium-slow',0,0,0,'2023-11-22 07:27:03','2023-11-22 07:27:03'),(5,'venusaur-gmax','A bewitching aroma wafts from its flower.\nThe fragrance becalms those engaged\nin a battle.','green','#384535','quadruped',50,45,'grassland','medium-slow',0,0,0,'2023-11-22 07:27:03','2023-11-22 07:27:03'),(6,'charmander','From the time it is born, a flame burns at the tip\nof its tail. Its life would end if the flame were to\ngo out.','red','#1c0f07','upright',50,45,'mountain','medium-slow',0,0,0,'2023-11-22 07:27:04','2023-11-22 07:27:04'),(7,'charmeleon','If it becomes agitated during battle, it spouts\nintense flames, incinerating its surroundings.','red','#30160d','upright',50,45,'mountain','medium-slow',0,0,0,'2023-11-22 07:27:04','2023-11-22 07:27:04'),(8,'charizard','Its wings can carry this Pokémon close to an\naltitude of 4,600 feet. It blows out fire at very\nhigh temperatures.','red','#55321e','upright',50,45,'mountain','medium-slow',0,0,0,'2023-11-22 07:27:05','2023-11-22 07:27:05'),(9,'charizard-mega-x','Its wings can carry this Pokémon close to an\naltitude of 4,600 feet. It blows out fire at very\nhigh temperature