rough walls,\nappearing wherever it likes. According to rumor, victims of\na Haunter\'s lick will wither to death day by day.','purple','#281820','arms',50,90,'cave','medium-slow',0,0,0,'2023-11-22 07:28:12','2023-11-22 07:28:12'),(149,'gengar','Possesses potential victims\' shadows in an effort to steal away\nthe victims\' lives. If your shadow begins to laugh, you must take\nhold of a protective charm posthaste!','purple','#231b2c','upright',50,45,'cave','medium-slow',0,0,0,'2023-11-22 07:28:13','2023-11-22 07:28:13'),(150,'gengar-mega','Possesses potential victims\' shadows in an effort to steal away\nthe victims\' lives. If your shadow begins to laugh, you must take\nhold of a protective charm posthaste!','purple','#231b2c','upright',50,45,'cave','medium-slow',0,0,0,'2023-11-22 07:28:13','2023-11-22 07:28:13'),(151,'gengar-gmax','Possesses potential victims\' shadows in an effort to steal away\nthe victims\' lives. If your shadow begins to laugh, you must take\nhold of a protective charm posthaste!','purple','#231b2c','upright',50,45,'cave','medium-slow',0,0,0,'2023-11-22 07:28:13','2023-11-22 07:28:13'),(152,'onix','This chain of immense stones resembles a giant serpent. Tremors\nshake the earth above as it burrows deep beneath the ground,\nfeeding on boulders as it goes.','gray','#333030','squiggle',50,45,'cave','medium',0,0,0,'2023-11-22 07:28:14','2023-11-22 07:28:14'),(153,'drowzee','If you sleep by it all the time, it will sometimes\nshow you dreams it had eaten in the past.','yellow','#28210a','humanoid',70,190,'grassland','medium',0,0,0,'2023-11-22 07:28:15','2023-11-22 07:28:15'),(154,'hypno','Avoid eye contact if you come across one. It will\ntry to put you to sleep by using its pendulum.','yellow','#312b10','humanoid',70,75,'grassland','medium',0,0,0,'2023-11-22 07:28:16','2023-11-22 07:28:16'),(155,'krabby','If it senses danger approaching, it cloaks itself\nwith bubbles from its mouth so it will look bigger.','red','#20130d','armor',50,225,'waters-e