gutor','When they work together, Exeggutor’s three\nheads can put out powerful psychic energy.\nCloudy days make this Pokémon sluggish.','yellow','#2c2d15','legs',50,45,'forest','slow',0,0,0,'2023-11-22 07:28:19','2023-11-22 07:28:19'),(164,'exeggutor-alola','When they work together, Exeggutor’s three\nheads can put out powerful psychic energy.\nCloudy days make this Pokémon sluggish.','yellow','#2c2d15','legs',50,45,'forest','slow',0,0,0,'2023-11-22 07:28:19','2023-11-22 07:28:19'),(165,'cubone','This Pokémon wears the skull of its deceased\nmother. Sometimes Cubone’s dreams make it cry,\nbut each tear Cubone sheds makes it stronger.','brown','#171512','upright',50,190,'mountain','medium',0,0,0,'2023-11-22 07:28:20','2023-11-22 07:28:20'),(166,'marowak','When this Pokémon evolved, the skull of its\nmother fused to it. Marowak’s temperament also\nturned vicious at the same time.','brown','#1f1b17','upright',50,75,'mountain','medium',0,0,0,'2023-11-22 07:28:21','2023-11-22 07:28:21'),(167,'marowak-alola','When this Pokémon evolved, the skull of its\nmother fused to it. Marowak’s temperament also\nturned vicious at the same time.','brown','#1f1b17','upright',50,75,'mountain','medium',0,0,0,'2023-11-22 07:28:21','2023-11-22 07:28:21'),(168,'marowak-totem','When this Pokémon evolved, the skull of its\nmother fused to it. Marowak’s temperament also\nturned vicious at the same time.','brown','#1f1b17','upright',50,75,'mountain','medium',0,0,0,'2023-11-22 07:28:21','2023-11-22 07:28:21'),(169,'hitmonlee','The legs freely contract and stretch. The stretchy\nlegs allow it to hit a distant foe with a rising kick.','brown','#251e18','humanoid',50,45,'urban','medium',0,0,0,'2023-11-22 07:28:22','2023-11-22 07:28:22'),(170,'hitmonchan','Its punches slice the air. However, it seems to\nneed a short break after fighting for three minutes.','brown','#181310','humanoid',50,45,'urban','medium',0,0,0,'2023-11-22 07:28:22','2023-11-22 07:28:22'),(171,'lickitung','Wields its long tongue