d','medium',0,0,0,'2023-11-22 07:28:26','2023-11-22 07:28:26'),(179,'kangaskhan','There are records of a lost human child being\nraised by a childless Kangaskhan.','brown','#3c3428','upright',50,45,'grassland','medium',0,0,0,'2023-11-22 07:28:26','2023-11-22 07:28:26'),(180,'kangaskhan-mega','There are records of a lost human child being\nraised by a childless Kangaskhan.','brown','#3c3428','upright',50,45,'grassland','medium',0,0,0,'2023-11-22 07:28:26','2023-11-22 07:28:26'),(181,'horsea','They swim with dance-like motions and cause\nwhirlpools to form. Horsea compete to see which\nof them can generate the biggest whirlpool.','blue','#0e1010','blob',50,225,'sea','medium',0,0,0,'2023-11-22 07:28:27','2023-11-22 07:28:27'),(182,'seadra','Seadra’s mouth is slender, but its suction power\nis strong. In an instant, Seadra can suck in food\nthat’s larger than the opening of its mouth.','blue','#1a1d1b','blob',50,75,'sea','medium',0,0,0,'2023-11-22 07:28:27','2023-11-22 07:28:27'),(183,'goldeen','Its dorsal and pectoral fins are strongly developed\nlike muscles. It can swim at a speed of five knots.','red','#282422','fish',50,225,'waters-edge','medium',0,0,0,'2023-11-22 07:28:28','2023-11-22 07:28:28'),(184,'seaking','Using its horn, it bores holes in riverbed\nboulders, making nests to prevent its eggs from\nwashing away.','red','#312929','fish',50,60,'waters-edge','medium',0,0,0,'2023-11-22 07:28:29','2023-11-22 07:28:29'),(185,'staryu','Fish Pokémon nibble at it, but Staryu isn’t\nbothered. Its body regenerates quickly, even\nif part of it is completely torn off.','brown','#150f08','blob',50,225,'sea','slow',0,0,0,'2023-11-22 07:28:29','2023-11-22 07:28:29'),(186,'starmie','Starmie swims by spinning its body at high speed.\nAs this Pokémon cruises through the ocean, it\nabsorbs tiny plankton.','purple','#1c161f','blob',50,60,'sea','slow',0,0,0,'2023-11-22 07:28:30','2023-11-22 07:28:30'),(187,'mr-mime','The behavior of this clown-like Pokémon reminds one of\npantomime