11-22 07:28:33'),(195,'tauros','The Tauros of the Galar region are volatile in\nnature, and they won’t allow people to ride on\ntheir backs.','brown','#221b11','quadruped',50,45,'grassland','slow',0,0,0,'2023-11-22 07:28:34','2023-11-22 07:28:34'),(196,'tauros-paldea-combat-breed','The Tauros of the Galar region are volatile in\nnature, and they won’t allow people to ride on\ntheir backs.','brown','#221b11','quadruped',50,45,'grassland','slow',0,0,0,'2023-11-22 07:28:34','2023-11-22 07:28:34'),(197,'tauros-paldea-blaze-breed','The Tauros of the Galar region are volatile in\nnature, and they won’t allow people to ride on\ntheir backs.','brown','#221b11','quadruped',50,45,'grassland','slow',0,0,0,'2023-11-22 07:28:34','2023-11-22 07:28:34'),(198,'tauros-paldea-aqua-breed','The Tauros of the Galar region are volatile in\nnature, and they won’t allow people to ride on\ntheir backs.','brown','#221b11','quadruped',50,45,'grassland','slow',0,0,0,'2023-11-22 07:28:34','2023-11-22 07:28:34'),(199,'magikarp','A feeble, pitiful imbecile of a Pokémon that is nonetheless very\nhardy. Unperturbed by turbid water, it can be found living in all\nsorts of places.','red','#291c17','fish',50,255,'waters-edge','slow',0,0,0,'2023-11-22 07:28:34','2023-11-22 07:28:34'),(200,'gyarados','I suspect this Pokémon to be the true identity of a dragon\nwritten of in ancient texts, which claimed that it razed an entire\nvillage with white-hot beams from its maw.','blue','#344851','squiggle',50,45,'waters-edge','slow',0,0,0,'2023-11-22 07:28:35','2023-11-22 07:28:35'),(201,'gyarados-mega','I suspect this Pokémon to be the true identity of a dragon\nwritten of in ancient texts, which claimed that it razed an entire\nvillage with white-hot beams from its maw.','blue','#344851','squiggle',50,45,'waters-edge','slow',0,0,0,'2023-11-22 07:28:35','2023-11-22 07:28:35'),(202,'lapras','Crossing icy seas is no issue for this\ncold-resistant Pokémon. Its smooth skin\nis a little cool to the touch.','blue','#20282b','fish',50,45,'sea','slow',0,0,0,'2023-11-22 07:28:37','2023-11-22 07:28:37'),(203,'lapras-gmax','Crossing icy seas is no issue for this\ncold-resistant Pokémon. Its smooth skin\nis a little cool to the touch.','blue','#20282b','fish',50,45,'sea','slow',0,0,0,'2023-11-22 07:28:37','2023-11-22 07:28:37'),(204,'ditto','When it encounters another Ditto, it will move\nfaster than normal to duplicate that opponent exactly.','purple','#110a14','ball',50,35,'urban','medium',0,0,0,'2023-11-22 07:28:37','2023-11-22 07:28:37'),(205,'eevee','Harbors the potential to evolve into manifold forms.\nWithin Eevee lies the key to the mysteries of Pokémon\nevolution—I\'m certain of it.','brown','#18110c','quadruped',50,45,'urban','medium',0,0,0,'2023-11-22 07:28:38','2023-11-22 07:28:38'),(206,'eevee-starter','Harbors the potential to evolve into manifold forms.\nWithin Eevee lies the key to the mysteries of Pokémon\nevolution—I\'m certain of it.','brown','#18110c','quadruped',50,45,'urban','medium',0,0,0,'2023-11-22 07:28:38','2023-11-22 07:28:38'),(207,'eevee-gmax','Harbors the potential to evolve into manifold forms.\nWithin Eevee lies the key to the mysteries of Pokémon\nevolution—I\'m certain of it.','brown','#18110c','quadruped',50,45,'urban','medium',0,0,0,'2023-11-22 07:28:38','2023-11-22 07:28:38'),(208,'vaporeon','Tests show that its cells closely resemble water molecules, which\nperhaps explains its ability to conceal its form while submerged.\nI believe the origins of mermaid folklore lie with this Pokémon.','blue','#131e20','quadruped',50,45,'urban','medium',0,0,0,'2023-11-22 07:28:39','2023-11-22 07:28:39'),(209,'jolteon','Bristles its fur into sharp, needlelike points when enraged.\nOne can hear electricity crackle in its breath when it exhales.','yellow','#1c190d','quadruped',50,45,'urban','medium',0,0,0,'2023-11-22 07:28:40','2023-11-22 07:28:40'),(210,'flareon','Flames burn within a saclike organ inside this Pokémon.\nWhen Flareon inhales, these flames grow in