n\ncounted among the gravest of disasters.','black','#353632','humanoid',50,25,'mountain','slow',0,0,0,'2023-11-22 07:28:44','2023-11-22 07:28:44'),(219,'snorlax-gmax','This glutton appears in villages without warning and devours the\nentirety of their rice granaries—such occurrences have long been\ncounted among the gravest of disasters.','black','#353632','humanoid',50,25,'mountain','slow',0,0,0,'2023-11-22 07:28:44','2023-11-22 07:28:44'),(220,'articuno','This Pokémon can control ice at will. Articuno\nis said to live in snowy mountains riddled\nwith permafrost.','blue','#1c384e','wings',35,3,'rare','slow',0,1,0,'2023-11-22 07:28:45','2023-11-22 07:28:45'),(221,'articuno-galar','This Pokémon can control ice at will. Articuno\nis said to live in snowy mountains riddled\nwith permafrost.','blue','#1c384e','wings',35,3,'rare','slow',0,1,0,'2023-11-22 07:28:45','2023-11-22 07:28:45'),(222,'zapdos','Zapdos is a legendary bird Pokémon. It’s said\nthat when Zapdos rubs its feathers together,\nlightning will fall immediately after.','yellow','#43360d','wings',35,3,'rare','slow',0,1,0,'2023-11-22 07:28:45','2023-11-22 07:28:45'),(223,'zapdos-galar','Zapdos is a legendary bird Pokémon. It’s said\nthat when Zapdos rubs its feathers together,\nlightning will fall immediately after.','yellow','#43360d','wings',35,3,'rare','slow',0,1,0,'2023-11-22 07:28:45','2023-11-22 07:28:45'),(224,'moltres','There are stories of this Pokémon using its\nradiant, flame-cloaked wings to light up paths\nfor those lost in the mountains.','yellow','#592812','wings',35,3,'rare','slow',0,1,0,'2023-11-22 07:28:46','2023-11-22 07:28:46'),(225,'moltres-galar','There are stories of this Pokémon using its\nradiant, flame-cloaked wings to light up paths\nfor those lost in the mountains.','yellow','#592812','wings',35,3,'rare','slow',0,1,0,'2023-11-22 07:28:46','2023-11-22 07:28:46'),(226,'dratini','This Pokémon was long considered to be no\nmore than a myth. The small lump on a Dratini’s\nforehead is actually a horn that’s still coming in.','blue','#131419','squiggle',35,45,'waters-edge','slow',0,0,0,'2023-11-22 07:28:46','2023-11-22 07:28:46'),(227,'dragonair','This Pokémon gathers power in the orbs on its\ntail and controls the weather. When enshrouded\nby an aura, Dragonair has a mystical appearance.','blue','#222736','squiggle',35,45,'waters-edge','slow',0,0,0,'2023-11-22 07:28:47','2023-11-22 07:28:47'),(228,'dragonite','This Pokémon is known as the Sea Incarnate.\nFigureheads that resemble Dragonite decorate\nthe bows of many ships.','brown','#422f1b','upright',35,45,'waters-edge','slow',0,0,0,'2023-11-22 07:28:48','2023-11-22 07:28:48'),(229,'mewtwo','Its DNA is almost the same as Mew’s. However,\nits size and disposition are vastly different.','purple','#292331','upright',0,3,'rare','slow',0,1,0,'2023-11-22 07:28:48','2023-11-22 07:28:48'),(230,'mewtwo-mega-x','Its DNA is almost the same as Mew’s. However,\nits size and disposition are vastly different.','purple','#292331','upright',0,3,'rare','slow',0,1,0,'2023-11-22 07:28:48','2023-11-22 07:28:48'),(231,'mewtwo-mega-y','Its DNA is almost the same as Mew’s. However,\nits size and disposition are vastly different.','purple','#292331','upright',0,3,'rare','slow',0,1,0,'2023-11-22 07:28:48','2023-11-22 07:28:48'),(232,'mew','When viewed through a microscope, this\nPokémon’s short, fine, delicate hair can be seen.','pink','#190f15','upright',100,45,'rare','medium-slow',0,0,1,'2023-11-22 07:28:49','2023-11-22 07:28:49'),(233,'chikorita','In battle, Chikorita waves its leaf around to keep the foe at\nbay. However, a sweet fragrance also wafts from the leaf,\nbecalming the battling Pokémon and creating a cozy,\nfriendly atmosphere all around.','green','#161b0d','quadruped',70,45,'grassland','medium-slow',0,0,0,'2023-11-22 07:28:49','2023-11-22 07:28:49'),(234,'bayleef','Bayleef’s neck is ringed by curled-up leaves. Inside each\ntubular leaf is a small shoot of a tree. The fragrance of this\nshoot makes people peppy.','green','#24250a','quadruped',70,45,'grassland','medium-slow',0,0,0,'2023-11-22 07:28:50','2023-11-22 07:28:50'),(235,'meganium','The fragrance of Meganium’s flower soothes and calms\nemotions. In battle, this Pokémon gives off more of its\nbecalming scent to blunt the foe’s fighting spirit.','green','#3a341e','quadruped',70,45,'grassland','medium-slow',0,0,0,'2023-11-22 07:28:50','2023-11-22 07:28:50'),(236,'cyndaquil','Hails from the Johto region. Though usually curled into a ball\ndue to its timid disposition, it harbors tremendous firepower.','yellow','#1d0f09','humanoid',70,45,'grassland','medium-slow',0,0,0,'2023-11-22 07:28:51','2023-11-22 07:28:51'),(237,'quilava','This creature\'s fur is most mysterious—it is wholly impervious to\nthe burning touch of flame. Should Quilava turn its back to you,\ntake heed! Such a posture indicates a forthcoming attack.','yellow','#30170a','quadruped',70,45,'grassland','medium-slow',0,0,0,'2023-11-22 07:28:52','2023-11-22 07:28:52'),(238,'typhlosion','Said to purify lost, forsaken souls with its flames and guide them\nto the afterlife. I believe its form has been influenced by the\nenergy of the sacred mountain towering at Hisui\'s center.','yellow','#3e2b1d','quadruped',70,45,'grassland','medium-slow',0,0,0,'2023-11-22 07:28:52','2023-11-22 07:28:52'),(239,'typhlosion-hisui','Said to purify lost, forsaken souls with its flames and guide them\nto the afterlife. I believe its form has been influenced by the\nenergy of the sacred mountain towering at Hisui\'s center.','yellow','#3e2b1d','quadruped',70,45,'grassland','medium-slow',0,0,0,'2023-11-22 07:28:52','2023-11-22 07:28:52'),(240,'totodile','Despite the smallness of its body, Totodile’s jaws are very\npowerful. While the Pokémon may think it is just playfully\nnipping, its bite has enough power to cause serious injury.','blue','#0b1015','upright',70,45,'waters-edge','medium-slow',0,0,0,'2023-11-22 07:28:53','2023-11-22 07:28:53'),(241,'croconaw','Once Croconaw has clamped its jaws on its foe, it will\nabsolutely not let go. Because the tips of its fangs are\nforked back like barbed fishhooks, they become impossible\nto remove when they have sunk in.','blue','#18191c','upright',70,45,'waters-edge','medium-slow',0,0,0,'2023-11-22 07:28:53','2023-11-22 07:28:53'),(242,'feraligatr','Feraligatr intimidates its foes by opening its huge mouth.\nIn battle, it will kick the ground hard with its thick and powerful\nhind legs to charge at the foe at an incredible speed.','blue','#2c2f3b','upright',70,45,'waters-edge','medium-slow',0,0,0,'2023-11-22 07:28:54','2023-11-22 07:28:54'),(243,'sentret','When Sentret sleeps, it does so while another stands guard.\nThe sentry wakes the others at the first sign of danger. When\nthis Pokémon becomes separated from its pack, it becomes\nincapable of sleep due to fear.','brown','#140e0b','quadruped',70,255,'grassland','medium',0,0,0,'2023-11-22 07:28:55','2023-11-22 07:28:55'),(244,'furret','Furret has a very slim build. When under attack, it can slickly\nsquirm through narrow spaces and get away. In spite of its\nshort limbs, this Pokémon is very nimble and fleet.','brown','#2a2014','quadruped',70,90,'grassland','medium',0,0,0,'2023-11-22 07:28:56','2023-11-22 07:28:56'),(245,'hoothoot','It begins to hoot at the same time every day.\nSome Trainers use them in place of clocks.','brown','#150f09','wings',50,255,'forest','medium',0,0,0,'2023-11-22 07:28:57','2023-11-22 07:28:57'),(246,'noctowl','When it needs to think, it rotates its head\n180 degrees to sharpen its intellectual power.','brown','#261f17','wings',50,90,'forest','medium',0,0,0,'2023-11-22 07:28:57','2023-11-22 07:28:57'),(247,'ledyba','These very cowardly Pokémon join together and\nuse Reflect to protect their nest.','red','#1a1511','wings',70,255,'forest','fast',0,0,0,'2023-11-22 07:28:58','2023-11-22 07:28:58'),(248,'ledian','It flies through the night sky, sprinkling sparkly\ndust. According to some, if that dust sticks to\nyou, good things will happen to you.','red','#1d1210','wings',70,90,'forest','fast',0,0,0,'2023-11-22 07:28:58','2023-11-22 07:28:58'),(249,'spinarak','Although the poison from its fangs isn’t that\nstrong, it’s potent enough to weaken prey that\ngets caught in its web.','green','#0a0b05','armor',70,255,'forest','fast',0,0,0,'2023-11-22 07:28:59','2023-11-22 07:28:59'),(250,'ariados','It spews threads from its mouth to catch its\nprey. When night falls, it leaves its web to go\nhunt aggressively.','red','#1d1311','armor',70,90,'forest','fast',0,0,0,'2023-11-22 07:28:59','2023-11-22 07:28:59'),(251,'crobat','Its hind limbs have become another set of wings. Crobat\nexpertly maneuvers its four wings to dart in exquisite fashion\nthrough even the most confined caves without losing any speed.','purple','#1d1329','bug-wings',50,90,'cave','medium',0,0,0,'2023-11-22 07:29:00','2023-11-22 07:29:00'),(252,'chinchou','On the dark ocean floor, its only means of\ncommunication is its constantly flashing lights.','blue','#141718','fish',50,190,'sea','slow',0,0,0,'2023-11-22 07:29:01','2023-11-22 07:29:01'),(253,'lanturn','This Pokémon flashes a bright light that blinds\nits prey. This creates an opening for it to deliver\nan electrical attack.','blue','#1e2229','fish',50,75,'sea','slow',0,0,0,'2023-11-22 07:29:02','2023-11-22 07:29:02'),(254,'pichu','Pichu stores electricity in the sacs on its cheeks but discharges it\ninadvertently when agitated or excited. Being yet immature,\nthe Pokémon\'s handling of electricity is rather inept.','yellow','#0d0b06','quadruped',50,190,'forest','medium',1,0,0,'2023-11-22 07:29:02','2023-11-22 07:29:02'),(255,'cleffa','In silhouette, they resemble twinkling starlight. When shooting\nstars rain from the night sky, Cleffa gather in numbers and dance\nas though they are indeed incarnations of the stars.','pink','#0f0907','upright',140,150,'mountain','fast',1,0,0,'2023-11-22 07:29:02','2023-11-22 07:29:02'),(256,'igglybuff','Taking advantage of the softness of its body,\nIgglybuff moves as if bouncing. Its body turns a\ndeep pink when its temperature rises.','pink','#11090c','humanoid',50,170,'grassland','fast',1,0,0,'2023-11-22 07:29:03','2023-11-22 07:29:03'),(257,'togepi','This ovate creature is frequently mistaken for a moving egg\nwhen encountered out in the fields or in the mountains.\nIts guileless smile soothes the soul.','white','#0c0b0a','humanoid',50,190,'forest','fast',1,0,0,'2023-11-22 07:29:04','2023-11-22 07:29:04'),(258,'togetic','No records exist of Togetic being seen in the wilds. Rumors\nabound that it evolves under the loving care of a trusted human\ncompanion, upon whom the Pokémon then bestows great joy.','white','#161717','humanoid',50,75,'forest','fast',0,0,0,'2023-11-22 07:29:05','2023-11-22 07:29:05'),(259,'natu','Because its wings aren’t yet fully grown, it has to\nhop to get around. It is always staring\nat something.','green','#0c0c05','wings',50,190,'forest','medium',0,0,0,'2023-11-22 07:29:06','2023-11-22 07:29:06'),(260,'xatu','This odd Pokémon can see both the past and\nthe future. It eyes the sun’s movement all day.','green','#19150d','wings',50,75,'forest','medium',0,0,0,'2023-11-22 07:29:08','2023-11-22 07:29:08'),(261,'mareep','Rubbing its fleece generates electricity.\nYou’ll want to pet it because it’s cute, but if you\nuse your bare hand, you’ll get a painful shock.','white','#1a1914','quadruped',70,235,'grassland','medium-slow',0,0,0,'2023-11-22 07:29:08','2023-11-22 07:29:08'),(262,'flaaffy','It stores electricity in its fluffy fleece. If it\nstores up too much, it will start to go bald in\nthose patches.','pink','#24191c','upright',70,120,'grassland','medium-slow',0,0,0,'2023-11-22 07:29:09','2023-11-22 07:29:09'),(263,'ampharos','Its tail shines bright and strong. It has been\nprized since long ago as a beacon for sailors.','yellow','#2f2612','upright',70,45,'grassland','medium-slow',0,0,0,'2023-11-22 07:29:10','2023-11-22 07:29:10'),(264,'ampharos-mega','Its tail shines bright and strong. It has been\nprized since long ago as a beacon for sailors.','yellow','#2f2612','upright',70,45,'grassland','medium-slow',0,0,0,'2023-11-22 07:29:10','2023-11-22 07:29:10'),(265,'bellossom','Bellossom gather at times and appear to dance.\nThey say that the dance is a ritual to summon\nthe sun.','green','#130e03','humanoid',50,45,'grassland','medium-slow',0,0,0,'2023-11-22 07:29:11','2023-11-22 07:29:11'),(266,'marill','Even after Marill swims in a cold sea, its water-\nrepellent fur dries almost as soon as Marill leaves\nthe water. That’s why this Pokémon is never cold.','blue','#0d1219','upright',50,190,'waters-edge','fast',0,0,0,'2023-11-22 07:29:12','2023-11-22 07:29:12'),(267,'azumarill','These Pokémon create air-filled bubbles. When\nAzurill play in rivers, Azumarill will cover them\nwith these bubbles.','blue','#131a27','upright',50,75,'waters-edge','fast',0,0,0,'2023-11-22 07:29:12','2023-11-22 07:29:12'),(268,'sudowoodo','Though it pretends to be a tree, it fails to fool even children.\nTo the touch, its body feels more like rock than tree bark.\nSudowoodo\'s extreme aversion to water merits special note.','brown','#17170d','humanoid',50,65,'forest','medium',0,0,0,'2023-11-22 07:29:13','2023-11-22 07:29:13'),(269,'politoed','The cry of a male is louder than that of a female.\nMale Politoed with deep, menacing voices find\nmore popularity with the opposite gender.','green','#1c210c','humanoid',50,45,'waters-edge','medium-slow',0,0,0,'2023-11-22 07:29:13','2023-11-22 07:29:13'),(270,'hoppip','This Pokémon drifts and floats with the wind. If it senses the\napproach of strong winds, Hoppip links its leaves with other\nHoppip to prepare against being blown away.','pink','#14130c','upright',70,255,'grassland','medium-slow',0,0,0,'2023-11-22 07:29:14','2023-11-22 07:29:14'),(271,'skiploom','Skiploom’s flower blossoms when the temperature rises\nabove 64 degrees Fahrenheit. How much the flower opens\ndepends on the temperature. For that reason, this Pokémon\nis sometimes used as a thermometer.','green','#0b1303','upright',70,120,'grassland','medium-slow',0,0,0,'2023-11-22 07:29:16','2023-11-22 07:29:16'),(272,'jumpluff','Jumpluff rides warm southern winds to cross the sea and fly to\nforeign lands. The Pokémon descends to the ground when it\nencounters cold air while it is floating.','blue','#282924','upright',70,45,'grassland','medium-slow',0,0,0,'2023-11-22 07:29:16','2023-11-22 07:29:16'),(273,'aipom','This treetop dweller possesses a tail as dexterous as a hand.\nAncient writings describe this Pokémon as a one-armed oddity.','purple','#150e13','upright',70,45,'forest','fast',0,0,0,'2023-11-22 07:29:19','2023-11-22 07:29:19'),(274,'sunkern','Sunkern tries to move as little as it possibly can. It does so\nbecause it tries to conserve all the nutrients it has stored in its\nbody for its evolution. It will not eat a thing, subsisting only on\nmorning dew.','yellow','#0a0d03','ball',70,235,'grassland','medium-slow',0,0,0,'2023-11-22 07:29:19','2023-11-22 07:29:19'),(275,'sunflora','Sunflora converts solar energy into nutrition. It moves around\nactively in the daytime when it is warm. It stops moving as\nsoon as the sun goes down for the night.','yellow','#1a1b07','humanoid',70,120,'grassland','medium-slow',0,0,0,'2023-11-22 07:29:20','2023-11-22 07:29:20'),(276,'yanma','Its frail wings are so thin that one can see clear through them.\nHowever, during flight these wings exhibit the power to churn\nair with force enough to launch a house skyward.','red','#2a2825','bug-wings',70,75,'forest','medium',0,0,0,'2023-11-22 07:29:20','2023-11-22 07:29:20'),(277,'wooper','When walking on land, it covers its body with a\npoisonous film that keeps its skin from dehydrating.','blue','#0b0d16','legs',50,255,'waters-edge','medium',0,0,0,'2023-11-22 07:29:21','2023-11-22 07:29:21'),(278,'wooper-paldea','When walking on land, it covers its body with a\npoisonous film that keeps its skin from dehydrating.','blue','#0b0d16','legs',50,255,'waters-edge','medium',0,0,0,'2023-11-22 07:29:21','2023-11-22 07:29:21'),(279,'quagsire','Its body is always slimy. It often bangs its head\non the river bottom as it swims but seems not\nto care.','blue','#17252d','upright',50,90,'waters-edge','medium',0,0,0,'2023-11-22 07:29:21','2023-11-22 07:29:21'),(280,'espeon','Wields an arcane power with which it can predict the weather\nand even people\'s thoughts. When bathed in sunshine, the\nscarlet orb on its brow glows and builds energy.','purple','#1d151d','quadruped',50,45,'urban','medium',0,0,0,'2023-11-22 07:29:22','2023-11-22 07:29:22'),(281,'umbreon','It is most active in the wee hours of the night, when moonlight\nbathes the land. Its large eyes can pierce the darkness and\nperceive prey with absolute clarity.','black','#0c0c0c','quadruped',35,45,'urban','medium',0,0,0,'2023-11-22 07:29:23','2023-11-22 07:29:23'),(282,'murkrow','Widely shunned as a bearer of ill fortune. Upon crossing paths\nwith this creature, I\'ve been told one must chant ”Workrum,\nWorkrum—bad luck, don\'t come” as a protective incantation.','black','#0a0b0d','wings',35,30,'forest','medium-slow',0,0,0,'2023-11-22 07:29:24','2023-11-22 07:29:24'),(283,'slowking','Slowking can solve any problem presented to it,\nbut no one can understand a thing Slowking says.','pink','#33221f','upright',50,70,'waters-edge','medium',0,0,0,'2023-11-22 07:29:25','2023-11-22 07:29:25'),(284,'slowking-galar','Slowking can solve any problem presented to it,\nbut no one can understand a thing Slowking says.','pink','#33221f','upright',50,70,'waters-edge','medium',0,0,0,'2023-11-22 07:29:25','2023-11-22 07:29:25'),(285,'misdreavus','It conceals itself in darkness, sending chills up travelers\' spines\nwith its childlike weeping. As it observes the frightened travelers\nwith glee, the red orbs upon its chest let off an eerie light.','gray','#0c0a0e','ball',35,45,'cave','fast',0,0,0,'2023-11-22 07:29:26','2023-11-22 07:29:26'),(286,'unown','It is hard to believe these strangely shaped Pokémon are truly\nliving creatures. I\'ve pointed out that the species\' many forms\nresemble writing from other lands; no one will take me seriously.','black','#080808','ball',70,225,'rare','medium',0,0,0,'2023-11-22 07:29:27','2023-11-22 07:29:27'),(287,'wobbuffet','To keep its pitch-black tail hidden, it lives quietly\nin the darkness. It is never first to attack.','blue','#101e2b','blob',50,45,'cave','medium',0,0,0,'2023-11-22 07:29:28','2023-11-22 07:29:28'),(288,'girafarig','Girafarig’s rear head contains a tiny brain that is too small for\nthinking. However, the rear head doesn’t need to sleep, so it\ncan keep watch over its surroundings 24 hours a day.','yellow','#26211a','quadruped',70,60,'grassland','medium',0,0,0,'2023-11-22 07:29:29','2023-11-22 07:29:29'),(289,'pineco','It sticks tree bark to itself with its saliva,\nmaking itself thicker and larger. Elderly Pineco\nare ridiculously huge.','gray','#0b1216','ball',70,190,'forest','medium',0,0,0,'2023-11-22 07:29:30','2023-11-22 07:29:30'),(290,'forretress','In the moment that it gulps down its prey, the\ninside of its shell is exposed, but to this day,\nno one has ever seen that sight.','purple','#241a21','ball',70,75,'forest','medium',0,0,0,'2023-11-22 07:29:31','2023-11-22 07:29:31'),(291,'dunsparce','The nests Dunsparce live in are mazes of tunnels.\nThey never get lost in their own nests—they can\ntell where they are by the scent of the dirt.','yellow','#141712','squiggle',50,190,'cave','medium',0,0,0,'2023-11-22 07:29:32','2023-11-22 07:29:32'),(292,'gligar','Its tail is tipped by a thick, horrible stinger. To bring down prey,\nit will first obscure their vision by covering their faces with its\nbody, and then it will use the stinger to inject them with venom.','purple','#2a1c27','wings',70,60,'mountain','medium-slow',0,0,0,'2023-11-22 07:29:33','2023-11-22 07:29:33'),(293,'steelix','This Pokémon evolved through use of a strange item. Its body is\ncoated with steel powder and notably hard—not even diamond\ncan leave so much as a scratch.','gray','#373e46','squiggle',50,25,'cave','medium',0,0,0,'2023-11-22 07:29:33','2023-11-22 07:29:33'),(294,'steelix-mega','This Pokémon evolved through use of a strange item. Its body is\ncoated with steel powder and notably hard—not even diamond\ncan leave so much as a scratch.','gray','#373e46','squiggle',50,25,'cave','medium',0,0,0,'2023-11-22 07:29:33','2023-11-22 07:29:33'),(295,'snubbull','In contrast to its appearance, it’s quite\ntimid. When playing with other puppy\nPokémon, it sometimes gets bullied.','pink','#190f10','humanoid',70,190,'urban','fast',0,0,0,'2023-11-22 07:29:34','2023-11-22 07:29:34'),(296,'granbull','Although it’s popular with young people,\nGranbull is timid and sensitive, so it’s totally\nincompetent as a watchdog.','purple','#231b22','upright',70,75,'urban','fast',0,0,0,'2023-11-22 07:29:35','2023-11-22 07:29:35'),(297,'qwilfish','Fishers detest this troublesome Pokémon because it sprays\npoison from its spines, getting it everywhere. A different form\nof Qwilfish lives in other regions.','gray','#0e120f','fish',50,45,'sea','medium',0,0,0,'2023-11-22 07:29:36','2023-11-22 07:29:36'),(298,'qwilfish-hisui','Fishers detest this troublesome Pokémon because it sprays\npoison from its spines, getting it everywhere. A different form\nof Qwilfish lives in other regions.','gray','#0e120f','fish',50,45,'sea','medium',0,0,0,'2023-11-22 07:29:36','2023-11-22 07:29:36'),(299,'scizor','Evolved by way of a curious item. The shell covering its body\nhas been shown to be stronger than forged steel.','red','#311819','bug-wings',50,25,'grassland','medium',0,0,0,'2023-11-22 07:29:37','2023-11-22 07:29:37'),(300,'scizor-mega','Evolved by way of a curious item. The shell covering its body\nhas been shown to be stronger than forged steel.','red','#311819','bug-wings',50,25,'grassland','medium',0,0,0,'2023-11-22 07:29:37','2023-11-22 07:29:37'),(301,'shuckle','The berries stored in its vaselike 