39'),(308,'slugma','Slugma does not have any blood in its body. Instead, intensely\nhot magma circulates throughout this Pokémon’s body,\ncarrying essential nutrients and oxygen to its organs.','red','#150803','squiggle',70,190,'mountain','medium',0,0,0,'2023-11-22 07:29:40','2023-11-22 07:29:40'),(309,'magcargo','Magcargo’s body temperature is approximately\n18,000 degrees Fahrenheit. Water is vaporized on contact.\nIf this Pokémon is caught in the rain, the raindrops instantly\nturn into steam, cloaking the area in a thick fog.','red','#2f190f','squiggle',70,75,'mountain','medium',0,0,0,'2023-11-22 07:29:41','2023-11-22 07:29:41'),(310,'swinub','Swinub excels at sniffing out mushrooms buried beneath grass or\nsnow. Since ancient times, the people of Hisui have often relied\nupon this skill.','brown','#0c0906','quadruped',50,225,'cave','slow',0,0,0,'2023-11-22 07:29:41','2023-11-22 07:29:41'),(311,'piloswine','The long fur of this Pokémon covers its eyes, ears, and even\nlimbs, allowing Piloswine to resist harshly frigid conditions.\nThe Pokémon\'s white tusks can be used to defeat its enemies.','brown','#282019','quadruped',50,75,'cave','slow',0,0,0,'2023-11-22 07:29:41','2023-11-22 07:29:41'),(312,'corsola','These Pokémon live in warm seas.\nIn prehistoric times, many lived in the\noceans around the Galar region as well.','pink','#1e1218','armor',50,60,'sea','fast',0,0,0,'2023-11-22 07:29:42','2023-11-22 07:29:42'),(313,'corsola-galar','These Pokémon live in warm seas.\nIn prehistoric times, many lived in the\noceans around the Galar region as well.','pink','#1e1218','armor',50,60,'sea','fast',0,0,0,'2023-11-22 07:29:42','2023-11-22 07:29:42'),(314,'remoraid','Spits water from its mouth with incredible accuracy. It captures\nBurmy by shooting them down off the branches from which\nthey dangle.','gray','#101517','fish',50,190,'sea','medium',0,0,0,'2023-11-22 07:29:43','2023-11-22 07:29:43'),(315,'octillery','While Octillery still shoots water from its mouth, the drastic\nanatomical difference between it and Remoraid meant that for\na long time, no one believed the former evolved from the latter.','red','#1d0e09','tentacles',50,75,'sea','medium',0,0,0,'2023-11-22 07:29:44','2023-11-22 07:29:44'),(316,'delibird','It has a generous habit of sharing its food with\npeople and Pokémon, so it’s always scrounging\naround for more food.','red','#271d19','wings',50,45,'mountain','fast',0,0,0,'2023-11-22 07:29:44','2023-11-22 07:29:44'),(317,'mantine','This calm and gentle Pokémon swims gracefully through the sea.\nAfter building speed, it can leap out of the water. It is often\nmisidentified as a bird Pokémon due to this behavior.','purple','#22212d','wings',50,25,'sea','slow',0,0,0,'2023-11-22 07:29:45','2023-11-22 07:29:45'),(318,'skarmory','People fashion swords from Skarmory’s shed\nfeathers, so this Pokémon is a popular element\nin heraldic designs.','gray','#2c2a33','wings',50,25,'rough-terrain','slow',0,0,0,'2023-11-22 07:29:46','2023-11-22 07:29:46'),(319,'houndour','They make repeated eerie howls before dawn\nto call attention to their pack.','black','#09090a','quadruped',35,120,'rough-terrain','slow',0,0,0,'2023-11-22 07:29:46','2023-11-22 07:29:46'),(320,'houndoom','Identifiable by its eerie howls, people a long\ntime ago thought it was the grim reaper and\nfeared it.','black','#191719','quadruped',35,45,'rough-terrain','slow',0,0,0,'2023-11-22 07:29:47','2023-11-22 07:29:47'),(321,'houndoom-mega','Identifiable by its eerie howls, people a long\ntime ago thought it was the grim reaper and\nfeared it.','black','#191719','quadruped',35,45,'rough-terrain','slow',0,0,0,'2023-11-22 07:29:47','2023-11-22 07:29:47'),(322,'kingdra','Scales shed by this Pokémon have such a\nsplendorous gleam to them that they’ve been\ngiven to royalty as gifts.','blue','#1b2229','blob',50,45,'sea','medium',0,0,0,'2023-11-22 07:29:48','2023-11-22 07:29:48'),(323,'phanpy','Phanpy uses its long nose to shower itself. When others\ngather around, they thoroughly douse each other with water.\nThese Pokémon can be seen drying their soaking-wet\nbodies at the edge of water.','blue','#111317','quadruped',70,120,'rough-terrain','medium',0,0,0,'2023-11-22 07:29:48','2023-11-22 07:29:48'),(324,'donphan','If Donphan were to tackle with its hard body, even a house\ncould be destroyed. Using its massive strength, the Pokémon\nhelps clear rock and mud slides that block mountain trails.','gray','#262727','quadruped',70,60,'rough-terrain','medium',0,0,0,'2023-11-22 07:29:49','2023-11-22 07:29:49'),(325,'porygon2','A bizarre item caused this Pokémon to evolve. While it now\nexhibits many new gestures and expressions, its biology\nremains inscrutable.','red','#0e0c10','legs',50,45,'urban','medium',0,0,0,'2023-11-22 07:29:49','2023-11-22 07:29:49'),(326,'stantler','Its strangely shaped antlers have the power to bewitch those\nwho see them. Medicine made by grinding up the black orbs\nfrom fallen antlers is an effective treatment for insomnia.','brown','#31250f','quadruped',70,45,'forest','slow',0,0,0,'2023-11-22 07:29:50','2023-11-22 07:29:50'),(327,'smeargle','It draws symbols with the fluid that oozes from\nthe tip of its tail. Depending on the symbol,\nSmeargle fanatics will pay big money for them.','white','#1d1f15','upright',70,45,'urban','fast',0,0,0,'2023-11-22 07:29:50','2023-11-22 07:29:50'),(328,'tyrogue','Even though it is small, it can’t be ignored because\nit will slug any handy target without warning.','purple','#150f10','humanoid',50,75,'urban','medium',1,0,0,'2023-11-22 07:29:51','2023-11-22 07:29:51'),(329,'hitmontop','After doing a handstand to throw off the\nopponent’s timing, it presents its fancy kick moves.','brown','#22221c','upright',50,45,'urban','medium',0,0,0,'2023-11-22 07:29:52','2023-11-22 07:29:52'),(330,'smoochum','This is a very curious Pokémon. Smoochum\ndecides what it likes and dislikes by touching\nthings with its lips.','pink','#110d07','humanoid',50,45,'urban','medium',1,0,0,'2023-11-22 07:29