ing punches\nleave its foes scorched and blackened.','red','#37241b','upright',50,45,'grassland','medium-slow',0,0,0,'2023-11-22 07:30:05','2023-11-22 07:30:05'),(353,'mudkip','In water, Mudkip breathes using the gills on its cheeks. If it is\nfaced with a tight situation in battle, this Pokémon will unleash\nits amazing power—it can crush rocks bigger than itself.','blue','#0e1417','quadruped',50,45,'waters-edge','medium-slow',0,0,0,'2023-11-22 07:30:05','2023-11-22 07:30:05'),(354,'marshtomp','Marshtomp is much faster at traveling through mud than it is at\nswimming. This Pokémon’s hindquarters exhibit obvious\ndevelopment, giving it the ability to walk on just its hind legs.','blue','#151917','upright',50,45,'waters-edge','medium-slow',0,0,0,'2023-11-22 07:30:06','2023-11-22 07:30:06'),(355,'swampert','Swampert predicts storms by sensing subtle differences in the\nsounds of waves and tidal winds with its fins. If a storm is\napproaching, it piles up boulders to protect itself.','blue','#29282e','upright',50,45,'waters-edge','medium-slow',0,0,0,'2023-11-22 07:30:07','2023-11-22 07:30:07'),(356,'swampert-mega','Swampert predicts storms by sensing subtle differences in the\nsounds of waves and tidal winds with its fins. If a storm is\napproaching, it piles up boulders to protect itself.','blue','#29282e','upright',50,45,'waters-edge','medium-slow',0,0,0,'2023-11-22 07:30:07','2023-11-22 07:30:07'),(357,'poochyena','Poochyena is an omnivore—it will eat anything. A distinguishing\nfeature is how large its fangs are compared to its body. This\nPokémon tries to intimidate its foes by making the hair on its\ntail bristle out.','gray','#101010','quadruped',70,255,'grassland','medium',0,0,0,'2023-11-22 07:30:08','2023-11-22 07:30:08'),(358,'mightyena','Mightyena travel and act as a pack in the wild. The memory\nof its life in the wild compels the Pokémon to obey only\nthose Trainers that it recognizes to possess superior skill.','gray','#191819','quadruped',70,127,'grassla