ung—it has only just left its nest. As a result,\nit sometimes becomes lonesome and cries at night.\nThis Pokémon feeds on Wurmple that live in forests.','blue','#0d0c0f','wings',70,200,'grassland','medium-slow',0,0,0,'2023-11-22 07:30:18','2023-11-22 07:30:18'),(375,'swellow','Swellow is very conscientious about the upkeep of its glossy\nwings. Once two Swellow are gathered, they diligently take\ncare of cleaning each other’s wings.','blue','#18141a','wings',70,45,'grassland','medium-slow',0,0,0,'2023-11-22 07:30:20','2023-11-22 07:30:20'),(376,'wingull','It soars on updrafts without flapping its wings.\nIt makes a nest on sheer cliffs at the sea’s edge.','white','#131416','wings',50,190,'sea','medium',0,0,0,'2023-11-22 07:30:20','2023-11-22 07:30:20'),(377,'pelipper','Skimming the water’s surface, it dips its large bill\nin the sea, scoops up food and water, and\ncarries it.','yellow','#343227','wings',50,45,'sea','medium',0,0,0,'2023-11-22 07:30:21','2023-11-22 07:30:21'),(378,'ralts','Tends to prefer people with a chipper disposition to those who\nare gloomy, but it has shown no discrimination with regard to\nage or gender. Needs more research.','white','#0f100f','humanoid',35,235,'urban','slow',0,0,0,'2023-11-22 07:30:22','2023-11-22 07:30:22'),(379,'kirlia','It resembles a maiden in appearance, but it wields strange\npowers to project visions of paradise. I suspect the crimson\nornaments on its head are the key to its abilities.','white','#131712','humanoid',35,120,'urban','slow',0,0,0,'2023-11-22 07:30:22','2023-11-22 07:30:22'),(380,'gardevoir','It will dedicate itself to defending a master it has come to\nadore. Its pure white dress, reminiscent of those worn by ladies\nof nobility, is the dress of one who is willing to risk their life.','white','#2a332e','humanoid',35,45,'urban','slow',0,0,0,'2023-11-22 07:30:23','2023-11-22 07:30:23'),(381,'gardevoir-mega','It will dedicate itself to defending a master it has come to\nadore. Its pure white dress, reminiscent of those worn by ladies\nof nobility, is the dress of one who is willing to risk their life.','white','#2a332e','humanoid',35,45,'urban','slow',0,0,0,'2023-11-22 07:30:23','2023-11-22 07:30:23'),(382,'surskit','It lives in ponds and marshes that feature lots\nof plant life. It often fights with Dewpider,\nwhose habitat and diet are similar.','blue','#080c0c','armor',70,200,'waters-edge','medium',0,0,0,'2023-11-22 07:30:23','2023-11-22 07:30:23'),(383,'masquerain','Its thin, winglike antennae are highly absorbent.\nIt waits out rainy days in tree hollows.','blue','#2e2625','bug-wings',70,75,'waters-edge','medium',0,0,0,'2023-11-22 07:30:24','2023-11-22 07:30:24'),(384,'shroomish','If Shroomish senses danger, it shakes its body and scatters\nspores from the top of its head. This Pokémon’s spores are\nso toxic, they make trees and weeds wilt.','brown','#13110e','legs',70,255,'forest','fast-then-very-slow',0,0,0,'2023-11-22 07:30:24','2023-11-22 07:30:24'),(385,'breloom','The seeds ringing Breloom’s tail are made of hardened toxic\nspores. It is horrible to eat the seeds. Just taking a bite of this\nPokémon’s seed will cause your stomach to rumble.','green','#1f1c15','upright',70,90,'forest','fast-then-very-slow',0,0,0,'2023-11-22 07:30:25','2023-11-22 07:30:25'),(386,'slakoth','Slakoth’s heart beats just once a minute. Whatever happens,\nit is content to loaf around motionless. It is rare to see this\nPokémon in motion.','brown','#14110f','quadruped',70,255,'forest','slow',0,0,0,'2023-11-22 07:30:26','2023-11-22 07:30:26'),(387,'vigoroth','Vigoroth is simply incapable of remaining still. Even when it\ntries to sleep, the blood in its veins grows agitated, compelling\nthis Pokémon to run wild throughout the jungle before it can\nsettle down.','white','#2f2c2c','upright',70,120,'forest','slow',0,0,0,'2023-11-22 07:30:27','2023-11-22 07:30:27'),(388,'slaking','Wherever Slaking live, rings of over a yard in diameter appear\nin grassy fields. They are made by the Pokémon as it eats all\nthe grass within reach while lying prone on the ground.','brown','#39322d','humanoid',70,45,'forest','slow',0,0,0,'2023-11-22 07:30:27','2023-11-22 07:30:27'),(389,'nincada','It can sometimes live underground for more than\n10 years. It absorbs nutrients from the roots\nof trees.','gray','#11110f','armor',50,255,'forest','slow-then-very-fast',0,0,0,'2023-11-22 07:30:28','2023-11-22 07:30:28'),(390,'ninjask','This Pokémon is so quick, it is said to be able to\navoid any attack. It loves to feed on tree sap.','yellow','#221d1c','bug-wings',50,120,'forest','slow-then-very-fast',0,0,0,'2023-11-22 07:30:28','2023-11-22 07:30:28'),(391,'shedinja','A strange Pokémon—it flies without moving its\nwings, has a hollow shell for a body, and does\nnot breathe.','brown','#1c1915','blob',50,45,'forest','slow-then-very-fast',0,0,0,'2023-11-22 07:30:29','2023-11-22 07:30:29'),(392,'whismur','When Whismur cries, the sound of its own voice\nstartles it, making the Pokémon cry even louder.\nIt cries until it’s exhausted, then it falls asleep.','pink','#1a1213','upright',50,190,'cave','medium-slow',0,0,0,'2023-11-22 07:30:30','2023-11-22 07:30:30'),(393,'loudred','The force of this Pokémon’s loud voice isn’t just\nthe sound—it’s also the wave of air pressure that\nblows opponents away and damages them.','blue','#231e26','upright',50,120,'cave','medium-slow',0,0,0,'2023-11-22 07:30:31','2023-11-22 07:30:31'),(394,'exploud','This Pokémon can do more than just shout. To\ncommunicate with others of its kind, it’ll emit all\nsorts of sounds from the holes in its body.','blue','#362d32','upright',50,45,'cave','medium-slow',0,0,0,'2023-11-22 07:30:32','2023-11-22 07:30:32'),(395,'makuhita','There’s a rumor of a traditional recipe for stew\nthat Trainers can use to raise strong Makuhita.','yellow','#241f12','humanoid',70,180,'mountain','fast-then-very-slow',0,0,0,'2023-11-22 07:30:33','2023-11-22 07:30:33'),(396,'hariyama','Hariyama that are big and fat aren’t necessarily\nstrong. There are some small ones that move\nnimbly and use moves skillfully.','brown','#463428','humanoid',70,200,'mountain','fast-then-very-slow',0,0,0,'2023-11-22 07:30:33','2023-11-22 07:30:33'),(397,'azurill','Although Azurill are normally docile, an angry\none will swing around the big ball on its tail and\ntry to smash its opponents.','blue','#0c121e','legs',50,150,'waters-edge','fast',1,0,0,'2023-11-22 07:30:34','2023-11-22 07:30:34'),(398,'nosepass','Once the people of Hisui discovered that its red nose always\npoints north, they grew to rely on it greatly when traveling afar.\nThe nose seems to work in a similar way to ancient compasses.','gray','#0f1019','humanoid',70,255,'cave','medium',0,0,0,'2023-11-22 07:30:35','2023-11-22 07:30:35'),(399,'skitty','Skitty is known to chase around playfully after its own tail.\nIn the wild, this Pokémon lives in holes in the trees of forests.\nIt is very popular as a pet because of its adorable looks.','pink','#1d1211','quadruped',70,255,'forest','fast',0,0,0,'2023-11-22 07:30:35','2023-11-22 07:30:35'),(400,'delcatty','Delcatty sleeps anywhere it wants without keeping a permanent\nnest. If other Pokémon approach it as it sleeps, this Pokémon\nwill never fight—it will just move away somewhere else.','purple','#1a1317','quadruped',70,60,'forest','fast',0,0,0,'2023-11-22 07:30:36','2023-11-22 07:30:36'),(401,'sableye','It feeds on gemstone crystals. In darkness, its\neyes sparkle with the glitter of jewels.','purple','#0f0e17','humanoid',35,45,'cave','medium-slow',0,0,0,'2023-11-22 07:30:36','2023-11-22 07:30:36'),(402,'sableye-mega','It feeds on gemstone crystals. In darkness, its\neyes sparkle with the glitter of jewels.','purple','#0f0e17','humanoid',35,45,'cave','medium-slow',0,0,0,'2023-11-22 07:30:36','2023-11-22 07:30:36'),(403,'mawile','It chomps with its gaping mouth. Its huge jaws are\nactually steel horns that have been transformed.','black','#17140f','humanoid',50,45,'cave','fast',0,0,0,'2023-11-22 07:30:37','20