 psychokinetic powers.\nThis Pokémon is known to meditate for a whole month\nwithout eating.','red','#1b1314','humanoid',70,90,'mountain','medium',0,0,0,'2023-11-22 07:30:40','2023-11-22 07:30:40'),(412,'electrike','It stores electricity in its fur. It gives off sparks\nfrom all over its body in seasons when the air is dry.','green','#141b10','quadruped',50,120,'grassland','slow',0,0,0,'2023-11-22 07:30:40','2023-11-22 07:30:40'),(413,'manectric','It rarely appears before people. It is said to nest\nwhere lightning has fallen.','yellow','#262821','quadruped',50,45,'grassland','slow',0,0,0,'2023-11-22 07:30:41','2023-11-22 07:30:41'),(414,'manectric-mega','It rarely appears before people. It is said to nest\nwhere lightning has fallen.','yellow','#262821','quadruped',50,45,'grassland','slow',0,0,0,'2023-11-22 07:30:41','2023-11-22 07:30:41'),(415,'plusle','When Plusle is cheering on its partner, it flashes with electric\nsparks from all over its body. If its partner loses, this Pokémon\ncries loudly.','yellow','#190e0b','upright',70,200,'grassland','medium',0,0,0,'2023-11-22 07:30:42','2023-11-22 07:30:42'),(416,'minun','Minun loves to cheer on its partner in battle. It gives off sparks\nfrom its body while it is doing so. If its partner is in trouble,\nthis Pokémon gives off increasing amounts of sparks.','yellow','#0f1015','upright',70,200,'grassland','medium',0,0,0,'2023-11-22 07:30:43','2023-11-22 07:30:43'),(417,'volbeat','Volbeat’s tail glows like a lightbulb. With other Volbeat,\nit uses its tail to draw geometric shapes in the night sky.\nThis Pokémon loves the sweet aroma given off by Illumise.','gray','#1e1917','upright',70,150,'forest','slow-then-very-fast',0,0,0,'2023-11-22 07:30:43','2023-11-22 07:30:43'),(418,'illumise','Illumise leads a flight of illuminated Volbeat to draw signs in\nthe night sky. This Pokémon is said to earn greater respect\nfrom its peers by composing more complex designs in the sky.','purple','#151316','humanoid',70,150,'forest','fast-then-very-slow',0,0,0,'2023-11-22 07:30:44','2023-11-22 07:30:44'),(419,'roselia','Though beautiful, it has highly poisonous thorns. There is an old\ntradition in my homeland wherein one would send these thorns\nto an opponent to challenge them to a duel.','green','#131512','humanoid',50,150,'grassland','medium-slow',0,0,0,'2023-11-22 07:30:45','2023-11-22 07:30:45'),(420,'gulpin','Most of Gulpin’s body is made up of its stomach—its heart and\nbrain are very small in comparison. This Pokémon’s stomach\ncontains special enzymes that dissolve anything.','green','#10140b','arms',70,225,'grassland','fast-then-very-slow',0,0,0,'2023-11-22 07:30:46','2023-11-22 07:30:46'),(421,'swalot','Swalot has no teeth, so what it eats, it swallows whole, no\nmatter what. Its cavernous mouth yawns widely. An automobile\ntire could easily fit inside this Pokémon’s mouth.','purple','#292035','arms',70,75,'grassland','fast-then-very-slow',0,0,0,'2023-11-22 07:30:47','2023-11-22 07:30:47'),(422,'carvanha','These Pokémon have sharp fangs and powerful\njaws. Sailors avoid Carvanha dens at all costs.','red','#1a120c','fish',35,225,'sea','slow',0,0,0,'2023-11-22 07:30:48','2023-11-22 07:30:48'),(423,'sharpedo','This Pokémon is known as the Bully of the Sea.\nAny ship entering the waters Sharpedo calls\nhome will be attacked—no exceptions.','blue','#141721','fish',35,60,'sea','slow',0,0,0,'2023-11-22 07:30:48','2023-11-22 07:30:48'),(424,'sharpedo-mega','This Pokémon is known as the Bully of the Sea.\nAny ship entering the waters Sharpedo calls\nhome will be attacked—no exceptions.','blue','#141721','fish',35,60,'sea','slow',0,0,0,'2023-11-22 07:30:48','2023-11-22 07:30:48'),(425,'wailmer','When it sucks in a large volume of seawater,\nit becomes like a big, bouncy ball. It eats a ton\nof food daily.','blue','#22272b','fish',50,125,'sea','fast-then-very-slow',0,0,0,'2023-11-22 07:30:49','2023-11-22 07:30:49'),(426,'wailord','Its immense size is the reason for its popularity.\nWailord watching is a favorite sightseeing\nactivity in various parts of the world.','blue','#485477','fish',50,60,'sea','fast-then-very-slow',0,0,0,'2023-11-22 07:30:49','2023-11-22 07:30:49'),(427,'numel','Numel stores magma of almost 2,200 degrees Fahrenheit\nwithin its body. If it gets wet, the magma cools and hardens.\nIn that event, the Pokémon’s body grows heavy and its\nmovements become sluggish.','yellow','#201e10','quadruped',70,255,'mountain','medium',0,0,0,'2023-11-22 07:30:50','2023-11-22 07:30:50'),(428,'camerupt','The humps on Camerupt’s back are formed by a transformation\nof its bones. They sometimes blast out molten magma.\nThis Pokémon apparently erupts often when it is enraged.','red','#422923','quadruped',70,150,'mountain','medium',0,0,0,'2023-11-22 07:30:51','2023-11-22 07:30:51'),(429,'camerupt-mega','The humps on Camerupt’s back are formed by a transformation\nof its bones. They sometimes blast out molten magma.\nThis Pokémon apparently erupts often when it is enraged.','red','#422923','quadruped',70,150,'mountain','medium',0,0,0,'2023-11-22 07:30:51','2023-11-22 07:30:51'),(430,'torkoal','You find abandoned coal mines full of them.\nThey dig tirelessly in search of coal.','brown','#463c38','quadruped',50,90,'mountain','medium',0,0,0,'2023-11-22 07:30:53','2023-11-22 07:30:53'),(431,'spoink','Spoink keeps a pearl on top of its head. The pearl functions to\namplify this Pokémon’s psychokinetic powers. It is therefore on\na constant search for a bigger pearl.','black','#110e10','arms',70,255,'mountain','fast',0,0,0,'2023-11-22 07:30:53','2023-11-22 07:30:53'),(432,'grumpig','Grumpig uses the black pearls on its body to wield\nits fantastic powers. When it is doing so, it dances bizarrely.\nThis Pokémon’s black pearls are valuable as works of art.','purple','#251b23','upright',70,60,'mountain','fast',0,0,0,'2023-11-22 07:30:54','2023-11-22 07:30:54'),(433,'spinda','Each Spinda’s spot pattern is different. With its\nstumbling movements, it evades opponents’\nattacks brilliantly!','brown','#1d1712','upright',70,255,'mountain','fast',0,0,0,'2023-11-22 07:30:55','2023-11-22 07:30:55'),(434,'trapinch','It makes an inescapable conical pit and lies in\nwait at the bottom for prey to come\ntumbling down.','brown','#1b0e0a','armor',50,255,'rough-terrain','medium-slow',0,0,0,'2023-11-22 07:30:56','2023-11-22 07:30:56'),(435,'vibrava','To help make its wings grow, it dissolves\nquantities of prey in its digestive juices and\nguzzles them down every day.','green','#131712','bug-wings',50,120,'rough-terrain','medium-slow',0,0,0,'2023-11-22 07:30:58','2023-11-22 07:30:58'),(436,'flygon','It is nicknamed the Desert Spirit because the\nflapping of its wings sounds like a woman singing.','green','#2f2f20','wings',50,45,'rough-terrain','medium-slow',0,0,0,'2023-11-22 07:30:59','2023-11-22 07:30:59'),(437,'cacnea','The more arid and harsh the environment, the more pretty and\nfragrant a flower Cacnea grows. This Pokémon battles by\nwildly swinging its thorny arms.','green','#0e1408','humanoid',35,190,'rough-terrain','medium-slow',0,0,0,'2023-11-22 07:31:00','2023-11-22 07:31:00'),(438,'cacturne','If a traveler is going through a desert in the thick of night,\nCacturne will follow in a ragtag group. The Pokémon are\nbiding their time, waiting for the traveler to tire and become\nincapable of moving.','green','#1e2e16','humanoid',35,60,'rough-terrain','medium-slow',0,0,0,'2023-11-22 07:31:01','2023-11-22 07:31:01'),(439,'swablu','Since Swablu looks like a cumulus cloud, foes can\nhave a hard time finding it. Apparently its wings\nturned white over many generations.','blue','#262a2f','wings',50,255,'forest','slow-then-very-fast',0,0,0,'2023-11-22 07:31:02','2023-11-22 07:31:02'),(440,'altaria','This Pokémon has a kind disposition, but if it’s\nprovoked, it will threaten opponents with shrill\ncries before attacking them without mercy.','blue','#272f38','wings',50,45,'forest','slow-then-very-fast',0,0,0,'2023-11-22 07:31:02','2023-11-22 07:3