 from afar that escaped\nto the wild. It can adapt to the dirtiest river.','red','#21130e','armor',50,205,'waters-edge','fast-then-very-slow',0,0,0,'2023-11-22 07:31:09','2023-11-22 07:31:09'),(449,'crawdaunt','A brutish Pokémon that loves to battle. It will\ncrash itself into any foe that approaches its nest.','red','#2e1613','armor',50,155,'waters-edge','fast-then-very-slow',0,0,0,'2023-11-22 07:31:10','2023-11-22 07:31:10'),(450,'baltoy','It was discovered in ancient ruins. While moving,\nit constantly spins. It stands on one foot even\nwhen asleep.','brown','#100e0a','arms',50,255,'rough-terrain','medium',0,0,0,'2023-11-22 07:31:11','2023-11-22 07:31:11'),(451,'claydol','It appears to have been born from clay dolls\nmade by ancient people. It uses telekinesis to\nfloat and move.','black','#271e1f','arms',50,90,'rough-terrain','medium',0,0,0,'2023-11-22 07:31:11','2023-11-22 07:31:11'),(452,'lileep','Lileep clings to rocks on the seabed. When prey\ncomes close, this Pokémon entangles it with\npetallike tentacles.','purple','#20141a','blob',50,45,'sea','slow-then-very-fast',0,0,0,'2023-11-22 07:31:13','2023-11-22 07:31:13'),(453,'cradily','Once Cradily catches prey in its tentacles,\nit digests them whole and absorbs their nutrients.','green','#2c2c20','blob',50,45,'sea','slow-then-very-fast',0,0,0,'2023-11-22 07:31:13','2023-11-22 07:31:13'),(454,'anorith','Anorith can swim swiftly by pulling its eight wings\nthrough the water like oars on a boat. This\nPokémon is an ancestor of modern bug Pokémon.','gray','#131010','armor',50,45,'waters-edge','slow-then-very-fast',0,0,0,'2023-11-22 07:31:14','2023-11-22 07:31:14'),(455,'armaldo','Though it lives on land, it’s also a good swimmer.\nIt dives into the ocean in search of prey, using its\nsharp claws to take down its quarry.','gray','#2c262b','upright',50,45,'waters-edge','slow-then-very-fast',0,0,0,'2023-11-22 07:31:15','2023-11-22 07:31:15'),(456,'feebas','It is a shabby and ugly Pokémon. However, it is\nvery hardy