menace if something angers it.','blue','#413a44','quadruped',35,45,'rough-terrain','slow',0,0,0,'2023-11-22 07:31:35','2023-11-22 07:31:35'),(488,'beldum','The cells in this Pokémon’s body are composed\nof magnetic material. Instead of blood, magnetic\nforces flow through Beldum’s body.','blue','#090c12','blob',35,3,'rough-terrain','slow',0,0,0,'2023-11-22 07:31:35','2023-11-22 07:31:35'),(489,'metang','Using magnetic forces to stay aloft, this Pokémon\nflies at high speeds, weaving through harsh\nmountain terrain in pursuit of prey.','blue','#1a212c','arms',35,3,'rough-terrain','slow',0,0,0,'2023-11-22 07:31:36','2023-11-22 07:31:36'),(490,'metagross','Metagross is the result of the fusion of two\nMetang. This Pokémon defeats its opponents\nthrough use of its supercomputer-level brain.','blue','#1b222f','heads',35,3,'rough-terrain','slow',0,0,0,'2023-11-22 07:31:36','2023-11-22 07:31:36'),(491,'metagross-mega','Metagross is the result of the fusion of two\nMetang. This Pokémon defeats its opponents\nthrough use of its supercomputer-level brain.','blue','#1b222f','heads',35,3,'rough-terrain','slow',0,0,0,'2023-11-22 07:31:36','2023-11-22 07:31:36'),(492,'regirock','Cutting-edge technology was used to study\nthe internals of this Pokémon’s rock body, but\nnothing was found—not even a brain or a heart.','brown','#483b2d','humanoid',35,3,'cave','slow',0,1,0,'2023-11-22 07:31:38','2023-11-22 07:31:38'),(493,'regice','This Pokémon’s body is made of solid ice. It’s\nsaid that Regice was born beneath thick ice in\nthe ice age.','blue','#293a46','humanoid',35,3,'cave','slow',0,1,0,'2023-11-22 07:31:38','2023-11-22 07:31:38'),(494,'registeel','It’s rumored that this Pokémon was born deep\nunderground in the planet’s mantle and that it\nemerged onto the surface 10,000 years ago.','gray','#363534','humanoid',35,3,'cave','slow',0,1,0,'2023-11-22 07:31:39','2023-11-22 07:31:39'),(495,'latias','Latias is highly intelligent and capable of understanding\nhuman speech. It is covered with a glass-like down.\nThe Pokémon enfolds its body with its down and refracts\nlight to alter its appearance.','red','#2c1a1f','wings',90,3,'waters-edge','slow',0,1,0,'2023-11-22 07:31:40','2023-11-22 07:31:40'),(496,'latias-mega','Latias is highly intelligent and capable of understanding\nhuman speech. It is covered with a glass-like down.\nThe Pokémon enfolds its body with its down and refracts\nlight to alter its appearance.','red','#2c1a1f','wings',90,3,'waters-edge','slow',0,1,0,'2023-11-22 07:31:40','2023-11-22 07:31:40'),(497,'latios','Latios will only open its heart to a Trainer with a\ncompassionate spirit. This Pokémon can fly faster than a\njet plane by folding its forelegs to minimize air resistance.','blue','#232837','wings',90,3,'waters-edge','slow',0,1,0,'2023-11-22 07:31:40','2023-11-22 07:31:40'),(498,'latios-mega','Latios will only open its heart to a Trainer with a\ncompassionate spirit. This Pokémon can fly faster than a\njet plane by folding its forelegs to minimize air resistance.','blue','#232837','wings',90,3,'waters-edge','slow',0,1,0,'2023-11-22 07:31:40','2023-11-22 07:31:40'),(499,'kyogre','Kyogre is said to be the personification of the sea itself.\nLegends tell of its many clashes against Groudon,\nas each sought to gain the power of nature.','blue','#26293f','fish',0,3,'sea','slow',0,1,0,'2023-11-22 07:31:41','2023-11-22 07:31:41'),(500,'kyogre-primal','Kyogre is said to be the personification of the sea itself.\nLegends tell of its many clashes against Groudon,\nas each sought to gain the power of nature.','blue','#26293f','fish',0,3,'sea','slow',0,1,0,'2023-11-22 07:31:41','2023-11-22 07:31:41'),(501,'groudon','Through Primal Reversion and with nature’s full power,\nit will take back its true form. It can cause magma to\nerupt and expand the landmass of the world.','red','#3e2022','upright',0,3,'rough-terrain','slow',0,1,0,'2023-11-22 07:31:41','2023-11-22 07:31:41'),(502,'groudon-primal','Through Primal Reversion and with nature’s full power,\nit will take back its true form. It can cause magma to\nerupt and expand the landmass of the world.','red','#3e2022','upright',0,3,'rough-terrain','slow',0,1,0,'2023-11-22 07:31:41','2023-11-22 07:31:41'),(503,'rayquaza','It flies forever through the ozone layer, consuming\nmeteoroids for sustenance. The many meteoroids\nin its body provide the energy it needs to Mega Evolve.','green','#223127','squiggle',0,45,'rare','slow',0,1,0,'2023-11-22 07:31:42','2023-11-22 07:31:42'),(504,'rayquaza-mega','It flies forever through the ozone layer, consuming\nmeteoroids for sustenance. The many meteoroids\nin its body provide the energy it needs to Mega Evolve.','green','#223127','squiggle',0,45,'rare','slow',0,1,0,'2023-11-22 07:31:42','2023-11-22 07:31:42'),(505,'jirachi','It’s believed that when this Pokémon wakes from\nits 1,000-year slumber, it will grant any wishes\nwritten on the notes attached to its head.','yellow','#1c1c12','humanoid',100,3,'mountain','slow',0,0,1,'2023-11-22 07:31:42','2023-11-22 07:31:42'),(506,'deoxys-normal','Deoxys emerged from a virus that came from space. It is highly\nintelligent and wields psychokinetic powers. This Pokémon\nshoots lasers from the crystalline organ on its chest.','red','#302323','humanoid',0,3,'rare','slow',0,0,1,'2023-11-22 07:31:43','2023-11-22 07:31:43'),(507,'deoxys-attack','Deoxys emerged from a virus that came from space. It is highly\nintelligent and wields psychokinetic powers. This Pokémon\nshoots lasers from the crystalline organ on its chest.','red','#302323','humanoid',0,3,'rare','slow',0,0,1,'2023-11-22 07:31:43','2023-11-22 07:31:43'),(508,'deoxys-defense','Deoxys emerged from a virus that came from space. It is highly\nintelligent and wields psychokinetic powers. This Pokémon\nshoots lasers from the crystalline organ on its chest.','red','#302323','humanoid',0,3,'rare','slow',0,0,1,'2023-11-22 07:31:43','2023-11-22 07:31:43'),(509,'deoxys-speed','Deoxys emerged from a virus that came from space. It is highly\nintelligent and wields psychokinetic powers. This Pokémon\nshoots lasers from the crystalline organ on its chest.','red','#302323','humanoid',0,3,'rare','slow',0,0,1,'2023-11-22 07:31:43','2023-11-22 07:31:43'),(510,'turtwig','This Pokémon becomes more energetic the more sunlight there\nis. The part resembling a shell is similar to silt and is slightly\ndamp and warm to the touch.','green','#11130a','quadruped',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:31:44','2023-11-22 07:31:44'),(511,'grotle','Appears where there is clean spring water. The fruit that grows\non the shrubs on its shell is sweet, nutritious, and truly delicious.','green','#2a301a','quadruped',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:31:44','2023-11-22 07:31:44'),(512,'torterra','This remarkable, large-bodied Pokémon would serve beautifully\nas borrowed scenery for a garden, and its strength is peerless.\nTorterra roams the wilderness in search of clean water.','green','#314028','quadruped',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:31:45','2023-11-22 07:31:45'),(513,'chimchar','Full of vigor and always in high spirits. It was once known by the\nname ”Lantern-Tail” and feared as some kind of apparition.','brown','#1b1208','upright',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:31:47','2023-11-22 07:31:47'),(514,'monferno','The deeper the blue on its face, the more powerful it will grow\nto become. It leaps about every which way and lands powerful\nblows against its opponents with the flame on its tail.','brown','#2d2011','upright',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:31:47','2023-11-22 07:31:47'),(515,'infernape','A tall, hardy Pokémon with a dazzling appearance. It shrouds\nitself in flame and battles as if engaged in dance—truly a sight\nto behold.','brown','#3c271c','upright',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:31:48','2023-11-22 07:31:48'),(516,'piplup','Prefers cold climes and appears along coasts. It\'s an adorable\nlittle thing—as cute as any child—but it\'s also prideful, unwilling\nto accept handouts from people.','blue','#0a0e10','humanoid',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:31:50','2023-11-22 07:31:50'),(517,'prinplup','It swims gracefully through the frigid sea and sings with a voice\nlike the roaring tide. It has powerful, sturdy wings and dignity\nto match.','blue','#151b21','upright',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:31:51','2023-11-22 07:31:51'),(518,'empoleon','Since ancient times, it has been revered by the people of Hisui,\nwho call it the Master of the Waves. Its wings are a match for\neven master-crafted blades.','blue','#1f2732','upright',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:31:51','2023-11-22 07:31:51'),(519,'starly','They live in the fields and mountains, gathering in large flocks.\nTheir cries are quite obnoxious. Though small, their wings are\nstrong—a strike from them leaves pain that persists for a week.','brown','#0d0c0b','wings',70,255,NULL,'medium-slow',0,0,0,'2023-11-22 07:31:52','2023-11-22 07:31:52'),(520,'staravia','They form remarkably large flocks and are constantly fighting\namongst themselves. I suspect that those with magnificent\nplumes on their heads are the strong ones.','brown','#110f0f','wings',70,120,NULL,'medium-slow',0,0,0,'2023-11-22 07:31:52','2023-11-22 07:31:52'),(521,'staraptor','It has left the flock, having gained strength enough to survive on\nits own. The astounding force with which Staraptor flies through\nthe air allows it to carry away large, burly targets.','brown','#1e1919','wings',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:31:53','2023-11-22 07:31:53'),(522,'bidoof','Bidoof has an unsophisticated face and is rarely flustered by\nanything. There have been incidents involving Bidoof sauntering\ninto villages and gnawing on the houses without a single care.','brown','#171109','quadruped',70,255,NULL,'medium',0,0,0,'2023-11-22 07:31:54','2023-11-22 07:31:54'),(523,'bibarel','Bibarel fur repels water and is also a fantastic material for heat\nretention. These Pokémon create dams on rivers to live in.','brown','#2b2117','upright',70,127,NULL,'medium',0,0,0,'2023-11-22 07:31:54','2023-11-22 07:31:54'),(524,'kricketot','When the trees take on new hues, more of these Pokémon\nappear. The tone they create by striking their antennae together\nresembles that of the marimba, an instrument of foreign lands.','red','#140f0b','humanoid',70,255,NULL,'medium-slow',0,0,0,'2023-11-22 07:31:55','2023-11-22 07:31:55'),(525,'kricketune','It uses its cutlass-like arms to produce sound, the melody of\nwhich varies from individual to individual. It is a worthwhile\nendeavor to seek out one\'s favorite tunes.','red','#21120c','bug-wings',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:31:55','2023-11-22 07:31:55'),(526,'shinx','Shakes its body to generate electricity. Its stature belies its\naggression—one must be patient to tame this Pokémon.','blue','#101216','quadruped',50,235,NULL,'medium-slow',0,0,0,'2023-11-22 07:31:55','2023-11-22 07:31:55'),(527,'luxio','Proudly uses its electrified claws as weapons. It seems to be a\ngracious Pokémon, evenly sharing the spoils of the hunt with\nothers of its kind.','blue','#131417','quadruped',100,120,NULL,'medium-slow',0,0,0,'2023-11-22 07:31:56','2023-11-22 07:31:56'),(528,'luxray','They form packs, each having one male as leader. Legends say\nthat when Luxray\'s two eyes shimmer with gold, the Pokémon\ncan see through anything.','blue','#16171b','quadruped',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:31:57','2023-11-22 07:31:57'),(529,'budew','When the sun\'s light strengthens, the bud atop this Pokémon\'s\nhead opens. This is a sign to the people that the harsh winter is\nover, and the season of budding has begun.','green','#0b0f07','humanoid',50,255,NULL,'medium-slow',1,0,0,'2023-11-22 07:31:57','2023-11-22 07:31:57'),(530,'roserade','Hidden within the bouquet on each hand are thorned whips\nloaded with virulent poison. Roserade moves gracefully as it\ncorners its prey and mercilessly lashes them with its whips.','green','#212324','humanoid',50,75,NULL,'medium-slow',0,0,0,'2023-11-22 07:31:58','2023-11-22 07:31:58'),(531,'cranidos','An incredibly rare sight. They duel each other by ramming their\nheads together, and the resulting sound echoes throughout the\narea like the pealing of a bell.','blue','#11151a','upright',70,45,NULL,'slow-then-very-fast',0,0,0,'2023-11-22 07:31:59','2023-11-22 07:31:59'),(532,'rampardos','Very little is known about its biology. Can knock down massive\ntrees by smashing its beautiful, pearl-like crown against them.','blue','#21262b','upright',70,45,NULL,'slow-then-very-fast',0,0,0,'2023-11-22 07:31:59','2023-11-22 07:31:59'),(533,'shieldon','Much remains unknown about this Pokémon, as few have ever\nseen it. However, we know that it is calm and dislikes conflict,\nand it enjoys polishing its face against trees and rocks.','gray','#100e0d','quadruped',70,45,NULL,'slow-then-very-fast',0,0,0,'2023-11-22 07:32:00','2023-11-22 07:32:00'),(534,'bastiodon','Its face is sturdy—as strong as diamond—and this hardness\noffers a very stable defense. Much about this species is still\nunknown, such as its natural habitat.','gray','#232121','quadruped',70,45,NULL,'slow-then-very-fast',0,0,0,'2023-11-22 07:32:00','2023-11-22 07:32:00'),(535,'burmy','If its cloak is even slightly damaged, Burmy will immediately\nrepair it with whatever is close at hand. The Pokémon within the\ncloak is scrawny and vulnerable to the cold.','green','#070906','blob',70,120,NULL,'medium',0,0,0,'2023-11-22 07:32:01','2023-11-22 07:32:01'),(536,'wormadam-plant','When Burmy evolved, its cloak became a part of\nthis Pokémon’s body. The cloak is never shed.','green','#0c0f0b','blob',70,45,NULL,'medium',0,0,0,'2023-11-22 07:32:01','2023-11-22 07:32:01'),(537,'wormadam-sandy','When Burmy evolved, its cloak became a part of\nthis Pokémon’s body. The cloak is never shed.','green','#0c0f0b','blob',70,45,NULL,'medium',0,0,0,'2023-11-22 07:32:01','2023-11-22 07:32:01'),(538,'wormadam-trash','When Burmy evolved, its cloak became a part of\nthis Pokémon’s body. The cloak is never shed.','green','#0c0f0b','blob',70,45,NULL,'medium',0,0,0,'2023-11-22 07:32:01','2023-11-22 07:32:01'),(539,'mothim','Scatters steel-colored scales as it flaps its wings. Despite\nbeing observed feeding primarily on the nectar of flowers,\nMothim is not often seen around flower gardens.','yellow','#2f2214','bug-wings',70,45,NULL,'medium',0,0,0,'2023-11-22 07:32:02','2023-11-22 07:32:02'),(540,'combee','They swear fealty to a queen Pokémon and work diligently to\ngather nectar. Each swarm produces a different flavor of honey.','yellow','#1a160c','heads',50,120,NULL,'medium-slow',0,0,0,'2023-11-22 07:32:02','2023-11-22 07:32:02'),(541,'vespiquen','Commands its subjects to build its hive. It will dispatch any\ninterlopers who dare sneak into its nest and use them as\nnourishment for itself.','yellow','#231a0c','bug-wings',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:32:03','2023-11-22 07:32:03'),(542,'pachirisu','A species related to the Pikachu line. Though Pachirisu is a calm\nPokémon, it still presents a danger should one touch its\nelectrified tail or cheeks.','white','#1d1e21','quadruped',100,200,NULL,'medium',0,0,0,'2023-11-22 07:32:03','2023-11-22 07:32:03'),(543,'buizel','It moves freely in the water by spinning its forked tail for\npropulsion. The resemblance to the screw of a steamboat\nis coincidental.','brown','#1a1108','quadruped',70,190,NULL,'medium',0,0,0,'2023-11-22 07:32:05','2023-11-22 07:32:05'),(544,'floatzel','Has a long, rather splendid flotation sac, which prevents\nFloatzel from drowning even in stormy seas. One might glimpse\nthis species around fishing hamlets from time to time.','brown','#332615','quadruped',70,75,NULL,'medium',0,0,0,'2023-11-22 07:32:06','2023-11-22 07:32:06'),(545,'cherubi','Once the fruit growing alongside the main body is large and\nplump, Cherubi will use the nutrients within to evolve. The fruit\nthen detaches, becoming nourishment for other creatures.','pink','#0d0b0a','heads',50,190,NULL,'medium',0,0,0,'2023-11-22 07:32:06','2023-11-22 07:32:06'),(546,'cherrim','Motionless, save for the occasional quiver. A rich array of\nPokémon can be found gathered around it, drawn by the\nscent exuded from Cherrim\'s folded petals.','purple','#0e0c0e','legs',50,75,NULL,'medium',0,0,0,'2023-11-22 07:32:09','2023-11-22 07:32:09'),(547,'shellos','Found in abundance on seashores bordering warm waters.\nShellos are unexpectedly friendly and will crawl toward any\nperson they see. Take care not to get coated in mucus!','purple','#120d0f','squiggle',50,190,NULL,'medium',0,0,0,'2023-11-22 07:32:09','2023-11-22 07:32:09'),(548,'gastrodon','Eats beach sand for nourishment. Should one Gastrodon\nencounter another of a different color, a fierce battle will inevitably ensue.','purple','#1f1514','squiggle',50,75,NULL,'medium',0,0,0,'2023-11-22 07:32:10','2023-11-22 07:32:10'),(549,'ambipom','To affirm their kinship, members of this species will form a ring\nby linking their newly doubled tails together. On rare occasions,\nhumans have been accepted into such rings.','purple','#321f2e','upright',100,45,NULL,'fast',0,0,0,'2023-11-22 07:32:11','2023-11-22 07:32:11'),(550,'drifloon','Said to lure away young children and carry them off to the\nafterlife. Some whisper that Drifloon are formed of reincarnated\nhuman souls, but these rumors are as yet unconfirmed.','purple','#131014','arms',50,125,NULL,'fast-then-very-slow',0,0,0,'2023-11-22 07:32:11','2023-11-22 07:32:11'),(551,'drifblim','It drifts along at dusk, perfectly silent. Its transient, melancholy\naspect touches some people deeply—every so often, one will\ncome upon a song or poem devoted to Drifblim.','purple','#292125','arms',50,60,NULL,'fast-then-very-slow',0,0,0,'2023-11-22 07:32:12','2023-11-22 07:32:12'),(552,'buneary','My hypothesis as to why Buneary rolls up its ears is that its\nhearing is far too keen. I surmise that the Pokémon protects its\nhearing by limiting the sound that may enter its ears.','brown','#17120e','upright',0,190,NULL,'medium',0,0,0,'2023-11-22 07:32:12','2023-11-22 07:32:12'),(553,'lopunny','Its fur is warm and yet remarkably light. This Pokémon kicks as\nthough it were a master of karate, driving back its opponents\nwith ease.','brown','#2b231a','upright',140,60,NULL,'medium',0,0,0,'2023-11-22 07:32:13','2023-11-22 07:32:13'),(554,'lopunny-mega','Its fur is warm and yet remarkably light. This Pokémon kicks as\nthough it were a master of karate, driving back its opponents\nwith ease.','brown','#2b231a','upright',140,60,NULL,'medium',0,0,0,'2023-11-22 07:32:13','2023-11-22 07:32:13'),(555,'mismagius','The incantations Mismagius chants can ward against misfortune,\nso a custom exists of inviting it into one\'s home. Incur the\nPokémon\'s displeasure, however, and disaster will surely ensue.','purple','#19101c','ball',35,45,NULL,'fast',0,0,0,'2023-11-22 07:32:14','2023-11-22 07:32:14'),(556,'honchkrow','One cry from this Pokémon, and a murder of Murkrow come\nflying. At such times, one would think the curtain of night had\nfallen, plunging the world into jet-black darkness.','black','#131217','wings',35,30,NULL,'medium-slow',0,0,0,'2023-11-22 07:32:14','2023-11-22 07:32:14'),(557,'glameow','Bewitches humans with its helical tail and piercing gaze.\nIts hidden claws are quite sharp as well, making this Pokémon\nan exceedingly tricky opponent if antagonized.','gray','#1b1b20','quadruped',70,190,NULL,'fast',0,0,0,'2023-11-22 07:32:15','2023-11-22 07:32:15'),(558,'purugly','Though impudent and difficult to tame, Purugly enjoys great\npopularity due to its fur, the beauty of which surpasses\neven velveteen.','gray','#25252c','quadruped',70,75,NULL,'fast',0,0,0,'2023-11-22 07:32:16','2023-11-22 07:32:16'),(559,'chingling','This Pokémon gave me an excruciating headache when it\nseemingly cried out without making a sound. Perhaps there are\nsome sounds that the human ear is simply incapable of hearing.','yellow','#110d08','humanoid',70,120,NULL,'fast',1,0,0,'2023-11-22 07:32:16','2023-11-22 07:32:16'),(560,'stunky','The poison that gushes from its aft end is accompanied by an\nutterly evil-smelling odor with such potency that one whiff can\ninduce memory loss.','purple','#131013','quadruped',50,225,NULL,'medium',0,0,0,'2023-11-22 07:32:16','2023-11-22 07:32:16'),(561,'skuntank','Sprays a poisonous fluid to take down prey. Sometimes, unable\nto stomach the stench of its own fluid, it leaves the bested\nprey uneaten.','purple','#272126','quadruped',50,60,NULL,'medium',0,0,0,'2023-11-22 07:32:18','2023-11-22 07:32:18'),(562,'bronzor','Floats using a mysterious energy. The pattern engraved upon its\nback is held as sacred and can sometimes be found in imagery\nfrom ancient cemeteries and other such timeworn places.','green','#040d10','ball',50,255,NULL,'medium',0,0,0,'2023-11-22 07:32:19','2023-11-22 07:32:19'),(563,'bronzong','Some believe that its bell-like cry opens holes to another world.\nIt has been revered as a deity since ancient times.','green','#132c33','arms',50,90,NULL,'medium',0,0,0,'2023-11-22 07:32:20','2023-11-22 07:32:20'),(564,'bonsly','Its tears elicit sympathy from those who see them, but do\nnot be deceived! This expulsion of body water is merely a\nphysiological mechanism for keeping itself in good health.','brown','#0e1009','legs',50,255,NULL,'medium',1,0,0,'2023-11-22 07:32:21','2023-11-22 07:32:21'),(565,'mime-jr','Known to turn up in bustling marketplaces now and again.\nIt mimics people much as a child would, then watches how they\nreact, eyes sparkling.','pink','#120f16','humanoid',50,145,NULL,'medium',1,0,0,'2023-11-22 07:32:22','2023-11-22 07:32:22'),(566,'happiny','In imitation of Chansey, it keeps a round stone tucked into its\nbelly pouch and cherishes it dearly. It gets along well with\nchildren and will sometimes play house with them for fun.','pink','#140e10','humanoid',140,130,NULL,'fast',1,0,0,'2023-11-22 07:32:23','2023-11-22 07:32:23'),(567,'chatot','A versatile performer skilled in the imitation of human speech.\nIt is said that older, more experienced Chatot can even\nunderstand the meaning of the words they mimic.','black','#0b0b0c','wings',35,30,NULL,'medium-slow',0,0,0,'2023-11-22 07:32:23','2023-11-22 07:32:23'),(568,'spiritomb','It lays curses by thinking wicked thoughts. Writings tell that this\nPokémon was born out of the assembly of five score and eight\nmalevolent spirits.','purple','#2c1f28','blob',50,100,NULL,'medium',0,0,0,'2023-11-22 07:32:24','2023-11-22 07:32:24'),(569,'gible','It nests in caves untouched by sunlight. Its sharp teeth may fall\nout when worn away or after an impact, but they regrow within\na few days.','blue','#111619','upright',50,45,NULL,'slow',0,0,0,'2023-11-22 07:32:25','2023-11-22 07:32:25'),(570,'gabite','Though Gabite are usually of a violent disposition, when I gave\none a glass bead it had been eyeing covetously, it suddenly\nbecame quite docile.','blue','#1c1d2b','upright',50,45,NULL,'slow',0,0,0,'2023-11-22 07:32:26','2023-11-22 07:32:26'),(571,'garchomp','Soars across the heavens at blinding speed—a magnificent sight!\nIt has a feral disposition. Utmost caution is required if one\nmeets a Garchomp out in the wilds.','blue','#2f2b3f','upright',50,45,NULL,'slow',0,0,0,'2023-11-22 07:32:26','2023-11-22 07:32:26'),(572,'garchomp-mega','Soars across the heavens at blinding speed—a magnificent sight!\nIt has a feral disposition. Utmost caution is required if one\nmeets a Garchomp out in the wilds.','blue','#2f2b3f','upright',50,45,NULL,'slow',0,0,0,'2023-11-22 07:32:26','2023-11-22 07:32:26'),(573,'munchlax','Its robust stomach allows it to nonchalantly devour even rotted\nmatter. It pays frequent visits to villages, seeking out food\nscraps intended for compost.','black','#091112','humanoid',50,50,NULL,'slow',1,0,0,'2023-11-22 07:32:27','2023-11-22 07:32:27'),(574,'riolu','Though infantile in appearance, it has the mysterious ability to\nread the minds of humans. The pure of heart are met with\nRiolu\'s approval, while those of ill nature earn only its loathing.','blue','#080d11','upright',50,75,NULL,'medium-slow',1,0,0,'2023-11-22 07:32:28','2023-11-22 07:32:28'),(575,'lucario','A most gallant-looking creature. It emits energy waves and\ncontrols them with precision, using them to sense even faraway\nbeings. I have given the name ”aura” to this power.','blue','#10171b','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:32:29','2023-11-22 07:32:29'),(576,'lucario-mega','A most gallant-looking creature. It emits energy waves and\ncontrols them with precision, using them to sense even faraway\nbeings. I have given the name ”aura” to this power.','blue','#10171b','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:32:29','2023-11-22 07:32:29'),(577,'hippopotas','Though large and languid, Hippopotas is difficult to detect\ndue to its tendency to burrow into and lurk beneath the soil.\nWhen agitated or excited, it expels sand from its nostrils.','brown','#201b0f','quadruped',50,140,NULL,'slow',0,0,0,'2023-11-22 07:32:30','2023-11-22 07:32:30'),(578,'hippowdon','Short-tempered and easily moved to violence. It whips up\nwhirlwinds of sand to crush its foes\' spirits, then goes in for\nthe attack.','brown','#433a2d','quadruped',50,60,NULL,'slow',0,0,0,'2023-11-22 07:32:31','2023-11-22 07:32:31'),(579,'skorupi','Its claws are not only razor-sharp but poisonous, making Skorupi\na highly dangerous Pokémon. It seems to be weakened by cold\ntemperatures, however.','purple','#12131b','armor',50,120,NULL,'slow',0,0,0,'2023-11-22 07:32:32','2023-11-22 07:32:32'),(580,'drapion','Has a brutish, ferocious temperament. With immense strength\nand a sturdy shell off which swords will bounce, it rampages\nabout and wreaks havoc.','purple','#2f2234','armor',50,45,NULL,'slow',0,0,0,'2023-11-22 07:32:32','2023-11-22 07:32:32'),(581,'croagunk','A poison wielder with a dastardly personality. Despite such\nqualities, this species is afforded a measure of popularity due\nto its peculiar cry and comical features.','blue','#0d0d12','humanoid',100,140,NULL,'medium',0,0,0,'2023-11-22 07:32:33','2023-11-22 07:32:33'),(582,'toxicroak','Its crimson claws contain a virulent toxin. This toxin can be made\ninto a tonic by diluting it, mixing it with several types of wild\ngrass, and boiling it down over two days.','blue','#181420','humanoid',50,75,NULL,'medium',0,0,0,'2023-11-22 07:32:34','2023-11-22 07:32:34'),(583,'carnivine','Though this is a plant Pokémon, it has a gluttonous and unruly\ntemperament. Carnivine attacks its prey with its cavernous maw\nwide open.','green','#202114','tentacles',70,200,NULL,'slow',0,0,0,'2023-11-22 07:32:34','2023-11-22 07:32:34'),(584,'finneon','What a gorgeous sight this Pokémon is as it swims with its long,\npink-painted caudal fins fluttering behind it. Finneon\'s beautiful\nappearance has led to its nickname: ”finery fish.”','blue','#0b0c0f','fish',70,190,NULL,'slow-then-very-fast',0,0,0,'2023-11-22 07:32:35','2023-11-22 07:32:35'),(585,'lumineon','Uses its gleaming fins to hunt its prey. The view of Lumineon\nschooling near the surface of the sea at night is breathtaking—\nit\'s as though there were shining stars right there.','blue','#141b1f','fish',70,75,NULL,'slow-then-very-fast',0,0,0,'2023-11-22 07:32:35','2023-11-22 07:32:35'),(586,'mantyke','Though ball-like in shape, this Pokémon is a proficient swimmer.\nI have discovered that if a Mantyke spends much time with\nschools of Remoraid, it will eventually achieve evolution.','blue','#0e1825','wings',50,25,NULL,'slow',1,0,0,'2023-11-22 07:32:36','2023-11-22 07:32:36'),(587,'snover','One is likely to encounter this Pokémon while out in the snow.\nThere are stories of Snover appearing in human settlements but\ndoing no harm—rather, they bond with the children.','white','#222525','upright',50,120,NULL,'slow',0,0,0,'2023-11-22 07:32:37','2023-11-22 07:32:37'),(588,'abomasnow','A powerful Pokémon that can split huge boulders with ease.\nDislikes associating with others and chooses to live quietly deep\nwithin the mountains, playing with the snow.','white','#3d484a','upright',50,60,NULL,'slow',0,0,0,'2023-11-22 07:32:38','2023-11-22 07:32:38'),(589,'abomasnow-mega','A powerful Pokémon that can split huge boulders with ease.\nDislikes associating with others and chooses to live quietly deep\nwithin the mountains, playing with the snow.','white','#3d484a','upright',50,60,NULL,'slow',0,0,0,'2023-11-22 07:32:38','2023-11-22 07:32:38'),(590,'weavile','This species corners prey as a pack, under the guidance of\na leader. Weavile displays increased cunning, leading me to\nspeculate that its evolution caused further brain development.','black','#251621','upright',35,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:32:38','2023-11-22 07:32:38'),(591,'magnezone','I theorize that a special magnetic field influenced this Pokémon,\nchanging its molecular structure and causing it to evolve. It emits\nstrange radio waves toward space from its antenna.','gray','#202126','arms',50,30,NULL,'medium',0,0,0,'2023-11-22 07:32:39','2023-11-22 07:32:39'),(592,'lickilicky','Its tongue can extend and contract freely, and it is capable of\nreaching lengths over 10 times Lickilicky\'s height. Beware of the\nsaliva, as it contains corrosive elements.','pink','#3d2226','humanoid',50,30,NULL,'medium',0,0,0,'2023-11-22 07:32:39','2023-11-22 07:32:39'),(593,'rhyperior','This Pokémon evolved through use of a curious item. Its rocklike\nhide is composed of a mysterious substance and can withstand a\nblow from a masterwork sword with nary a scratch.','gray','#382929','upright',50,30,NULL,'slow',0,0,0,'2023-11-22 07:32:40','2023-11-22 07:32:40'),(594,'tangrowth','Draped with long vines, it resembles a shrub in appearance.\nIt swings bundles of vines as though they were arms, wrapping\nthem around prey to ensnare them.','blue','#182334','humanoid',50,30,NULL,'medium',0,0,0,'2023-11-22 07:32:40','2023-11-22 07:32:40'),(595,'electivire','Its evolution was induced by an unusual item, and its electrical\noutput rises along with its heart rate. From its tails, it can\nunleash an electric current measuring 20,000 volts.','yellow','#3b3215','upright',50,30,NULL,'medium',0,0,0,'2023-11-22 07:32:41','2023-11-22 07:32:41'),(596,'magmortar','Use of a strange item caused this Pokémon to evolve. Fireballs\nlaunched from the ends of its tubelike arms are hot enough to\nmelt an iron pot in an instant.','red','#4d281b','upright',50,30,NULL,'medium',0,0,0,'2023-11-22 07:32:42','2023-11-22 07:32:42'),(597,'togekiss','Scant few have ever sighted this Pokémon. After studying what\nliterature remains, I am certain Togekiss will reveal itself when\npeace reigns in the land.','white','#2a2b30','wings',50,30,NULL,'fast',0,0,0,'2023-11-22 07:32:42','2023-11-22 07:32:42'),(598,'yanmega','Extremely violent. When hunting, it wastes none of its energy,\naiming only for prey\'s most vulnerable spots. Any who manage\nto tame this Pokémon must be of incredible bravery.','green','#2f231e','bug-wings',70,30,NULL,'medium',0,0,0,'2023-11-22 07:32:42','2023-11-22 07:32:42'),(599,'leafeon','Cells similar to those of plants have been found in its fur.\nIts hard tail can fell a large tree with one stroke, and the tail\'s\nsharpness exceeds even that of a sword crafted by a master.','green','#161b15','quadruped',35,45,NULL,'medium',0,0,0,'2023-11-22 07:32:43','2023-11-22 07:32:43'),(600,'glaceon','Glaceon is able to lower its body temperature very quickly.\nIt freezes the atmosphere, creating diamond dust that glitters\nlike gems while it flutters and dances around.','blue','#131a1f','quadruped',35,45,NULL,'medium',0,0,0,'2023-11-22 07:32:43','2023-11-22 07:32:43'),(601,'gliscor','It glides soundlessly on pitch-black wings and sinks sharp fangs\ninto the throat of its prey. It takes on a look of satisfaction once\nit has entirely drained its prey of blood.','purple','#252337','wings',70,30,NULL,'medium-slow',0,0,0,'2023-11-22 07:32:44','2023-11-22 07:32:44'),(602,'mamoswine','This species reached its zenith during the period known as the\nice age. I suspect that Hisui\'s frigid climate is in harmony with\nMamoswine\'s constitution, thus awakening hidden potential.','brown','#473e3b','quadruped',50,50,NULL,'slow',0,0,0,'2023-11-22 07:32:44','2023-11-22 07:32:44'),(603,'porygon-z','A curious item induced this evolution. The Pokémon\'s offensive\ncapabilities have greatly increased, but the strangeness of its\nbehavior has magnified in equal measure. This worries me.','red','#0e0e12','arms',50,30,NULL,'medium',0,0,0,'2023-11-22 07:32:45','2023-11-22 07:32:45'),(604,'gallade','The blades extending from its elbows are sharper than the\nfinest swords. Its swordsmanship, albeit self-taught, is\nastonishingly impressive.','white','#1b211f','humanoid',35,45,NULL,'slow',0,0,0,'2023-11-22 07:32:46','2023-11-22 07:32:46'),(605,'gallade-mega','The blades extending from its elbows are sharper than the\nfinest swords. Its swordsmanship, albeit self-taught, is\nastonishingly impressive.','white','#1b211f','humanoid',35,45,NULL,'slow',0,0,0,'2023-11-22 07:32:46','2023-11-22 07:32:46'),(606,'probopass','It is able to emit powerful magnetism, allowing it control over\nthe iron sand that forms its luscious mustache. Using this iron\nsand, Probopass forms hard stones with which it smites its prey.','gray','#281c26','heads',70,60,NULL,'medium',0,0,0,'2023-11-22 07:32:46','2023-11-22 07:32:46'),(607,'dusknoir','Comes to those whose lives have come to an end and escorts\ntheir souls to the afterlife. Known to mistakenly take the souls of\nthose who yet have life left in them, albeit rarely.','black','#231e19','arms',35,45,NULL,'fast',0,0,0,'2023-11-22 07:32:47','2023-11-22 07:32:47'),(608,'froslass','A Pokémon inhabited by the soul of a woman who died bearing\na grudge in the snowy mountains. Legends of Froslass placing\ndeathly curses on misbehaving men send shivers down my spine.','white','#1b1a1e','arms',50,75,NULL,'medium',0,0,0,'2023-11-22 07:32:47','2023-11-22 07:32:47'),(609,'rotom','This bizarre Pokémon appears to be a will-o\'-the-wisp powered\nby electricity. Be wary, as Rotom is both smart and mischievous.','red','#122222','ball',50,45,NULL,'medium',0,0,0,'2023-11-22 07:32:48','2023-11-22 07:32:48'),(610,'rotom-heat','This bizarre Pokémon appears to be a will-o\'-the-wisp powered\nby electricity. Be wary, as Rotom is both smart and mischievous.','red','#122222','ball',50,45,NULL,'medium',0,0,0,'2023-11-22 07:32:48','2023-11-22 07:32:48'),(611,'rotom-wash','This bizarre Pokémon appears to be a will-o\'-the-wisp powered\nby electricity. Be wary, as Rotom is both smart and mischievous.','red','#122222','ball',50,45,NULL,'medium',0,0,0,'2023-11-22 07:32:48','2023-11-22 07:32:48'),(612,'rotom-frost','This bizarre Pokémon appears to be a will-o\'-the-wisp powered\nby electricity. Be wary, as Rotom is both smart and mischievous.','red','#122222','ball',50,45,NULL,'medium',0,0,0,'2023-11-22 07:32:48','2023-11-22 07:32:48'),(613,'rotom-fan','This bizarre Pokémon appears to be a will-o\'-the-wisp powered\nby electricity. Be wary, as Rotom is both smart and mischievous.','red','#122222','ball',50,45,NULL,'medium',0,0,0,'2023-11-22 07:32:48','2023-11-22 07:32:48'),(614,'rotom-mow','This bizarre Pokémon appears to be a will-o\'-the-wisp powered\nby electricity. Be wary, as Rotom is both smart and mischievous.','red','#122222','ball',50,45,NULL,'medium',0,0,0,'2023-11-22 07:32:48','2023-11-22 07:32:48'),(615,'uxie','A Pokémon feared but also respected for stealing away the\nmemories of evildoers. I have found records that suggest Uxie\nholds dominion over knowledge.','yellow','#141311','upright',140,3,NULL,'slow',0,1,0,'2023-11-22 07:32:49','2023-11-22 07:32:49'),(616,'mesprit','Known as the Being of Emotion. In legend, this Pokémon was\nfeared, as any who showed disrespect would have their\nemotions thrown into disarray.','pink','#1d161c','upright',140,3,NULL,'slow',0,1,0,'2023-11-22 07:32:49','2023-11-22 07:32:49'),(617,'azelf','The dreaded Being of Willpower. Legends tell of this Pokémon\nmanipulating the will of its adversaries and turning them into\npuppets of its own.','blue','#121419','upright',140,3,NULL,'slow',0,1,0,'2023-11-22 07:32:50','2023-11-22 07:32:50'),(618,'dialga','This Pokémon is revered as a deity in Hisuian legend. The birth\nof Dialga was what caused the vast river of time to begin\nflowing in our world.','white','#344150','quadruped',0,3,NULL,'slow',0,1,0,'2023-11-22 07:32:50','2023-11-22 07:32:50'),(619,'dialga-origin','This Pokémon is revered as a deity in Hisuian legend. The birth\nof Dialga was what caused the vast river of time to begin\nflowing in our world.','white','#344150','quadruped',0,3,NULL,'slow',0,1,0,'2023-11-22 07:32:50','2023-11-22 07:32:50'),(620,'palkia','This Pokémon is feared as a deity in Hisuian legend. The birth\nof Palkia was what caused the walls of our world to disappear,\ncreating a sky that spans for infinity.','purple','#504955','upright',0,3,NULL,'slow',0,1,0,'2023-11-22 07:32:51','2023-11-22 07:32:51'),(621,'palkia-origin','This Pokémon is feared as a deity in Hisuian legend. The birth\nof Palkia was what caused the walls of our world to disappear,\ncreating a sky that spans for infinity.','purple','#504955','upright',0,3,NULL,'slow',0,1,0,'2023-11-22 07:32:51','2023-11-22 07:32:51'),(622,'heatran','Stories tell of this Pokémon being birthed from the boiling\nmagma within Mount Coronet. Its molten-steel body holds\nmany mysteries.','brown','#2f2725','quadruped',100,3,NULL,'slow',0,1,0,'2023-11-22 07:32:51','2023-11-22 07:32:51'),(623,'regigigas','According to legend, Regigigas pulled landmasses together and\nbound them with rope to create the continent of Hisui. Though I\nhave my doubts, the story could well contain a shred of truth.','white','#424537','humanoid',0,3,NULL,'slow',0,1,0,'2023-11-22 07:32:52','2023-11-22 07:32:52'),(624,'giratina-altered','There is one Hisuian verse that tells of a powerful light creating\na deep shadow. I imagine that this deep shadow is Giratina.','black','#4c3f2d','tentacles',0,3,NULL,'slow',0,1,0,'2023-11-22 07:32:53','2023-11-22 07:32:53'),(625,'giratina-origin','There is one Hisuian verse that tells of a powerful light creating\na deep shadow. I imagine that this deep shadow is Giratina.','black','#4c3f2d','tentacles',0,3,NULL,'slow',0,1,0,'2023-11-22 07:32:53','2023-11-22 07:32:53'),(626,'cresselia','Cresselia is reminiscent of the crescent moon. It leaves a brilliant\nline of light in its wake as it flies across the night sky. I daresay\nit resembles the heavenly maiden who created the Milky Way.','yellow','#36272f','squiggle',100,3,NULL,'slow',0,1,0,'2023-11-22 07:32:53','2023-11-22 07:32:53'),(627,'phione','Can be seen floating offshore during seasons when the seas are\nwarm. Its azure body blends in with the ocean waters—logic\nsuggests this is a defense mechanism against natural predators.','blue','#0a161e','arms',70,30,NULL,'slow',0,0,1,'2023-11-22 07:32:54','2023-11-22 07:32:54'),(628,'manaphy','Rumored to migrate across the oceans and visit Hisui\'s coastal\nwaters only rarely. Although Manaphy resembles Phione, it is\nalso quite different. The relation between the two is unclear.','blue','#0b161c','humanoid',70,3,NULL,'slow',0,0,1,'2023-11-22 07:32:55','2023-11-22 07:32:55'),(629,'darkrai','On a moonless night, a strange incident occurred in which every\none of a village\'s inhabitants suffered nightmares. The villagers\nattested that Darkrai appeared before them in these nightmares.','black','#1b1819','humanoid',0,3,NULL,'slow',0,0,1,'2023-11-22 07:32:55','2023-11-22 07:32:55'),(630,'shaymin-land','When the turning of seasons brings the cruel winter to its end\nand the joyous people give thanks to the heavens, Shaymin\nappears and covers the withered land with flowers.','green','#10120c','quadruped',100,45,NULL,'medium-slow',0,0,1,'2023-11-22 07:32:56','2023-11-22 07:32:56'),(631,'shaymin-sky','When the turning of seasons brings the cruel winter to its end\nand the joyous people give thanks to the heavens, Shaymin\nappears and covers the withered land with flowers.','green','#10120c','quadruped',100,45,NULL,'medium-slow',0,0,1,'2023-11-22 07:32:56','2023-11-22 07:32:56'),(632,'arceus','It is the heavenly fount from which pours the light that shines\nacross Hisui. Its luminance guides and protects all Pokémon.\nHisuian mythology states that Arceus is the creator of all things.','white','#3e3d2f','quadruped',0,3,NULL,'slow',0,0,1,'2023-11-22 07:32:57','2023-11-22 07:32:57'),(633,'victini','When it shares the infinite energy it creates,\nthat being’s entire body will be overflowing\nwith power.','yellow','#1b130b','humanoid',100,3,NULL,'slow',0,0,1,'2023-11-22 07:32:57','2023-11-22 07:32:57'),(634,'snivy','They photosynthesize by bathing their tails in\nsunlight. When they are not feeling well, their\ntails droop.','green','#091205','upright',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:32:58','2023-11-22 07:32:58'),(635,'servine','When it gets dirty, its leaves can’t be used in\nphotosynthesis, so it always keeps itself clean.','green','#121b0e','upright',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:32:58','2023-11-22 07:32:58'),(636,'serperior','It can stop its opponents’ movements with just a\nglare. It takes in solar energy and boosts\nit internally.','green','#213c24','squiggle',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:32:59','2023-11-22 07:32:59'),(637,'tepig','It loves to eat roasted berries, but sometimes it\ngets too excited and burns them to a crisp.','red','#0f0905','quadruped',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:00','2023-11-22 07:33:00'),(638,'pignite','When its internal fire flares up, its movements grow\nsharper and faster. When in trouble, it emits smoke.','red','#20130b','upright',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:00','2023-11-22 07:33:00'),(639,'emboar','It has mastered fast and powerful fighting moves.\nIt grows a beard of fire.','red','#392214','upright',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:01','2023-11-22 07:33:01'),(640,'oshawott','This Pokémon from the Unova region uses the shell on its belly\nas a weapon to cut down its foes. Thus, I\'ve conferred upon this\nshell the name ”scalchop”.','blue','#0f1112','upright',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:01','2023-11-22 07:33:01'),(641,'dewott','Its exquisite double-scalchop technique is likely the result of\ndaily training, and it can send even masters of the blade fleeing\nin defeat.','blue','#0b1111','upright',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:02','2023-11-22 07:33:02'),(642,'samurott','Hard of heart and deft of blade, this rare form of Samurott is\na product of the Pokémon\'s evolution in the region of Hisui. Its\nturbulent blows crash into foes like ceaseless pounding waves.','blue','#2e3232','quadruped',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:03','2023-11-22 07:33:03'),(643,'samurott-hisui','Hard of heart and deft of blade, this rare form of Samurott is\na product of the Pokémon\'s evolution in the region of Hisui. Its\nturbulent blows crash into foes like ceaseless pounding waves.','blue','#2e3232','quadruped',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:03','2023-11-22 07:33:03'),(644,'patrat','Extremely cautious, one of them will always be on\nthe lookout, but it won’t notice a foe coming\nfrom behind.','brown','#16110d','quadruped',70,255,NULL,'medium',0,0,0,'2023-11-22 07:33:03','2023-11-22 07:33:03'),(645,'watchog','When they see an enemy, their tails stand high,\nand they spit the seeds of berries stored in their\ncheek pouches.','brown','#1e1512','upright',70,255,NULL,'medium',0,0,0,'2023-11-22 07:33:04','2023-11-22 07:33:04'),(646,'lillipup','This Pokémon is far brighter than the average\nchild, and Lillipup won’t forget the love it\nreceives or any abuse it suffers.','brown','#18120c','quadruped',50,255,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:04','2023-11-22 07:33:04'),(647,'herdier','The black fur that covers this Pokémon’s body\nis dense and springy. Even sharp fangs bounce\nright off.','gray','#181310','quadruped',50,120,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:05','2023-11-22 07:33:05'),(648,'stoutland','Stoutland is immensely proud of its impressive\nmoustache. It’s said that moustache length is what\ndetermines social standing among this species.','gray','#3d362c','quadruped',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:05','2023-11-22 07:33:05'),(649,'purrloin','Opponents that get drawn in by its adorable\nbehavior come away with stinging scratches from\nits claws and stinging pride from its laughter.','purple','#140f12','quadruped',50,255,NULL,'medium',0,0,0,'2023-11-22 07:33:06','2023-11-22 07:33:06'),(650,'liepard','This stealthy Pokémon sneaks up behind prey\nwithout making any sound at all. It competes with\nThievul for territory.','purple','#241c1a','quadruped',50,90,NULL,'medium',0,0,0,'2023-11-22 07:33:06','2023-11-22 07:33:06'),(651,'pansage','It’s good at finding berries and gathers them from\nall over. It’s kind enough to share them\nwith friends.','green','#0b140b','upright',70,190,NULL,'medium',0,0,0,'2023-11-22 07:33:07','2023-11-22 07:33:07'),(652,'simisage','Ill tempered, it fights by swinging its barbed tail\naround wildly. The leaf growing on its head is\nvery bitter.','green','#152616','upright',70,75,NULL,'medium',0,0,0,'2023-11-22 07:33:07','2023-11-22 07:33:07'),(653,'pansear','This Pokémon lives in caves in volcanoes.\nThe fire within the tuft on its head can reach\n600 degrees Fahrenheit.','red','#1e0f0b','upright',70,190,NULL,'medium',0,0,0,'2023-11-22 07:33:07','2023-11-22 07:33:07'),(654,'simisear','When it gets excited, embers rise from its head\nand tail and it gets hot. For some reason, it\nloves sweets.','red','#371b14','upright',70,75,NULL,'medium',0,0,0,'2023-11-22 07:33:08','2023-11-22 07:33:08'),(655,'panpour','The water stored inside the tuft on its head is full of\nnutrients. Plants that receive its water grow large.','blue','#111a1a','upright',70,190,NULL,'medium',0,0,0,'2023-11-22 07:33:08','2023-11-22 07:33:08'),(656,'simipour','It prefers places with clean water. When its tuft runs\nlow, it replenishes it by siphoning up water with\nits tail.','blue','#172525','upright',70,75,NULL,'medium',0,0,0,'2023-11-22 07:33:08','2023-11-22 07:33:08'),(657,'munna','It eats dreams and releases mist. The mist is pink\nwhen it’s eating a good dream, and black when\nit’s eating a nightmare.','pink','#181215','quadruped',50,190,NULL,'fast',0,0,0,'2023-11-22 07:33:09','2023-11-22 07:33:09'),(658,'musharna','It drowses and dreams all the time. It’s best to\nleave it be if it’s just woken up, as it’s a terrible\ngrump when freshly roused from sleep.','pink','#412a3b','humanoid',50,75,NULL,'fast',0,0,0,'2023-11-22 07:33:10','2023-11-22 07:33:10'),(659,'pidove','It’s forgetful and not very bright, but many\nTrainers love it anyway for its friendliness\nand sincerity.','gray','#0d0c0c','wings',50,255,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:11','2023-11-22 07:33:11'),(660,'tranquill','These bright Pokémon have acute memories.\nApparently delivery workers often choose them\nas their partners.','gray','#131111','wings',50,120,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:11','2023-11-22 07:33:11'),(661,'unfezant','This Pokémon is intelligent and intensely proud.\nPeople will sit up and take notice if you become\nthe Trainer of one.','gray','#1f1318','wings',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:12','2023-11-22 07:33:12'),(662,'blitzle','Its mane shines when it discharges electricity.\nThey use the frequency and rhythm of these flashes\nto communicate.','black','#161616','quadruped',70,190,NULL,'medium',0,0,0,'2023-11-22 07:33:12','2023-11-22 07:33:12'),(663,'zebstrika','They have lightning-like movements.\nWhen Zebstrika run at full speed, the sound of\nthunder reverberates.','black','#1e2020','quadruped',70,75,NULL,'medium',0,0,0,'2023-11-22 07:33:12','2023-11-22 07:33:12'),(664,'roggenrola','When it detects a noise, it starts to move.\nThe energy core inside it makes this Pokémon\nslightly warm to the touch.','blue','#050405','legs',50,255,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:13','2023-11-22 07:33:13'),(665,'boldore','It relies on sound in order to monitor what’s in its\nvicinity. When angered, it will attack without ever\nchanging the direction it’s facing.','blue','#140e12','tentacles',50,120,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:13','2023-11-22 07:33:13'),(666,'gigalith','Although its energy blasts can blow away\na dump truck, they have a limitation—\nthey can only be fired when the sun is out.','blue','#2c151c','tentacles',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:14','2023-11-22 07:33:14'),(667,'woobat','It emits ultrasonic waves as it flutters about,\nsearching for its prey—bug Pokémon.','blue','#0d1012','wings',50,190,NULL,'medium',0,0,0,'2023-11-22 07:33:14','2023-11-22 07:33:14'),(668,'swoobat','The auspicious shape of this Pokémon’s nose\napparently led some regions to consider\nSwoobat a symbol of good luck.','blue','#1d2023','wings',50,45,NULL,'medium',0,0,0,'2023-11-22 07:33:15','2023-11-22 07:33:15'),(669,'drilbur','It’s a digger, using its claws to burrow through the\nground. It causes damage to vegetable crops, so\nmany farmers have little love for it.','gray','#181819','upright',50,120,NULL,'medium',0,0,0,'2023-11-22 07:33:15','2023-11-22 07:33:15'),(670,'excadrill','Known as the Drill King, this Pokémon can\ntunnel through the terrain at speeds of over\n90 mph.','gray','#2a2322','humanoid',50,60,NULL,'medium',0,0,0,'2023-11-22 07:33:16','2023-11-22 07:33:16'),(671,'audino','This Pokémon has a kind heart. By touching with\nits feelers, Audino can gauge other creatures’\nfeelings and physical conditions.','pink','#2b221e','upright',50,255,NULL,'fast',0,0,0,'2023-11-22 07:33:16','2023-11-22 07:33:16'),(672,'audino-mega','This Pokémon has a kind heart. By touching with\nits feelers, Audino can gauge other creatures’\nfeelings and physical conditions.','pink','#2b221e','upright',50,255,NULL,'fast',0,0,0,'2023-11-22 07:33:16','2023-11-22 07:33:16'),(673,'timburr','Timburr that have started carrying logs that are\nabout three times their size are nearly ready\nto evolve.','gray','#191410','humanoid',70,180,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:16','2023-11-22 07:33:16'),(674,'gurdurr','Gurdurr excels at demolition—construction is not\nits forte. In any case, there’s skill in the way this\nPokémon wields its metal beam.','gray','#2a1a1e','humanoid',50,90,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:17','2023-11-22 07:33:17'),(675,'conkeldurr','When going all out, this Pokémon throws aside\nits concrete pillars and leaps at opponents to\npummel them with its fists.','brown','#392f2b','humanoid',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:18','2023-11-22 07:33:18'),(676,'tympole','It uses sound waves to communicate with\nothers of its kind. People and other Pokémon\nspecies can’t hear its cries of warning.','blue','#0a0c0d','fish',50,255,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:19','2023-11-22 07:33:19'),(677,'palpitoad','On occasion, their cries are sublimely pleasing to\nthe ear. Palpitoad with larger lumps on their\nbodies can sing with a wider range of sounds.','blue','#111718','upright',50,120,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:19','2023-11-22 07:33:19'),(678,'seismitoad','This Pokémon is popular among the elderly,\nwho say the vibrations of its lumps are great\nfor massages.','blue','#122c35','humanoid',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:20','2023-11-22 07:33:20'),(679,'throh','They train in groups of five. Any member that\ncan’t keep up will discard its belt and leave\nthe group.','red','#281e1c','humanoid',50,45,NULL,'medium',0,0,0,'2023-11-22 07:33:21','2023-11-22 07:33:21'),(680,'sawk','The karate chops of a Sawk that’s trained itself\nto the limit can cleave the ocean itself.','blue','#162126','humanoid',50,45,NULL,'medium',0,0,0,'2023-11-22 07:33:22','2023-11-22 07:33:22'),(681,'sewaddle','Since this Pokémon makes its own clothes out of\nleaves, it is a popular mascot for fashion designers.','yellow','#0e0f03','armor',70,255,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:22','2023-11-22 07:33:22'),(682,'swadloon','It protects itself from the cold by wrapping up in\nleaves. It stays on the move, eating leaves\nin forests.','green','#0f1806','arms',70,120,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:23','2023-11-22 07:33:23'),(683,'leavanny','It keeps its eggs warm with heat from fermenting\nleaves. It also uses leaves to make warm wrappings\nfor Sewaddle.','yellow','#141c06','humanoid',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:23','2023-11-22 07:33:23'),(684,'venipede','Its fangs are highly venomous. If this Pokémon\nfinds prey it thinks it can eat, it leaps for them\nwithout any thought of how things might turn out.','red','#100709','armor',50,255,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:24','2023-11-22 07:33:24'),(685,'whirlipede','Whirlipede protects itself with a sturdy shell and\npoisonous spikes while it stores up the energy it’ll\nneed for evolution.','gray','#161218','ball',50,120,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:24','2023-11-22 07:33:24'),(686,'scolipede','Scolipede engage in fierce territorial battles with\nCentiskorch. At the end of one of these battles,\nthe victor makes a meal of the loser.','red','#2c0c1b','armor',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:24','2023-11-22 07:33:24'),(687,'cottonee','Weaving together the cotton of both Cottonee\nand Eldegoss produces exquisite cloth that’s\nhighly prized by many luxury brands.','green','#121612','ball',50,190,NULL,'medium',0,0,0,'2023-11-22 07:33:25','2023-11-22 07:33:25'),(688,'whimsicott','As long as this Pokémon bathes in sunlight, its\ncotton keeps growing. If too much cotton fluff\nbuilds up, Whimsicott tears it off and scatters it.','green','#343128','humanoid',50,75,NULL,'medium',0,0,0,'2023-11-22 07:33:25','2023-11-22 07:33:25'),(689,'petilil','The leaves on its head are highly valued for medicinal purposes.\nDry the leaves in the sun, boil them, and then drink the bitter\ndecoction for remarkably effective relief from fatigue.','green','#0e130a','blob',50,190,NULL,'medium',0,0,0,'2023-11-22 07:33:26','2023-11-22 07:33:26'),(690,'lilligant','I suspect that its well-developed legs are the result of a life\nspent on mountains covered in deep snow. The scent it exudes\nfrom its flower crown heartens those in proximity.','green','#272d17','blob',50,75,NULL,'medium',0,0,0,'2023-11-22 07:33:26','2023-11-22 07:33:26'),(691,'lilligant-hisui','I suspect that its well-developed legs are the result of a life\nspent on mountains covered in deep snow. The scent it exudes\nfrom its flower crown heartens those in proximity.','green','#272d17','blob',50,75,NULL,'medium',0,0,0,'2023-11-22 07:33:26','2023-11-22 07:33:26'),(692,'basculin-red-striped','Though it differs from other Basculin in several respects,\nincluding demeanor—this one is gentle—I have categorized\nit as a regional form given the vast array of shared qualities.','green','#0f120f','fish',50,25,NULL,'medium',0,0,0,'2023-11-22 07:33:27','2023-11-22 07:33:27'),(693,'basculin-blue-striped','Though it differs from other Basculin in several respects,\nincluding demeanor—this one is gentle—I have categorized\nit as a regional form given the vast array of shared qualities.','green','#0f120f','fish',50,25,NULL,'medium',0,0,0,'2023-11-22 07:33:27','2023-11-22 07:33:27'),(694,'basculin-white-striped','Though it differs from other Basculin in several respects,\nincluding demeanor—this one is gentle—I have categorized\nit as a regional form given the vast array of shared qualities.','green','#0f120f','fish',50,25,NULL,'medium',0,0,0,'2023-11-22 07:33:27','2023-11-22 07:33:27'),(695,'sandile','Sandile is small, but its legs and lower body are\npowerful. Pushing sand aside as it goes, Sandile\nmoves through the desert as if it’s swimming.','brown','#0c0a06','quadruped',50,180,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:27','2023-11-22 07:33:27'),(696,'krokorok','Although this Pokémon has specialized eyes that\nallow it to see in the dark, Krokorok won’t move\nmuch at night—the desert gets cold after sunset.','brown','#1b1510','quadruped',50,90,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:28','2023-11-22 07:33:28'),(697,'krookodile','While terribly aggressive, Krookodile also has\nthe patience to stay hidden under sand for days,\nlying in wait for prey.','red','#322023','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:29','2023-11-22 07:33:29'),(698,'darumaka','This popular symbol of good fortune will never\nfall over in its sleep, no matter how it’s pushed\nor pulled.','red','#140905','humanoid',50,120,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:29','2023-11-22 07:33:29'),(699,'darumaka-galar','This popular symbol of good fortune will never\nfall over in its sleep, no matter how it’s pushed\nor pulled.','red','#140905','humanoid',50,120,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:29','2023-11-22 07:33:29'),(700,'darmanitan-standard','This Pokémon’s power level rises along with the\ntemperature of its fire, which can reach 2,500\ndegrees Fahrenheit.','red','#2d100b','quadruped',50,60,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:30','2023-11-22 07:33:30'),(701,'darmanitan-zen','This Pokémon’s power level rises along with the\ntemperature of its fire, which can reach 2,500\ndegrees Fahrenheit.','red','#2d100b','quadruped',50,60,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:30','2023-11-22 07:33:30'),(702,'darmanitan-galar-standard','This Pokémon’s power level rises along with the\ntemperature of its fire, which can reach 2,500\ndegrees Fahrenheit.','red','#2d100b','quadruped',50,60,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:30','2023-11-22 07:33:30'),(703,'darmanitan-galar-zen','This Pokémon’s power level rises along with the\ntemperature of its fire, which can reach 2,500\ndegrees Fahrenheit.','red','#2d100b','quadruped',50,60,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:30','2023-11-22 07:33:30'),(704,'maractus','Once each year, this Pokémon scatters its seeds.\nThey’re jam-packed with nutrients, making them\na precious food source out in the desert.','green','#1b2418','blob',50,255,NULL,'medium',0,0,0,'2023-11-22 07:33:30','2023-11-22 07:33:30'),(705,'dwebble','It first tries to find a rock to live in, but if there\nare no suitable rocks to be found, Dwebble may\nmove in to the ports of a Hippowdon.','red','#130f0c','armor',50,190,NULL,'medium',0,0,0,'2023-11-22 07:33:31','2023-11-22 07:33:31'),(706,'crustle','Its thick claws are its greatest weapons.\nThey’re mighty enough to crack\nRhyperior’s carapace.','red','#3f3122','armor',50,75,NULL,'medium',0,0,0,'2023-11-22 07:33:31','2023-11-22 07:33:31'),(707,'scraggy','It protects itself with its durable skin. It’s thought\nthat this Pokémon will evolve once its skin has\ncompletely stretched out.','yellow','#141107','upright',35,180,NULL,'medium',0,0,0,'2023-11-22 07:33:33','2023-11-22 07:33:33'),(708,'scrafty','While mostly known for having the temperament\nof an aggressive ruffian, this Pokémon takes very\ngood care of its family, friends, and territory.','red','#24170a','upright',50,90,NULL,'medium',0,0,0,'2023-11-22 07:33:34','2023-11-22 07:33:34'),(709,'sigilyph','A discovery was made in the desert where\nSigilyph fly. The ruins of what may have been\nan ancient city were found beneath the sands.','black','#2d2c1f','wings',50,45,NULL,'medium',0,0,0,'2023-11-22 07:33:34','2023-11-22 07:33:34'),(710,'yamask','The spirit of a person from a bygone age became\nthis Pokémon. It rambles through ruins, searching\nfor someone who knows its face.','black','#0b0907','arms',50,190,NULL,'medium',0,0,0,'2023-11-22 07:33:34','2023-11-22 07:33:34'),(711,'yamask-galar','The spirit of a person from a bygone age became\nthis Pokémon. It rambles through ruins, searching\nfor someone who knows its face.','black','#0b0907','arms',50,190,NULL,'medium',0,0,0,'2023-11-22 07:33:34','2023-11-22 07:33:34'),(712,'cofagrigus','There are many depictions of Cofagrigus\ndecorating ancient tombs. They’re symbols\nof the wealth that kings of bygone eras had.','yellow','#2f2e29','blob',50,90,NULL,'medium',0,0,0,'2023-11-22 07:33:35','2023-11-22 07:33:35'),(713,'tirtouga','Tirtouga is considered to be the ancestor of\nmany turtle Pokémon. It was restored to life\nfrom a fossil.','blue','#0c1218','quadruped',50,45,NULL,'medium',0,0,0,'2023-11-22 07:33:36','2023-11-22 07:33:36'),(714,'carracosta','This Pokémon emerges from the water in search\nof prey despite the fact that it moves more\nslowly on land.','blue','#152029','upright',50,45,NULL,'medium',0,0,0,'2023-11-22 07:33:37','2023-11-22 07:33:37'),(715,'archen','Archen is said to be the ancestor of bird\nPokémon. It lived in treetops, eating berries\nand bug Pokémon.','yellow','#141113','wings',50,45,NULL,'medium',0,0,0,'2023-11-22 07:33:37','2023-11-22 07:33:37'),(716,'archeops','Though capable of flight, Archeops was\napparently better at hunting on the ground.','yellow','#222830','wings',50,45,NULL,'medium',0,0,0,'2023-11-22 07:33:38','2023-11-22 07:33:38'),(717,'trubbish','This Pokémon was born from a bag stuffed with\ntrash. Galarian Weezing relish the fumes belched\nby Trubbish.','green','#070c09','humanoid',50,190,NULL,'medium',0,0,0,'2023-11-22 07:33:38','2023-11-22 07:33:38'),(718,'garbodor','The toxic liquid it launches from its right arm\nis so virulent that it can kill a weakened\ncreature instantly.','green','#2f302a','humanoid',50,60,NULL,'medium',0,0,0,'2023-11-22 07:33:39','2023-11-22 07:33:39'),(719,'garbodor-gmax','The toxic liquid it launches from its right arm\nis so virulent that it can kill a weakened\ncreature instantly.','green','#2f302a','humanoid',50,60,NULL,'medium',0,0,0,'2023-11-22 07:33:39','2023-11-22 07:33:39'),(720,'zorua','A once-departed soul, returned to life in Hisui. Derives power\nfrom resentment, which rises as energy atop its head and takes\non the forms of foes. In this way, Zorua vents lingering malice.','gray','#0c090c','quadruped',50,75,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:39','2023-11-22 07:33:39'),(721,'zorua-hisui','A once-departed soul, returned to life in Hisui. Derives power\nfrom resentment, which rises as energy atop its head and takes\non the forms of foes. In this way, Zorua vents lingering malice.','gray','#0c090c','quadruped',50,75,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:39','2023-11-22 07:33:39'),(722,'zoroark','With its disheveled white fur, it looks like an embodiment of\ndeath. Heedless of its own safety, Zoroark attacks its nemeses\nwith a bitter energy so intense, it lacerates Zoroark\'s own body.','gray','#190f15','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:40','2023-11-22 07:33:40'),(723,'zoroark-hisui','With its disheveled white fur, it looks like an embodiment of\ndeath. Heedless of its own safety, Zoroark attacks its nemeses\nwith a bitter energy so intense, it lacerates Zoroark\'s own body.','gray','#190f15','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:40','2023-11-22 07:33:40'),(724,'minccino','They pet each other with their tails as a form of\ngreeting. Of the two, the one whose tail is fluffier\nis a bit more boastful.','gray','#252320','quadruped',50,255,NULL,'fast',0,0,0,'2023-11-22 07:33:40','2023-11-22 07:33:40'),(725,'cinccino','A special oil that seeps through their fur helps\nthem avoid attacks. The oil fetches a high price\nat market.','gray','#383432','quadruped',50,60,NULL,'fast',0,0,0,'2023-11-22 07:33:41','2023-11-22 07:33:41'),(726,'gothita','Even when nobody seems to be around, Gothita\ncan still be heard making a muted cry. Many believe\nit’s speaking to something only it can see.','purple','#0d0c0d','humanoid',50,200,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:41','2023-11-22 07:33:41'),(727,'gothorita','On nights when the stars shine, this Pokémon’s\npsychic power is at its strongest. It’s unknown just\nwhat link Gothorita has to the greater universe.','purple','#131313','humanoid',50,100,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:42','2023-11-22 07:33:42'),(728,'gothitelle','A criminal who was shown his fate by a Gothitelle\nwent missing that same day and was never\nseen again.','purple','#1b1b1b','humanoid',50,50,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:42','2023-11-22 07:33:42'),(729,'solosis','Many say that the special liquid covering this\nPokémon’s body would allow it to survive in\nthe vacuum of space.','green','#0b110c','ball',50,200,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:43','2023-11-22 07:33:43'),(730,'duosion','Its brain has split into two, and the two\nhalves rarely think alike. Its actions are\nutterly unpredictable.','green','#132218','ball',50,100,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:43','2023-11-22 07:33:43'),(731,'reuniclus','It’s said that drinking the liquid surrounding\nReuniclus grants wisdom. Problem is, the liquid is\nhighly toxic to anything besides Reuniclus itself.','green','#223627','arms',50,50,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:44','2023-11-22 07:33:44'),(732,'ducklett','They are better at swimming than flying, and they\nhappily eat their favorite food, peat moss, as they\ndive underwater.','blue','#0b1012','wings',70,190,NULL,'medium',0,0,0,'2023-11-22 07:33:44','2023-11-22 07:33:44'),(733,'swanna','Swanna start to dance at dusk. The one dancing in\nthe middle is the leader of the flock.','white','#262829','wings',70,45,NULL,'medium',0,0,0,'2023-11-22 07:33:45','2023-11-22 07:33:45'),(734,'vanillite','Supposedly, this Pokémon was born from an\nicicle. It spews out freezing air at −58 degrees\nFahrenheit to make itself more comfortable.','white','#0f1113','blob',50,255,NULL,'slow',0,0,0,'2023-11-22 07:33:45','2023-11-22 07:33:45'),(735,'vanillish','It blasts enemies with cold air reaching −148\ndegrees Fahrenheit, freezing them solid. But it\nspares their lives afterward—it’s a kind Pokémon.','white','#1a1f26','blob',50,120,NULL,'slow',0,0,0,'2023-11-22 07:33:46','2023-11-22 07:33:46'),(736,'vanilluxe','People believe this Pokémon formed when two\nVanillish stuck together. Its body temperature is\nroughly 21 degrees Fahrenheit.','white','#2e343f','heads',50,45,NULL,'slow',0,0,0,'2023-11-22 07:33:46','2023-11-22 07:33:46'),(737,'deerling','The turning of the seasons changes the color and\nscent of this Pokémon’s fur. People use it to mark\nthe seasons.','pink','#17120e','quadruped',70,190,NULL,'medium',0,0,0,'2023-11-22 07:33:47','2023-11-22 07:33:47'),(738,'sawsbuck','They migrate according to the seasons, so some\npeople call Sawsbuck the harbingers of spring.','brown','#160e08','quadruped',70,75,NULL,'medium',0,0,0,'2023-11-22 07:33:47','2023-11-22 07:33:47'),(739,'emolga','This Pokémon absolutely loves sweet berries.\nSometimes it stuffs its cheeks full of so much\nfood that it can’t fly properly.','white','#191710','quadruped',50,200,NULL,'medium',0,0,0,'2023-11-22 07:33:47','2023-11-22 07:33:47'),(740,'karrablast','It spits a liquid from its mouth to melt through\nShelmet’s shell. Karrablast doesn’t eat the shell—\nit eats only the contents.','blue','#090b0d','humanoid',50,200,NULL,'medium',0,0,0,'2023-11-22 07:33:48','2023-11-22 07:33:48'),(741,'escavalier','It charges its enemies, lances at the ready.\nAn image of one of its duels is captured in a famous\npainting of Escavalier clashing with Sirfetch’d.','gray','#341e22','arms',50,75,NULL,'medium',0,0,0,'2023-11-22 07:33:48','2023-11-22 07:33:48'),(742,'foongus','The spores released from this Pokémon’s hands\nare highly poisonous, but when thoroughly dried,\nthe spores can be used as stomach medicine.','white','#0f0c0b','arms',50,190,NULL,'medium',0,0,0,'2023-11-22 07:33:49','2023-11-22 07:33:49'),(743,'amoonguss','Amoonguss generally doesn’t move much. It\ntends to stand still near Poké Balls that have\nbeen dropped on the ground.','white','#281e20','arms',50,75,NULL,'medium',0,0,0,'2023-11-22 07:33:49','2023-11-22 07:33:49'),(744,'frillish','Legend has it that the residents of a sunken\nancient city changed into these Pokémon.','white','#1d2830','tentacles',50,190,NULL,'medium',0,0,0,'2023-11-22 07:33:49','2023-11-22 07:33:49'),(745,'jellicent','Whenever a full moon hangs in the night sky,\nschools of Jellicent gather near the surface of\nthe sea, waiting for their prey to appear.','white','#2e4252','tentacles',50,60,NULL,'medium',0,0,0,'2023-11-22 07:33:50','2023-11-22 07:33:50'),(746,'alomomola','The reason it helps Pokémon in a weakened\ncondition is that any Pokémon coming after\nthem may also attack Alomomola.','pink','#321f22','fish',70,75,NULL,'fast',0,0,0,'2023-11-22 07:33:50','2023-11-22 07:33:50'),(747,'joltik','Joltik latch on to other Pokémon and suck out\nstatic electricity. They’re often found sticking to\nYamper’s hindquarters.','yellow','#161306','armor',50,190,NULL,'medium',0,0,0,'2023-11-22 07:33:51','2023-11-22 07:33:51'),(748,'galvantula','It lays traps of electrified threads near the nests\nof bird Pokémon, aiming to snare chicks that are\nnot yet good at flying.','yellow','#232013','armor',50,75,NULL,'medium',0,0,0,'2023-11-22 07:33:51','2023-11-22 07:33:51'),(749,'ferroseed','Mossy caves are their preferred dwellings.\nEnzymes contained in mosses help Ferroseed’s\nspikes grow big and strong.','gray','#080c09','ball',50,255,NULL,'medium',0,0,0,'2023-11-22 07:33:51','2023-11-22 07:33:51'),(750,'ferrothorn','Its spikes are harder than steel. This Pokémon\ncrawls across rock walls by stabbing the spikes\non its feelers into the stone.','gray','#15211b','tentacles',50,90,NULL,'medium',0,0,0,'2023-11-22 07:33:51','2023-11-22 07:33:51'),(751,'klink','It’s suspected that Klink were the inspiration\nbehind ancient people’s invention of the\nfirst gears.','gray','#121314','heads',50,130,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:52','2023-11-22 07:33:52'),(752,'klang','Many companies in the Galar region choose\nKlang as their logo. This Pokémon is considered\nthe symbol of industrial technology.','gray','#222426','heads',50,60,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:53','2023-11-22 07:33:53'),(753,'klinklang','The three gears that compose this Pokémon\nspin at high speed. Its new spiked gear isn’t\na living creature.','gray','#2c2e31','heads',50,30,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:53','2023-11-22 07:33:53'),(754,'tynamo','One alone can emit only a trickle of electricity,\nso a group of them gathers to unleash a powerful\nelectric shock.','white','#0f1010','fish',70,190,NULL,'slow',0,0,0,'2023-11-22 07:33:53','2023-11-22 07:33:53'),(755,'eelektrik','These Pokémon have a big appetite. When they\nspot their prey, they attack it and paralyze it\nwith electricity.','blue','#1d1b16','fish',70,60,NULL,'slow',0,0,0,'2023-11-22 07:33:54','2023-11-22 07:33:54'),(756,'eelektross','They crawl out of the ocean using their arms.\nThey will attack prey on shore and immediately drag\nit into the ocean.','blue','#272e2a','fish',70,30,NULL,'slow',0,0,0,'2023-11-22 07:33:54','2023-11-22 07:33:54'),(757,'elgyem','This Pokémon was discovered about 50 years\nago. Its highly developed brain enables it to\nexert its psychic powers.','blue','#0d1310','upright',50,255,NULL,'medium',0,0,0,'2023-11-22 07:33:55','2023-11-22 07:33:55'),(758,'beheeyem','Sometimes found drifting above wheat fields,\nthis Pokémon can control the memories of\nits opponents.','brown','#211711','humanoid',50,90,NULL,'medium',0,0,0,'2023-11-22 07:33:55','2023-11-22 07:33:55'),(759,'litwick','The younger the life this Pokémon absorbs,\nthe brighter and eerier the flame on its\nhead burns.','white','#0f0e11','blob',50,190,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:56','2023-11-22 07:33:56'),(760,'lampent','It lurks in cities, pretending to be a lamp.\nOnce it finds someone whose death is near,\nit will trail quietly after them.','black','#0b0b0c','arms',50,90,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:56','2023-11-22 07:33:56'),(761,'chandelure','In homes illuminated by Chandelure instead of\nlights, funerals were a constant occurrence—\nor so it’s said.','black','#171327','arms',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:33:56','2023-11-22 07:33:56'),(762,'axew','They play with each other by knocking their large\ntusks together. Their tusks break sometimes, but\nthey grow back so quickly that it isn’t a concern.','green','#0c0d08','upright',35,75,NULL,'slow',0,0,0,'2023-11-22 07:33:57','2023-11-22 07:33:57'),(763,'fraxure','Its skin is as hard as a suit of armor. Fraxure’s\nfavorite strategy is to tackle its opponents,\nstabbing them with its tusks at the same time.','green','#1b1612','upright',35,60,NULL,'slow',0,0,0,'2023-11-22 07:33:57','2023-11-22 07:33:57'),(764,'haxorus','While usually kindhearted, it can be terrifying if\nangered. Tusks that can slice through steel beams\nare how Haxorus deals with its adversaries.','yellow','#281e0c','upright',35,45,NULL,'slow',0,0,0,'2023-11-22 07:33:58','2023-11-22 07:33:58'),(765,'cubchoo','It sniffles before performing a move, using its\nfrosty snot to provide an icy element to any\nmove that needs it.','white','#0e1113','upright',50,120,NULL,'medium',0,0,0,'2023-11-22 07:33:59','2023-11-22 07:33:59'),(766,'beartic','It swims energetically through frigid seas.\nWhen it gets tired, it freezes the seawater\nwith its breath so it can rest on the ice.','white','#414a4e','quadruped',50,60,NULL,'medium',0,0,0,'2023-11-22 07:33:59','2023-11-22 07:33:59'),(767,'cryogonal','When the weather gets hot, these Pokémon turn\ninto water vapor. Cryogonal are almost never\nseen during summer.','blue','#222a44','ball',50,25,NULL,'medium',0,0,0,'2023-11-22 07:34:00','2023-11-22 07:34:00'),(768,'shelmet','It has a strange physiology that responds to\nelectricity. When together with Karrablast,\nShelmet evolves for some reason.','red','#120f12','ball',50,200,NULL,'medium',0,0,0,'2023-11-22 07:34:00','2023-11-22 07:34:00'),(769,'accelgor','Discarding its shell made it nimble. To keep\nitself from dehydrating, it wraps its body in\nbands of membrane.','red','#1b161f','arms',50,75,NULL,'medium',0,0,0,'2023-11-22 07:34:01','2023-11-22 07:34:01'),(770,'stunfisk','For some reason, this Pokémon smiles slightly\nwhen it emits a strong electric current from the\nyellow markings on its body.','brown','#1e190d','fish',70,75,NULL,'medium',0,0,0,'2023-11-22 07:34:01','2023-11-22 07:34:01'),(771,'stunfisk-galar','For some reason, this Pokémon smiles slightly\nwhen it emits a strong electric current from the\nyellow markings on its body.','brown','#1e190d','fish',70,75,NULL,'medium',0,0,0,'2023-11-22 07:34:01','2023-11-22 07:34:01'),(772,'mienfoo','Though small, Mienfoo’s temperament is fierce.\nAny creature that approaches Mienfoo carelessly\nwill be greeted with a flurry of graceful attacks.','yellow','#1b130e','upright',50,180,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:02','2023-11-22 07:34:02'),(773,'mienshao','Delivered at blinding speeds, kicks from this\nPokémon can shatter massive boulders into\ntiny pieces.','purple','#2a2329','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:02','2023-11-22 07:34:02'),(774,'druddigon','Druddigon are vicious and cunning. They take up\nresidence in nests dug out by other Pokémon,\ntreating the stolen nests as their own lairs.','red','#1c1b2e','upright',50,45,NULL,'medium',0,0,0,'2023-11-22 07:34:02','2023-11-22 07:34:02'),(775,'golett','This Pokémon was created from clay. It received\norders from its master many thousands of years\nago, and it still follows those orders to this day.','green','#182725','humanoid',50,190,NULL,'medium',0,0,0,'2023-11-22 07:34:03','2023-11-22 07:34:03'),(776,'golurk','There’s a theory that inside Golurk is a perpetual\nmotion machine that produces limitless energy,\nbut this belief hasn’t been proven.','green','#304947','humanoid',50,90,NULL,'medium',0,0,0,'2023-11-22 07:34: