rity.','brown','#201a18','wings',35,60,NULL,'slow',0,0,0,'2023-11-22 07:34:07','2023-11-22 07:34:07'),(785,'heatmor','A flame serves as its tongue, melting through the\nhard shell of Durant so that Heatmor can devour\ntheir insides.','red','#2a1a13','upright',50,90,NULL,'medium',0,0,0,'2023-11-22 07:34:07','2023-11-22 07:34:07'),(786,'durant','With their large mandibles, these Pokémon can\ncrunch their way through rock. They work\ntogether to protect their eggs from Sandaconda.','gray','#101011','armor',50,90,NULL,'medium',0,0,0,'2023-11-22 07:34:08','2023-11-22 07:34:08'),(787,'deino','Because it can’t see, this Pokémon is constantly\nbiting at everything it touches, trying to keep\ntrack of its surroundings.','blue','#090a0d','quadruped',35,45,NULL,'slow',0,0,0,'2023-11-22 07:34:08','2023-11-22 07:34:08'),(788,'zweilous','Their two heads will fight each other over a\nsingle piece of food. Zweilous are covered in\nscars even without battling others.','blue','#121318','quadruped',35,45,NULL,'slow',0,0,0,'2023-11-22 07:34:09','2023-11-22 07:34:09'),(789,'hydreigon','The three heads take turns sinking their teeth into\nthe opponent. Their attacks won’t slow until their\ntarget goes down.','blue','#221c26','upright',35,45,NULL,'slow',0,0,0,'2023-11-22 07:34:09','2023-11-22 07:34:09'),(790,'larvesta','Larvesta’s body is warm all over. It spouts fire\nfrom the tips of its horns to intimidate predators\nand scare prey.','white','#1c1513','armor',50,45,NULL,'slow',0,0,0,'2023-11-22 07:34:09','2023-11-22 07:34:09'),(791,'volcarona','This Pokémon emerges from a cocoon formed of\nraging flames. Ancient murals depict Volcarona as\na deity of fire.','white','#46261b','bug-wings',50,15,NULL,'slow',0,0,0,'2023-11-22 07:34:10','2023-11-22 07:34:10'),(792,'cobalion','From the moment it’s born, this Pokémon\nradiates the air of a leader. Its presence will\ncalm even vicious foes.','blue','#222f2d','quadruped',35,3,NULL,'slow',0,1,0,'2023-11-22 07:34:10','2023-11-22 07:34:10'),(793,'terrakion','In Unovan legend, Terrakion battled against\nhumans in an effort to protect other Pokémon.','gray','#2b2723','quadruped',35,3,NULL,'slow',0,1,0,'2023-11-22 07:34:11','2023-11-22 07:34:11'),(794,'virizion','It darts around opponents with a flurry of quick\nmovements, slicing them up with its horns.','green','#212415','quadruped',35,3,NULL,'slow',0,1,0,'2023-11-22 07:34:11','2023-11-22 07:34:11'),(795,'tornadus-incarnate','This storm-stirring Pokémon is said to cause the seasons to\nturn by whipping up the air. I suspect its humanlike form to be\na false one.','green','#353235','arms',90,3,NULL,'slow',0,1,0,'2023-11-22 07:34:12','2023-11-22 07:34:12'),(796,'tornadus-therian','This storm-stirring Pokémon is said to cause the seasons to\nturn by whipping up the air. I suspect its humanlike form to be\na false one.','green','#353235','arms',90,3,NULL,'slow',0,1,0,'2023-11-22 07:34:12','2023-11-22 07:34:12'),(797,'thundurus-incarnate','They say this wielder of electricity has waged war with its\nnemesis, Tornadus, since time immemorial. The lightning bolts\nit hurls pierce the very earth and enrich the soil.','blue','#32373f','arms',90,3,NULL,'slow',0,1,0,'2023-11-22 07:34:12','2023-11-22 07:34:12'),(798,'thundurus-therian','They say this wielder of electricity has waged war with its\nnemesis, Tornadus, since time immemorial. The lightning bolts\nit hurls pierce the very earth and enrich the soil.','blue','#32373f','arms',90,3,NULL,'slow',0,1,0,'2023-11-22 07:34:12','2023-11-22 07:34:12'),(799,'reshiram','According to myth, if people ignore truth and\nlet themselves become consumed by greed,\nReshiram will arrive to burn their kingdoms down.','white','#666773','wings',0,3,NULL,'slow',0,1,0,'2023-11-22 07:34:12','2023-11-22 07:34:12'),(800,'zekrom','Mythology tells us that if people lose the\nrighteousness in their hearts, their kingdoms\nwill be razed by Zekrom’s lightning.','black','#121318','upright',0,3,NULL,'slow',0,1,0,'2023-11-22 07:34:13','2023-11-22 07