 who\nhear it.','white','#181b14','humanoid',100,3,NULL,'slow',0,0,1,'2023-11-22 07:34:15','2023-11-22 07:34:15'),(809,'meloetta-pirouette','Its melodies are sung with a special vocalization\nmethod that can control the feelings of those who\nhear it.','white','#181b14','humanoid',100,3,NULL,'slow',0,0,1,'2023-11-22 07:34:15','2023-11-22 07:34:15'),(810,'genesect','This Pokémon existed 300 million years ago. Team\nPlasma altered it and attached a cannon to its back.','purple','#27182b','humanoid',0,3,NULL,'slow',0,0,1,'2023-11-22 07:34:15','2023-11-22 07:34:15'),(811,'chespin','Such a thick shell of wood covers its head and back\nthat even a direct hit from a truck wouldn’t faze it.','green','#131309','upright',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:15','2023-11-22 07:34:15'),(812,'quilladin','They strengthen their lower bodies by\nrunning into one another. They are very\nkind and won’t start fights.','green','#23200e','upright',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:16','2023-11-22 07:34:16'),(813,'chesnaught','When it takes a defensive posture with its fists\nguarding its face, it could withstand a bomb blast.','green','#474632','upright',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:16','2023-11-22 07:34:16'),(814,'fennekin','As it walks, it munches on a twig in place\nof a snack. It intimidates opponents\nby puffing hot air out of its ears.','red','#1d1514','quadruped',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:16','2023-11-22 07:34:16'),(815,'braixen','When the twig is plucked from its tail,\nfriction sets the twig alight. The flame\nis used to send signals to its allies.','red','#271d1b','upright',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:17','2023-11-22 07:34:17'),(816,'delphox','Using psychic power, it generates a\nfiery vortex of 5,400 degrees Fahrenheit,\nincinerating foes swept into this whirl of flame.','red','#582d19','upright',70,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:17','2023-11-22 07:34:17'),(817,'froakie',