,255,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:20','2023-11-22 07:34:20'),(825,'fletchinder','Fletchinder are exceedingly territorial and\naggressive. These Pokémon fight among\nthemselves over feeding grounds.','red','#20180f','wings',50,120,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:20','2023-11-22 07:34:20'),(826,'talonflame','Talonflame dives toward prey at speeds of up to\n310 mph and assaults them with powerful kicks,\ngiving the prey no chance to escape.','red','#312627','wings',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:21','2023-11-22 07:34:21'),(827,'scatterbug','The powder that covers its body\nregulates its temperature, so it\ncan live in any region or climate.','black','#0d0c0b','armor',70,255,NULL,'medium',0,0,0,'2023-11-22 07:34:21','2023-11-22 07:34:21'),(828,'spewpa','The beaks of bird Pokémon can’t begin\nto scratch its stalwart body.\nTo defend itself, it spews powder.','black','#141312','blob',70,120,NULL,'medium',0,0,0,'2023-11-22 07:34:22','2023-11-22 07:34:22'),(829,'vivillon','The patterns on this Pokémon’s wings\ndepend on the climate and topography\nof its habitat. It scatters colorful scales.','white','#2f1f24','bug-wings',70,45,NULL,'medium',0,0,0,'2023-11-22 07:34:22','2023-11-22 07:34:22'),(830,'litleo','This hot-blooded Pokémon is filled with\ncuriosity. When it gets angry or starts\nfighting, its short mane gets hot.','brown','#19130f','quadruped',70,220,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:23','2023-11-22 07:34:23'),(831,'pyroar','The temperature of its breath is over 10,000\ndegrees Fahrenheit, but Pyroar doesn’t use it on\nits prey. This Pokémon prefers to eat raw meat.','brown','#3d2516','quadruped',70,65,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:23','2023-11-22 07:34:23'),(832,'flabebe','Flabébé wears a crown made from pollen it’s\ncollected from its flower. The crown has hidden\nhealing properties.','white','#231b15','arms',70,225,NULL,'medium',0,0,0,'2023-11-22 07:34:24','2023-11-22 07:34:24'),(833,'floette','It gives its own power to flowers, pouring its\nheart into caring for them. Floette never forgives\nanyone who messes up a flower bed.','white','#19191d','arms',70,120,NULL,'medium',0,0,0,'2023-11-22 07:34:24','2023-11-22 07:34:24'),(834,'floette-eternal','It gives its own power to flowers, pouring its\nheart into caring for them. Floette never forgives\nanyone who messes up a flower bed.','white','#19191d','arms',70,120,NULL,'medium',0,0,0,'2023-11-22 07:34:24','2023-11-22 07:34:24'),(835,'florges','Its life can span several hundred years. It’s said\nto devote its entire life to protecting gardens.','white','#1f2428','arms',70,45,NULL,'medium',0,0,0,'2023-11-22 07:34:25','2023-11-22 07:34:25'),(836,'skiddo','If it has sunshine and water, it doesn’t\nneed to eat, because it can generate\nenergy from the leaves on its back.','brown','#151613','quadruped',70,200,NULL,'medium',0,0,0,'2023-11-22 07:34:25','2023-11-22 07:34:25'),(837,'gogoat','They inhabit mountainous regions.\nThe leader of the herd is decided by\na battle of clashing horns.','brown','#1e2117','quadruped',70,45,NULL,'medium',0,0,0,'2023-11-22 07:34:26','2023-11-22 07:34:26'),(838,'pancham','Wanting to make sure it’s taken seriously,\nPancham’s always giving others a glare.\nBut if it’s not focusing, it ends up smiling.','white','#0f0f16','upright',50,220,NULL,'medium',0,0,0,'2023-11-22 07:34:26','2023-11-22 07:34:26'),(839,'pangoro','Using its leaf, Pangoro can predict the moves of\nits opponents. It strikes with punches that can\nturn a dump truck into scrap with just one hit.','white','#313236','humanoid',50,65,NULL,'medium',0,0,0,'2023-11-22 07:34:29','2023-11-22 07:34:29'),(840,'furfrou','Left alone, its fur will grow longer and longer,\nbut it will only allow someone it trusts to cut it.','white','#2b2ad6','quadruped',70,160,NULL,'medium',0,0,0,'2023-11-22 07:34:29','2023-11-22 07:34:29'),(841,'espurr','There’s enough psychic power in Espurr to send a\nwrestler flying, but because this power can’t be\ncontrolled, Espurr finds it troublesome.','gray','#14131d','upright',50,190,NULL,'medium',0,0,0,'2023-11-22 07:34:29','2023-11-22 07:34:29'),(842,'meowstic-male','The defensive instinct of the males is strong.\nIt’s when they’re protecting themselves or their\npartners that they unleash their full power.','blue','#181f23','upright',50,75,NULL,'medium',0,0,0,'2023-11-22 07:34:30','2023-11-22 07:34:30'),(843,'meowstic-female','The defensive instinct of the males is strong.\nIt’s when they’re protecting themselves or their\npartners that they unleash their full power.','blue','#181f23','upright',50,75,NULL,'medium',0,0,0,'2023-11-22 07:34:30','2023-11-22 07:34:30'),(844,'honedge','The blue eye on the sword’s handguard is the\ntrue body of Honedge. With its old cloth, it\ndrains people’s lives away.','brown','#191b1b','blob',50,180,NULL,'medium',0,0,0,'2023-11-22 07:34:31','2023-11-22 07:34:31'),(845,'doublade','The two swords employ a strategy of rapidly\nalternating between offense and defense to\nbring down their prey.','brown','#251f1e','heads',50,90,NULL,'medium',0,0,0,'2023-11-22 07:34:31','2023-11-22 07:34:31'),(846,'aegislash-shield','Its potent spectral powers allow it to manipulate\nothers. It once used its powers to force people\nand Pokémon to build a kingdom to its liking.','brown','#23201b','blob',50,45,NULL,'medium',0,0,0,'2023-11-22 07:34:32','2023-11-22 07:34:32'),(847,'aegislash-blade','Its potent spectral powers allow it to manipulate\nothers. It once used its powers to force people\nand Pokémon to build a kingdom to its liking.','brown','#23201b','blob',50,45,NULL,'medium',0,0,0,'2023-11-22 07:34:32','2023-11-22 07:34:32'),(848,'spritzee','The scent its body gives off enraptures those\nwho smell it. Noble ladies had no shortage of\nlove for Spritzee.','pink','#170f11','arms',50,200,NULL,'medium',0,0,0,'2023-11-22 07:34:33','2023-11-22 07:34:33'),(849,'aromatisse','The scents Aromatisse can produce range from\nsweet smells that bolster allies to foul 