'2023-11-22 07:34:38','2023-11-22 07:34:38'),(858,'clauncher','By detonating gas that accumulates in its right\nclaw, this Pokémon launches water like a bullet.\nThis is how Clauncher defeats its enemies.','blue','#0e141c','armor',50,225,NULL,'slow',0,0,0,'2023-11-22 07:34:39','2023-11-22 07:34:39'),(859,'clawitzer','Clawitzer’s right arm is a cannon that launches\nprojectiles made of seawater. Shots from a\nClawitzer’s cannon arm can sink a tanker.','blue','#29393f','squiggle',50,55,NULL,'slow',0,0,0,'2023-11-22 07:34:39','2023-11-22 07:34:39'),(860,'helioptile','The sun powers this Pokémon’s electricity\ngeneration. Interruption of that process\nstresses Helioptile to the point of weakness.','yellow','#0f0e07','upright',50,190,NULL,'medium',0,0,0,'2023-11-22 07:34:40','2023-11-22 07:34:40'),(861,'heliolisk','One Heliolisk basking in the sun with its frill\noutspread is all it would take to produce enough\nelectricity to power a city.','yellow','#251f0d','upright',50,75,NULL,'medium',0,0,0,'2023-11-22 07:34:41','2023-11-22 07:34:41'),(862,'tyrunt','This Pokémon is selfish and likes to be pampered.\nIt can also inflict grievous wounds on its Trainer\njust by playing around.','brown','#1d1714','upright',50,45,NULL,'medium',0,0,0,'2023-11-22 07:34:41','2023-11-22 07:34:41'),(863,'tyrantrum','A single bite of Tyrantrum’s massive jaws will\ndemolish a car. This Pokémon was the king of the\nancient world.','red','#432d2c','upright',50,45,NULL,'medium',0,0,0,'2023-11-22 07:34:41','2023-11-22 07:34:41'),(864,'amaura','Amaura is an ancient Pokémon that has gone\nextinct. Specimens of this species can sometimes\nbe found frozen in ice.','blue','#1b1d1f','quadruped',50,45,NULL,'medium',0,0,0,'2023-11-22 07:34:42','2023-11-22 07:34:42'),(865,'aurorus','When gripped by rage, Aurorus will emanate\nfreezing air, covering everything around it in ice.','blue','#3d444e','quadruped',50,45,NULL,'medium',0,0,0,'2023-11-22 07:34:43','2023-11-22 07:34:43'),(866,'sylveon','It emits a soothing aura from its ribbon-shaped organs. It wraps\nthese appendages around quarrelers to instantly restore calm to\nthe situation.','pink','#292025','quadruped',50,45,NULL,'medium',0,0,0,'2023-11-22 07:34:44','2023-11-22 07:34:44'),(867,'hawlucha','It always strikes a pose before going for its\nfinishing move. Sometimes opponents take\nadvantage of that time to counterattack.','green','#272628','humanoid',50,100,NULL,'medium',0,0,0,'2023-11-22 07:34:45','2023-11-22 07:34:45'),(868,'dedenne','Since Dedenne can’t generate much electricity on\nits own, it steals electricity from outlets or other\nelectric Pokémon.','yellow','#141215','upright',50,180,NULL,'medium',0,0,0,'2023-11-22 07:34:45','2023-11-22 07:34:45'),(869,'carbink','It’s said that somewhere in the world, there’s\na mineral vein housing a large pack of slumbering\nCarbink. It’s also said that this pack has a queen.','gray','#111215','ball',50,60,NULL,'slow',0,0,0,'2023-11-22 07:34:46','2023-11-22 07:34:46'),(870,'goomy','Goomy hides away in the shade of trees, where it\'s nice and\nhumid. If the slime coating its body dries out, the Pokémon\ninstantly becomes lethargic.','purple','#13121d','squiggle',35,45,NULL,'slow',0,0,0,'2023-11-22 07:34:47','2023-11-22 07:34:47'),(871,'sliggoo','A creature given to melancholy. I suspect its metallic shell\ndeveloped as a result of the mucus on its skin reacting with\nthe iron in Hisui\'s water.','purple','#221f24','squiggle',35,45,NULL,'slow',0,0,0,'2023-11-22 07:34:48','2023-11-22 07:34:48'),(872,'sliggoo-hisui','A creature given to melancholy. I suspect its metallic shell\ndeveloped as a result of the mucus on its skin reacting with\nthe iron in Hisui\'s water.','purple','#221f24','squiggle',35,45,NULL,'slow',0,0,0,'2023-11-22 07:34:48','2023-11-22 07:34:48'),(873,'goodra','Able to freely control the hardness of its metallic shell.\nIt loathes solitude and is extremely clingy—it will fume and\nrun riot if those dearest to it ever leave its side.','purple','#39343d',