t’s\nability to produce. The ultrasonic waves it\ngenerates can overcome much larger Pokémon.','purple','#1d151f','wings',50,190,NULL,'medium',0,0,0,'2023-11-22 07:34:51','2023-11-22 07:34:51'),(890,'noivern','Flying through the darkness, it weakens enemies\nwith ultrasonic waves that could crush stone.\nIts fangs finish the fight.','purple','#3f3540','wings',50,45,NULL,'medium',0,0,0,'2023-11-22 07:34:51','2023-11-22 07:34:51'),(891,'xerneas','When the horns on its head shine\nin seven colors, it is said to be\nsharing everlasting life.','blue','#373332','quadruped',0,45,NULL,'slow',0,1,0,'2023-11-22 07:34:52','2023-11-22 07:34:52'),(892,'yveltal','When its life comes to an end, it absorbs\nthe life energy of every living thing\nand turns into a cocoon once more.','red','#312022','wings',0,45,NULL,'slow',0,1,0,'2023-11-22 07:34:52','2023-11-22 07:34:52'),(893,'zygarde-50','Some say it can change to an even more\npowerful form when battling those who threaten\nthe ecosystem.','green','#2a3399','squiggle',0,3,NULL,'slow',0,1,0,'2023-11-22 07:34:53','2023-11-22 07:34:53'),(894,'zygarde-10-power-construct','Some say it can change to an even more\npowerful form when battling those who threaten\nthe ecosystem.','green','#2a3399','squiggle',0,3,NULL,'slow',0,1,0,'2023-11-22 07:34:53','2023-11-22 07:34:53'),(895,'zygarde-50-power-construct','Some say it can change to an even more\npowerful form when battling those who threaten\nthe ecosystem.','green','#2a3399','squiggle',0,3,NULL,'slow',0,1,0,'2023-11-22 07:34:53','2023-11-22 07:34:53'),(896,'zygarde-complete','Some say it can change to an even more\npowerful form when battling those who threaten\nthe ecosystem.','green','#2a3399','squiggle',0,3,NULL,'slow',0,1,0,'2023-11-22 07:34:53','2023-11-22 07:34:53'),(897,'zygarde-10','Some say it can change to an even more\npowerful form when battling those who threaten\nthe ecosystem.','green','#2a3399','squiggle',0,3,NULL,'slow',0,1,0,'2023-11-22 07:34:53','2023-11-22 07:34:53')