2 07:34:55'),(906,'decidueye-hisui','The air stored inside the rachises of Decidueye\'s feathers\ninsulates the Pokémon against Hisui\'s extreme cold. This is\nfirm proof that evolution can be influenced by environment.','brown','#20251f','wings',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:55','2023-11-22 07:34:55'),(907,'litten','Trying to pet Litten before it trusts you will\nresult in a nasty scratch from its sharp claws.\nBe careful.','red','#0f0b0c','quadruped',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:56','2023-11-22 07:34:56'),(908,'torracat','When facing a powerful enemy, Torracat’s\nfighting spirit gets pumped up, and its fire bell\nblazes hotter.','red','#20120c','quadruped',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:56','2023-11-22 07:34:56'),(909,'incineroar','Incineroar’s rough and aggressive behavior is its\nmost notable trait, but the way it helps out small\nPokémon shows that it has a kind side as well.','red','#361510','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:56','2023-11-22 07:34:56'),(910,'popplio','If Popplio want to create big, powerful balloons,\nthey must be persistent. It takes daily practice for\nthese Pokémon to develop their skills.','blue','#0c0f15','fish',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:57','2023-11-22 07:34:57'),(911,'brionne','On nights when the sea is calm, Brionne dance\nwith one another to the singing of the Primarina\nthat’s leading them.','blue','#182226','fish',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:57','2023-11-22 07:34:57'),(912,'primarina','For Primarina, every battle’s a stage. Its singing\nand the dancing of its balloons will mesmerize\nthe audience.','blue','#313b44','fish',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:34:57','2023-11-22 07:34:57'),(913,'pikipek','It may look spindly, but its neck muscles are\nheavy-duty. It can peck at a tree 16 times\nper second!','black','#0c0808','wings',70,255,NULL,'medium',0,0,0,'2023-11-22 07:34:58','2023-11-22 07:34:58')