,NULL,'fast',0,0,0,'2023-11-22 07:35:04','2023-11-22 07:35:04'),(939,'mareanie','Unlike their Alolan counterparts, the Mareanie\nof the Galar region have not yet figured out\nthat the branches of Corsola are delicious.','blue','#1b1e22','blob',50,190,NULL,'medium',0,0,0,'2023-11-22 07:35:05','2023-11-22 07:35:05'),(940,'toxapex','Within the poison sac in its body is a poison so\ntoxic that Pokémon as large as Wailord will still\nbe suffering three days after it first takes effect.','blue','#37353f','tentacles',50,75,NULL,'medium',0,0,0,'2023-11-22 07:35:05','2023-11-22 07:35:05'),(941,'mudbray','It eats dirt to create mud and smears this mud all\nover its feet, giving them the grip needed to walk\non rough terrain without slipping.','brown','#191312','quadruped',50,190,NULL,'medium',0,0,0,'2023-11-22 07:35:05','2023-11-22 07:35:05'),(942,'mudsdale','Mudsdale has so much stamina that it could carry\nover 10 tons across the Galar region without rest\nor sleep.','brown','#2c1b1a','quadruped',50,60,NULL,'medium',0,0,0,'2023-11-22 07:35:06','2023-11-22 07:35:06'),(943,'dewpider','Dewpider normally lives underwater. When it\ncomes onto land in search of food, it takes\nwater with it in the form of a bubble on its head.','green','#15160e','legs',50,200,NULL,'medium',0,0,0,'2023-11-22 07:35:06','2023-11-22 07:35:06'),(944,'araquanid','It acts as a caretaker for Dewpider, putting them\ninside its bubble and letting them eat any\nleftover food.','green','#27302f','armor',50,100,NULL,'medium',0,0,0,'2023-11-22 07:35:07','2023-11-22 07:35:07'),(945,'araquanid-totem','It acts as a caretaker for Dewpider, putting them\ninside its bubble and letting them eat any\nleftover food.','green','#27302f','armor',50,100,NULL,'medium',0,0,0,'2023-11-22 07:35:07','2023-11-22 07:35:07'),(946,'fomantis','During the day, Fomantis basks in sunlight and\nsleeps peacefully. It wakes and moves around\nat night.','pink','#111411','upright',50,190,NULL,'medium',0,0,0,'2023-11-22 07:35:07','2023-11-22 07:35:07'),(947,'lurantis','The petals on this Pokémon’s arms are thin and\nsuper sharp, and they can fire laser beams if\nLurantis gathers light first.','pink','#322022','humanoid',50,75,NULL,'medium',0,0,0,'2023-11-22 07:35:08','2023-11-22 07:35:08'),(948,'lurantis-totem','The petals on this Pokémon’s arms are thin and\nsuper sharp, and they can fire laser beams if\nLurantis gathers light first.','pink','#322022','humanoid',50,75,NULL,'medium',0,0,0,'2023-11-22 07:35:08','2023-11-22 07:35:08'),(949,'morelull','Morelull live in forests that stay dark even\nduring the day. They scatter flickering spores\nthat put enemies to sleep.','purple','#110f0f','blob',50,190,NULL,'medium',0,0,0,'2023-11-22 07:35:08','2023-11-22 07:35:08'),(950,'shiinotic','If you see a light deep in a forest at night,\ndon’t go near. Shiinotic will make you fall\nfast asleep.','purple','#413937','humanoid',50,75,NULL,'medium',0,0,0,'2023-11-22 07:35:08','2023-11-22 07:35:08'),(951,'salandit','This sneaky Pokémon will slink behind its prey\nand immobilize it with poisonous gas before the\nprey even realizes Salandit is there.','black','#0e0b0b','quadruped',50,120,NULL,'medium',0,0,0,'2023-11-22 07:35:09','2023-11-22 07:35:09'),(952,'salazzle','The winner of competitions between Salazzle\nis decided by which one has the most male\nSalandit with it.','black','#171013','quadruped',50,45,NULL,'medium',0,0,0,'2023-11-22 07:35:09','2023-11-22 07:35:09'),(953,'salazzle-totem','The winner of competitions between Salazzle\nis decided by which one has the most male\nSalandit with it.','black','#171013','quadruped',50,45,NULL,'medium',0,0,0,'2023-11-22 07:35:09','2023-11-22 07:35:09'),(954,'stufful','The way it protects itself by flailing its arms may\nbe an adorable sight, but stay well away. This is\nflailing that can snap thick tree trunks.','pink','#161111','quadruped',50,140,NULL,'medium',0,0,0,'2023-11-22 07:35:09','2023-11-22 07:35:09'),(955,'bewear','The moves it uses to take down its prey would\