ner’s meal.','gray','#464c47','humanoid',50,45,NULL,'medium',0,0,0,'2023-11-22 07:35:14','2023-11-22 07:35:14'),(964,'sandygast','Sandygast mainly inhabits beaches. It takes\ncontrol of anyone who puts their hand into its\nmouth, forcing them to make its body bigger.','brown','#171512','squiggle',50,140,NULL,'medium',0,0,0,'2023-11-22 07:35:14','2023-11-22 07:35:14'),(965,'palossand','This Pokémon lives on beaches, but it hates\nwater. Palossand can’t maintain its castle-like\nshape if it gets drenched by a heavy rain.','brown','#3b2817','squiggle',50,60,NULL,'medium',0,0,0,'2023-11-22 07:35:15','2023-11-22 07:35:15'),(966,'pyukumuku','It lives in warm, shallow waters. If it encounters a\nfoe, it will spit out its internal organs as a means\nto punch them.','black','#0a0607','squiggle',50,60,NULL,'fast',0,0,0,'2023-11-22 07:35:15','2023-11-22 07:35:15'),(967,'type-null','It was modeled after a mighty Pokémon of myth.\nThe mask placed upon it limits its power in order\nto keep it under control.','gray','#272222','quadruped',0,3,NULL,'slow',0,0,0,'2023-11-22 07:35:15','2023-11-22 07:35:15'),(968,'silvally','The final factor needed to release this\nPokémon’s true power was a strong bond\nwith a Trainer it trusts.','gray','#36383b','quadruped',0,3,NULL,'slow',0,1,0,'2023-11-22 07:35:16','2023-11-22 07:35:16'),(969,'minior-red-meteor','Although its outer shell is uncommonly durable,\nthe shock of falling to the ground smashes the\nshell to smithereens.','brown','#120b0a','ball',70,30,NULL,'medium-slow',0,0,0,'2023-11-22 07:35:16','2023-11-22 07:35:16'),(970,'minior-orange-meteor','Although its outer shell is uncommonly durable,\nthe shock of falling to the ground smashes the\nshell to smithereens.','brown','#120b0a','ball',70,30,NULL,'medium-slow',0,0,0,'2023-11-22 07:35:16','2023-11-22 07:35:16'),(971,'minior-yellow-meteor','Although its outer shell is uncommonly durable,\nthe shock of falling to the ground smashes the\nshell to smithereens.','brown','#120b0a','ball',70