ruins have paintings of ancient warriors\nwearing armor made of Kommo-o scales.','gray','#4f4228','upright',50,45,NULL,'slow',0,0,0,'2023-11-22 07:35:20','2023-11-22 07:35:20'),(997,'kommo-o-totem','Certain ruins have paintings of ancient warriors\nwearing armor made of Kommo-o scales.','gray','#4f4228','upright',50,45,NULL,'slow',0,0,0,'2023-11-22 07:35:20','2023-11-22 07:35:20'),(998,'tapu-koko','The lightning-wielding guardian deity of\nMelemele, Tapu Koko is brimming with curiosity\nand appears before people from time to time.','yellow','#3a300c','arms',50,3,NULL,'slow',0,1,0,'2023-11-22 07:35:21','2023-11-22 07:35:21'),(999,'tapu-lele','Although called a guardian deity, Tapu Lele is\ndevoid of guilt about its cruel disposition and\ncan be described as nature incarnate.','pink','#1c0f12','arms',50,3,NULL,'slow',0,1,0,'2023-11-22 07:35:22','2023-11-22 07:35:22'),(1000,'tapu-bulu','It makes ringing sounds with its tail to let others\nknow where it is, avoiding unneeded conflicts.\nThis guardian deity of Ula’ula controls plants.','red','#2a1a0f','arms',50,3,NULL,'slow',0,1,0,'2023-11-22 07:35:23','2023-11-22 07:35:23'),(1001,'tapu-fini','Although it’s called a guardian deity, terrible\ncalamities sometimes befall those who\nrecklessly approach Tapu Fini.','purple','#151521','arms',50,3,NULL,'slow',0,1,0,'2023-11-22 07:35:24','2023-11-22 07:35:24'),(1002,'cosmog','Cosmog is very curious but not very cautious,\noften placing itself in danger. If things start to\nlook dicey, it teleports away.','blue','#0d101a','ball',0,45,NULL,'slow',0,1,0,'2023-11-22 07:35:25','2023-11-22 07:35:25'),(1003,'cosmoem','It sucks in dust from the air at an astounding rate,\nfrantically building up energy within its core as\npreparation for evolution.','blue','#191308','ball',0,45,NULL,'slow',0,1,0,'2023-11-22 07:35:26','2023-11-22 07:35:26'),(1004,'solgaleo','Solgaleo was once known as the Beast That\nDevours the Sun. Energy in the form of light\nradiates boundlessly from it.','white','#5e564b','quadruped',0,45,NULL,'slow',0,1,0,'2023-11-22 07:35:27','2023-11-22 07:35:27'),(1005,'lunala','It steals the light from its surroundings and then\nbecomes the full moon, showering its own light\nacross the night sky.','purple','#5a5354','wings',0,45,NULL,'slow',0,1,0,'2023-11-22 07:35:29','2023-11-22 07:35:29'),(1006,'nihilego','It appeared in this world from an Ultra\nWormhole. Nihilego appears to be a parasite\nthat lives by feeding on people and Pokémon.','white','#2f3538','tentacles',0,45,NULL,'slow',0,0,0,'2023-11-22 07:35:30','2023-11-22 07:35:30'),(1007,'buzzwole','Buzzwole goes around showing off its\nabnormally swollen muscles. It is one kind\nof Ultra Beast.','red','#512620','tentacles',0,45,NULL,'slow',0,0,0,'2023-11-22 07:35:32','2023-11-22 07:35:32'),(1008,'pheromosa','Although it’s alien to this world and a danger\nhere, it’s apparently a common organism in the\nworld where it normally lives.','white','#665f55','humanoid',0,45,NULL,'slow',0,0,0,'2023-11-22 07:35:34','2023-11-22 07:35:34'),(1009,'xurkitree','They’ve been dubbed Ultra Beasts. Some of\nthem stand unmoving, like trees, with their\narms and legs stuck into the ground.','black','#403a32','upright',0,45,NULL,'slow',0,0,0,'2023-11-22 07:35:35','2023-11-22 07:35:35'),(1010,'celesteela','Although it’s alien to this world and a danger\nhere, it’s apparently a common organism in the\nworld where it normally lives.','green','#42695d','humanoid',0,45,NULL,'slow',0,0,0,'2023-11-22 07:35:35','2023-11-22 07:35:35'),(1011,'kartana','Although it’s alien to this world and a danger\nhere, it’s apparently a common organism in the\nworld where it normally lives.','white','#292520','humanoid',0,45,NULL,'slow',0,0,0,'2023-11-22 07:35:36','2023-11-22 07:35:36'),(1012,'guzzlord','An unknown life-form called a UB. It may be\nconstantly hungry—it is certainly always\ndevouring something.','black','#313c32','upright',0,45,NULL,'slow',0,0,0,'2023-11-22 07:35:36','2023-11-22 07:35:36'),(1013,'necrozma','It needs light to survive, and it goes on a\nrampage seeking it out. Its laser beams will\ncut anything to pieces.','black','#1f2224','arms',0,255,NULL,'slow',0,1,0,'2023-11-22 07:35:37','2023-11-22 07:35:37'),(1014,'necrozma-dusk','It needs light to survive, and it goes on a\nrampage seeking it out. Its laser beams will\ncut anything to pieces.','black','#1f2224','arms',0,255,NULL,'slow',0,1,0,'2023-11-22 07:35:37','2023-11-22 07:35:37'),(1015,'necrozma-dawn','It needs light to survive, and it goes on a\nrampage seeking it out. Its laser beams will\ncut anything to pieces.','black','#1f2224','arms',0,255,NULL,'slow',0,1,0,'2023-11-22 07:35:37','2023-11-22 07:35:37'),(1016,'necrozma-ultra','It needs light to survive, and it goes on a\nrampage seeking it out. Its laser beams will\ncut anything to pieces.','black','#1f2224','arms',0,255,NULL,'slow',0,1,0,'2023-11-22 07:35:37','2023-11-22 07:35:37'),(1017,'magearna','Built roughly 500 years ago by a scientist,\nthe part called the Soul-Heart is the\nactual life-form.','gray','#2d2622','humanoid',0,3,NULL,'slow',0,0,1,'2023-11-22 07:35:38','2023-11-22 07:35:38'),(1018,'magearna-original','Built roughly 500 years ago by a scientist,\nthe part called the Soul-Heart is the\nactual life-form.','gray','#2d2622','humanoid',0,3,NULL,'slow',0,0,1,'2023-11-22 07:35:38','2023-11-22 07:35:38'),(1019,'marshadow','This Pokémon can conceal itself in any shadow,\nso it went undiscovered for a long time.','gray','#0c0c0c','humanoid',0,3,NULL,'slow',0,0,1,'2023-11-22 07:35:38','2023-11-22 07:35:38'),(1020,'poipole','An Ultra Beast that lives in a different world, it\ncackles wildly as it sprays its opponents with\npoison from the needles on its head.','purple','#120b15','upright',0,45,NULL,'slow',0,0,0,'2023-11-22 07:35:40','2023-11-22 07:35:40'),(1021,'naganadel','One kind of Ultra Beast, it fires a glowing,\nvenomous liquid from its needles. This liquid\nis also immensely adhesive.','purple','#322139','wings',0,45,NULL,'slow',0,0,0,'2023-11-22 07:35:42','2023-11-22 07:35:42'),(1022,'stakataka','When stone walls started moving and attacking,\nthe brute’s true identity was this mysterious\nlife-form, which brings to mind an Ultra Beast.','gray','#313433','quadruped',0,30,NULL,'slow',0,0,0,'2023-11-22 07:35:43','2023-11-22 07:35:43'),(1023,'blacephalon','A UB that appeared from an Ultra Wormhole, it\ncauses explosions, then takes advantage of\nopponents’ surprise to rob them of their vitality.','white','#2b2c2d','humanoid',0,30,NULL,'slow',0,0,0,'2023-11-22 07:35:44','2023-11-22 07:35:44'),(1024,'zeraora','Electricity sparks from the pads on its limbs.\nWherever Zeraora runs, lightning flashes and\nthunder echoes.','yellow','#342e19','humanoid',0,3,NULL,'slow',0,0,1,'2023-11-22 07:35:44','2023-11-22 07:35:44'),(1025,'meltan','They live as a group, but when the time comes,\none strong Meltan will absorb all the others\nand evolve.','gray','#16120a','ball',0,3,NULL,'slow',0,0,1,'2023-11-22 07:35:45','2023-11-22 07:35:45'),(1026,'melmetal','Centrifugal force is behind the punches of\nMelmetal’s heavy hex-nut arms. Melmetal is said\nto deliver the strongest punches of all Pokémon.','gray','#4f4a40','humanoid',0,3,NULL,'slow',0,0,1,'2023-11-22 07:35:45','2023-11-22 07:35:45'),(1027,'melmetal-gmax','Centrifugal force is behind the punches of\nMelmetal’s heavy hex-nut arms. Melmetal is said\nto deliver the strongest punches of all Pokémon.','gray','#4f4a40','humanoid',0,3,NULL,'slow',0,0,1,'2023-11-22 07:35:45','2023-11-22 07:35:45'),(1028,'grookey','It attacks with rapid beats of its stick.\nAs it strikes with amazing speed, it gets\nmore and more pumped.','green','#121109','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:35:46','2023-11-22 07:35:46'),(1029,'thwackey','When it’s drumming out rapid beats in battle, it\ngets so caught up in the rhythm that it won’t even\nnotice that it’s already knocked out its opponent.','green','#1a1d0f','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:35:46','2023-11-22 07:35:46'),(1030,'rillaboom','The one with the best drumming techniques\nbecomes the boss of the troop. It has a gentle\ndisposition and values harmony among its group.','green','#333325','humanoid',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:35:46','2023-11-22 07:35:46'),(1031,'rillaboom-gmax','The one with the best drumming techniques\nbecomes the boss of the troop. It has a gentle\ndisposition and values harmony among its group.','green','#333325','humanoid',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:35:46','2023-11-22 07:35:46'),(1032,'scorbunny','It has special pads on the backs of its feet, and\none on its nose. Once it’s raring to fight, these\npads radiate tremendous heat.','white','#211a17','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:35:47','2023-11-22 07:35:47'),(1033,'raboot','It kicks berries right off the branches of trees\nand then juggles them with its feet, practicing\nits footwork.','gray','#1f1915','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:35:48','2023-11-22 07:35:48'),(1034,'cinderace','It’s skilled at both offense and defense, and it\ngets pumped up when cheered on. But if it starts\nshowboating, it could put itself in a tough spot.','white','#2a2220','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:35:48','2023-11-22 07:35:48'),(1035,'cinderace-gmax','It’s skilled at both offense and defense, and it\ngets pumped up when cheered on. But if it starts\nshowboating, it could put itself in a tough spot.','white','#2a2220','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:35:48','2023-11-22 07:35:48'),(1036,'sobble','When it gets wet, its skin changes color,\nand this Pokémon becomes invisible as if\nit were camouflaged.','blue','#0f1417','quadruped',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:35:49','2023-11-22 07:35:49'),(1037,'drizzile','Highly intelligent but also very lazy,\nit keeps enemies out of its territory\nby laying traps everywhere.','blue','#0c1919','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:35:50','2023-11-22 07:35:50'),(1038,'inteleon','Its nictitating membranes let it pick out foes’\nweak points so it can precisely blast them with\nwater that shoots from its fingertips at Mach 3.','blue','#192020','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:35:50','2023-11-22 07:35:50'),(1039,'inteleon-gmax','Its nictitating membranes let it pick out foes’\nweak points so it can precisely blast them with\nwater that shoots from its fingertips at Mach 3.','blue','#192020','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:35:50','2023-11-22 07:35:50'),(1040,'skwovet','It eats berries nonstop—a habit that has made\nit more resilient than it looks. It’ll show up on\nfarms, searching for yet more berries.','brown','#14110f','upright',50,255,NULL,'medium',0,0,0,'2023-11-22 07:35:51','2023-11-22 07:35:51'),(1041,'greedent','Common throughout the Galar region, this\nPokémon has strong teeth and can chew\nthrough the toughest of berry shells.','brown','#3e2822','upright',50,90,NULL,'medium',0,0,0,'2023-11-22 07:35:51','2023-11-22 07:35:51'),(1042,'rookidee','Jumping nimbly about, this small-bodied\nPokémon takes advantage of even the slightest\nopportunity to disorient larger opponents.','blue','#0c0c0b','wings',50,255,NULL,'medium-slow',0,0,0,'2023-11-22 07:35:51','2023-11-22 07:35:51'),(1043,'corvisquire','The lessons of many harsh battles have taught it\nhow to accurately judge an opponent’s strength.','blue','#16181c','wings',50,120,NULL,'medium-slow',0,0,0,'2023-11-22 07:35:52','2023-11-22 07:35:52'),(1044,'corviknight','With their great intellect and flying skills, these\nPokémon very successfully act as the Galar\nregion’s airborne taxi service.','purple','#0e0d19','wings',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:35:52','2023-11-22 07:35:52'),(1045,'corviknight-gmax','With their great intellect and flying skills, these\nPokémon very successfully act as the Galar\nregion’s airborne taxi service.','purple','#0e0d19','wings',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:35:52','2023-11-22 07:35:52'),(1046,'blipbug','Often found in gardens, this Pokémon has hairs\non its body that it uses to assess its surroundings.','blue','#0b0a0e','armor',50,255,NULL,'medium',0,0,0,'2023-11-22 07:35:52','2023-11-22 07:35:52'),(1047,'dottler','As it grows inside its shell, it uses its psychic\nabilities to monitor the outside world and\nprepare for evolution.','yellow','#1f1912','armor',50,120,NULL,'medium',0,0,0,'2023-11-22 07:35:53','2023-11-22 07:35:53'),(1048,'orbeetle','It emits psychic energy to observe and study\nwhat’s around it—and what’s around it can\ninclude things over six miles away.','red','#291218','wings',50,45,NULL,'medium',0,0,0,'2023-11-22 07:35:53','2023-11-22 07:35:53'),(1049,'orbeetle-gmax','It emits psychic energy to observe and study\nwhat’s around it—and what’s around it can\ninclude things over six miles away.','red','#291218','wings',50,45,NULL,'medium',0,0,0,'2023-11-22 07:35:53','2023-11-22 07:35:53'),(1050,'nickit','Cunning and cautious, this Pokémon survives by\nstealing food from others. It erases its tracks with\nswipes of its tail as it makes off with its plunder.','brown','#190d09','quadruped',50,255,NULL,'fast',0,0,0,'2023-11-22 07:35:54','2023-11-22 07:35:54'),(1051,'thievul','With a lithe body and sharp claws, it goes\naround stealing food and eggs. Boltund\nis its natural enemy.','brown','#291710','quadruped',50,127,NULL,'fast',0,0,0,'2023-11-22 07:35:54','2023-11-22 07:35:54'),(1052,'gossifleur','It whirls around in the wind while singing a joyous\nsong. This delightful display has charmed many\ninto raising this Pokémon.','green','#26190a','blob',50,190,NULL,'medium',0,0,0,'2023-11-22 07:35:55','2023-11-22 07:35:55'),(1053,'eldegoss','The cotton on the head of this Pokémon can be\nspun into a glossy, gorgeous yarn—a Galar\nregional specialty.','green','#3b372d','blob',50,75,NULL,'medium',0,0,0,'2023-11-22 07:35:56','2023-11-22 07:35:56'),(1054,'wooloo','If its fleece grows too long, Wooloo won’t be\nable to move. Cloth made with the wool of this\nPokémon is surprisingly strong.','white','#1f1c1b','quadruped',50,255,NULL,'medium',0,0,0,'2023-11-22 07:35:56','2023-11-22 07:35:56'),(1055,'dubwool','Its majestic horns are meant only to impress the\nopposite gender. They never see use in battle.','white','#2e2a29','quadruped',50,127,NULL,'medium',0,0,0,'2023-11-22 07:35:56','2023-11-22 07:35:56'),(1056,'chewtle','It starts off battles by attacking with its rock-hard\nhorn, but as soon as the opponent flinches, this\nPokémon bites down and never lets go.','green','#121713','quadruped',50,255,NULL,'medium',0,0,0,'2023-11-22 07:35:59','2023-11-22 07:35:59'),(1057,'drednaw','This Pokémon rapidly extends its retractable neck\nto sink its sharp fangs into distant enemies and\ntake them down.','green','#302d1d','quadruped',50,75,NULL,'medium',0,0,0,'2023-11-22 07:35:59','2023-11-22 07:35:59'),(1058,'drednaw-gmax','This Pokémon rapidly extends its retractable neck\nto sink its sharp fangs into distant enemies and\ntake them down.','green','#302d1d','quadruped',50,75,NULL,'medium',0,0,0,'2023-11-22 07:35:59','2023-11-22 07:35:59'),(1059,'yamper','This gluttonous Pokémon only assists people with\ntheir work because it wants treats. As it runs,\nit crackles with electricity.','yellow','#1c180f','quadruped',50,255,NULL,'fast',0,0,0,'2023-11-22 07:36:00','2023-11-22 07:36:00'),(1060,'boltund','It sends electricity through its legs to boost their\nstrength. Running at top speed, it easily breaks\n50 mph.','yellow','#35311e','quadruped',50,45,NULL,'fast',0,0,0,'2023-11-22 07:36:00','2023-11-22 07:36:00'),(1061,'rolycoly','It can race around like a unicycle, even on rough,\nrocky terrain. Burning coal sustains it.','black','#0d0c0c','ball',50,255,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:01','2023-11-22 07:36:01'),(1062,'carkol','By rapidly rolling its legs, it can travel at over\n18 mph. The temperature of the flames it\nbreathes exceeds 1,800 degrees Fahrenheit.','black','#0e0c0c','legs',50,120,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:01','2023-11-22 07:36:01'),(1063,'coalossal','While it’s engaged in battle, its mountain of coal\nwill burn bright red, sending off sparks that\nscorch the surrounding area.','black','#1d1a19','humanoid',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:02','2023-11-22 07:36:02'),(1064,'coalossal-gmax','While it’s engaged in battle, its mountain of coal\nwill burn bright red, sending off sparks that\nscorch the surrounding area.','black','#1d1a19','humanoid',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:02','2023-11-22 07:36:02'),(1065,'applin','As soon as it’s born, it burrows into an apple. Not\nonly does the apple serve as its food source, but\nthe flavor of the fruit determines its evolution.','green','#160d08','squiggle',50,255,NULL,'slow-then-very-fast',0,0,0,'2023-11-22 07:36:02','2023-11-22 07:36:02'),(1066,'flapple','It flies on wings of apple skin and spits a\npowerful acid. It can also change its shape\ninto that of an apple.','green','#281e13','wings',50,45,NULL,'slow-then-very-fast',0,0,0,'2023-11-22 07:36:03','2023-11-22 07:36:03'),(1067,'flapple-gmax','It flies on wings of apple skin and spits a\npowerful acid. It can also change its shape\ninto that of an apple.','green','#281e13','wings',50,45,NULL,'slow-then-very-fast',0,0,0,'2023-11-22 07:36:03','2023-11-22 07:36:03'),(1068,'appletun','Its body is covered in sweet nectar, and the\nskin on its back is especially yummy. Children\nused to have it as a snack.','green','#3f3d22','quadruped',50,45,NULL,'slow-then-very-fast',0,0,0,'2023-11-22 07:36:03','2023-11-22 07:36:03'),(1069,'appletun-gmax','Its body is covered in sweet nectar, and the\nskin on its back is especially yummy. Children\nused to have it as a snack.','green','#3f3d22','quadruped',50,45,NULL,'slow-then-very-fast',0,0,0,'2023-11-22 07:36:03','2023-11-22 07:36:03'),(1070,'silicobra','It spews sand from its nostrils. While the enemy\nis blinded, it burrows into the ground to hide.','green','#16150e','squiggle',50,255,NULL,'medium',0,0,0,'2023-11-22 07:36:04','2023-11-22 07:36:04'),(1071,'sandaconda','Its unique style of coiling allows it to blast sand\nout of its sand sac more efficiently.','green','#292519','squiggle',50,120,NULL,'medium',0,0,0,'2023-11-22 07:36:04','2023-11-22 07:36:04'),(1072,'sandaconda-gmax','Its unique style of coiling allows it to blast sand\nout of its sand sac more efficiently.','green','#292519','squiggle',50,120,NULL,'medium',0,0,0,'2023-11-22 07:36:04','2023-11-22 07:36:04'),(1073,'cramorant','This hungry Pokémon swallows Arrokuda whole.\nOccasionally, it makes a mistake and tries to\nswallow a Pokémon other than its preferred prey.','blue','#121f2d','wings',50,45,NULL,'medium',0,0,0,'2023-11-22 07:36:04','2023-11-22 07:36:04'),(1074,'cramorant-gulping','This hungry Pokémon swallows Arrokuda whole.\nOccasionally, it makes a mistake and tries to\nswallow a Pokémon other than its preferred prey.','blue','#121f2d','wings',50,45,NULL,'medium',0,0,0,'2023-11-22 07:36:04','2023-11-22 07:36:04'),(1075,'cramorant-gorging','This hungry Pokémon swallows Arrokuda whole.\nOccasionally, it makes a mistake and tries to\nswallow a Pokémon other than its preferred prey.','blue','#121f2d','wings',50,45,NULL,'medium',0,0,0,'2023-11-22 07:36:04','2023-11-22 07:36:04'),(1076,'arrokuda','After it’s eaten its fill, its movements become\nextremely sluggish. That’s when Cramorant\nswallows it up.','brown','#16120d','fish',50,255,NULL,'slow',0,0,0,'2023-11-22 07:36:05','2023-11-22 07:36:05'),(1077,'barraskewda','It spins its tail fins to propel itself, surging\nforward at speeds of over 100 knots before\nramming prey and spearing into them.','brown','#22160f','fish',50,60,NULL,'slow',0,0,0,'2023-11-22 07:36:06','2023-11-22 07:36:06'),(1078,'toxel','It manipulates the chemical makeup of its poison\nto produce electricity. The voltage is weak, but it\ncan cause a tingling paralysis.','purple','#180b1f','upright',50,75,NULL,'medium-slow',1,0,0,'2023-11-22 07:36:06','2023-11-22 07:36:06'),(1079,'toxtricity-amped','This short-tempered and aggressive Pokémon\nchugs stagnant water to absorb any toxins it\nmight contain.','purple','#31211f','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:07','2023-11-22 07:36:07'),(1080,'toxtricity-low-key','This short-tempered and aggressive Pokémon\nchugs stagnant water to absorb any toxins it\nmight contain.','purple','#31211f','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:07','2023-11-22 07:36:07'),(1081,'toxtricity-amped-gmax','This short-tempered and aggressive Pokémon\nchugs stagnant water to absorb any toxins it\nmight contain.','purple','#31211f','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:07','2023-11-22 07:36:07'),(1082,'toxtricity-low-key-gmax','This short-tempered and aggressive Pokémon\nchugs stagnant water to absorb any toxins it\nmight contain.','purple','#31211f','upright',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:07','2023-11-22 07:36:07'),(1083,'sizzlipede','It wraps prey up with its heated body, cooking\nthem in its coils. Once they’re well-done, it will\nvoraciously nibble them down to the last morsel.','red','#1e0c06','tentacles',50,190,NULL,'medium',0,0,0,'2023-11-22 07:36:07','2023-11-22 07:36:07'),(1084,'centiskorch','While its burning body is already dangerous on\nits own, this excessively hostile Pokémon also has\nlarge and very sharp fangs.','red','#45220b','tentacles',50,75,NULL,'medium',0,0,0,'2023-11-22 07:36:08','2023-11-22 07:36:08'),(1085,'centiskorch-gmax','While its burning body is already dangerous on\nits own, this excessively hostile Pokémon also has\nlarge and very sharp fangs.','red','#45220b','tentacles',50,75,NULL,'medium',0,0,0,'2023-11-22 07:36:08','2023-11-22 07:36:08'),(1086,'clobbopus','Its tentacles tear off easily, but it isn’t alarmed\nwhen that happens—it knows they’ll grow back.\nIt’s about as smart as a three-year-old.','brown','#1c1615','tentacles',50,180,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:09','2023-11-22 07:36:09'),(1087,'grapploct','Searching for an opponent to test its skills\nagainst, it emerges onto land. Once the battle\nis over, it returns to the sea.','blue','#111725','tentacles',50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:10','2023-11-22 07:36:10'),(1088,'sinistea','The teacup in which this Pokémon makes its\nhome is a famous piece of antique tableware.\nMany forgeries are in circulation.','purple','#101110','ball',50,120,NULL,'medium',0,0,0,'2023-11-22 07:36:11','2023-11-22 07:36:11'),(1089,'polteageist','Leaving leftover black tea unattended is asking\nfor this Pokémon to come along and pour itself\ninto it, turning the tea into a new Polteageist.','purple','#2b2c2d','ball',50,60,NULL,'medium',0,0,0,'2023-11-22 07:36:11','2023-11-22 07:36:11'),(1090,'hatenna','If this Pokémon senses a strong emotion, it\nwill run away as fast as it can. It prefers areas\nwithout people.','pink','#16161a','legs',50,235,NULL,'slow',0,0,0,'2023-11-22 07:36:11','2023-11-22 07:36:11'),(1091,'hattrem','Using the braids on its head, it pummels foes to\nget them to quiet down. One blow from those\nbraids would knock out a professional boxer.','pink','#2d2d33','humanoid',50,120,NULL,'slow',0,0,0,'2023-11-22 07:36:12','2023-11-22 07:36:12'),(1092,'hatterene','If you’re too loud around it, you risk being torn\napart by the claws on its tentacle. This Pokémon\nis also known as the Forest Witch.','pink','#39353d','blob',50,45,NULL,'slow',0,0,0,'2023-11-22 07:36:12','2023-11-22 07:36:12'),(1093,'hatterene-gmax','If you’re too loud around it, you risk being torn\napart by the claws on its tentacle. This Pokémon\nis also known as the Forest Witch.','pink','#39353d','blob',50,45,NULL,'slow',0,0,0,'2023-11-22 07:36:12','2023-11-22 07:36:12'),(1094,'impidimp','It sneaks into people’s homes, stealing things\nand feasting on the negative energy of the\nfrustrated occupants.','pink','#28141d','humanoid',50,255,NULL,'medium',0,0,0,'2023-11-22 07:36:13','2023-11-22 07:36:13'),(1095,'morgrem','With sly cunning, it tries to lure people into the\nwoods. Some believe it to have the power to\nmake crops grow.','pink','#26151c','humanoid',50,120,NULL,'medium',0,0,0,'2023-11-22 07:36:13','2023-11-22 07:36:13'),(1096,'grimmsnarl','Its hairs work like muscle fibers. When its hairs\nunfurl, they latch on to opponents, ensnaring\nthem as tentacles would.','purple','#232333','humanoid',50,45,NULL,'medium',0,0,0,'2023-11-22 07:36:13','2023-11-22 07:36:13'),(1097,'grimmsnarl-gmax','Its hairs work like muscle fibers. When its hairs\nunfurl, they latch on to opponents, ensnaring\nthem as tentacles would.','purple','#232333','humanoid',50,45,NULL,'medium',0,0,0,'2023-11-22 07:36:13','2023-11-22 07:36:13'),(1098,'obstagoon','It evolved after experiencing numerous fights.\nWhile crossing its arms, it lets out a shout that\nwould make any opponent flinch.','gray','#242424','upright',50,45,NULL,'medium',0,0,0,'2023-11-22 07:36:14','2023-11-22 07:36:14'),(1099,'perrserker','After many battles, it evolved dangerous\nclaws that come together to form daggers\nwhen extended.','brown','#1e1e1d','upright',50,90,NULL,'medium',0,0,0,'2023-11-22 07:36:14','2023-11-22 07:36:14'),(1100,'cursola','Be cautious of the ectoplasmic body\nsurrounding its soul. You’ll become\nstiff as stone if you touch it.','white','#615e62','arms',50,30,NULL,'fast',0,0,0,'2023-11-22 07:36:15','2023-11-22 07:36:15'),(1101,'sirfetchd','After deflecting attacks with its hard leaf shield,\nit strikes back with its sharp leek stalk. The leek\nstalk is both weapon and food.','white','#2f3529','wings',50,45,NULL,'medium',0,0,0,'2023-11-22 07:36:15','2023-11-22 07:36:15'),(1102,'mr-rime','Its amusing movements make it very popular.\nIt releases its psychic power from the pattern\non its belly.','purple','#1b1d27','humanoid',50,45,NULL,'medium',0,0,0,'2023-11-22 07:36:16','2023-11-22 07:36:16'),(1103,'runerigus','Never touch its shadowlike body, or you’ll be\nshown the horrific memories behind the picture\ncarved into it.','gray','#2d272a','blob',50,90,NULL,'medium',0,0,0,'2023-11-22 07:36:16','2023-11-22 07:36:16'),(1104,'milcery','They say that any patisserie visited by Milcery\nis guaranteed success and good fortune.','white','#1c1b12','ball',50,200,NULL,'medium',0,0,0,'2023-11-22 07:36:16','2023-11-22 07:36:16'),(1105,'alcremie','When Alcremie is content, the cream it\nsecretes from its hands becomes sweeter\nand richer.','white','#291f1f','blob',50,100,NULL,'medium',0,0,0,'2023-11-22 07:36:17','2023-11-22 07:36:17'),(1106,'alcremie-gmax','When Alcremie is content, the cream it\nsecretes from its hands becomes sweeter\nand richer.','white','#291f1f','blob',50,100,NULL,'medium',0,0,0,'2023-11-22 07:36:17','2023-11-22 07:36:17'),(1107,'falinks','The six of them work together as one Pokémon.\nTeamwork is also their battle strategy, and they\nconstantly change their formation as they fight.','yellow','#321c0f','heads',50,45,NULL,'medium',0,0,0,'2023-11-22 07:36:17','2023-11-22 07:36:17'),(1108,'pincurchin','It stores electricity in each spine. Even if one gets\nbroken off, it still continues to emit electricity for\nat least three hours.','purple','#0e0c0b','tentacles',50,75,NULL,'medium',0,0,0,'2023-11-22 07:36:18','2023-11-22 07:36:18'),(1109,'snom','It eats snow that piles up on the ground.\nThe more snow it eats, the bigger and more\nimpressive the spikes on its back grow.','white','#111213','squiggle',50,190,NULL,'medium',0,0,0,'2023-11-22 07:36:18','2023-11-22 07:36:18'),(1110,'frosmoth','It shows no mercy to any who desecrate fields\nand mountains. It will fly around on its icy wings,\ncausing a blizzard to chase offenders away.','white','#535356','bug-wings',50,75,NULL,'medium',0,0,0,'2023-11-22 07:36:19','2023-11-22 07:36:19'),(1111,'stonjourner','Once a year, on a specific date and at a specific\ntime, they gather out of nowhere and form up in\na circle.','gray','#33322b','legs',50,60,NULL,'slow',0,0,0,'2023-11-22 07:36:20','2023-11-22 07:36:20'),(1112,'eiscue-ice','This Pokémon keeps its heat-sensitive head cool\nwith ice. It fishes for its food, dangling its single\nhair into the sea to lure in prey.','blue','#394142','upright',50,60,NULL,'slow',0,0,0,'2023-11-22 07:36:21','2023-11-22 07:36:21'),(1113,'eiscue-noice','This Pokémon keeps its heat-sensitive head cool\nwith ice. It fishes for its food, dangling its single\nhair into the sea to lure in prey.','blue','#394142','upright',50,60,NULL,'slow',0,0,0,'2023-11-22 07:36:21','2023-11-22 07:36:21'),(1114,'indeedee-male','Through its horns, it can pick up on the emotions\nof creatures around it. Positive emotions are the\nsource of its strength.','purple','#151319','upright',140,30,NULL,'fast',0,0,0,'2023-11-22 07:36:21','2023-11-22 07:36:21'),(1115,'indeedee-female','Through its horns, it can pick up on the emotions\nof creatures around it. Positive emotions are the\nsource of its strength.','purple','#151319','upright',140,30,NULL,'fast',0,0,0,'2023-11-22 07:36:21','2023-11-22 07:36:21'),(1116,'morpeko-full-belly','It carries electrically roasted seeds with it as if\nthey’re precious treasures. No matter how much\nit eats, it always gets hungry again in short order.','yellow','#14110c','humanoid',50,180,NULL,'medium',0,0,0,'2023-11-22 07:36:22','2023-11-22 07:36:22'),(1117,'morpeko-hangry','It carries electrically roasted seeds with it as if\nthey’re precious treasures. No matter how much\nit eats, it always gets hungry again in short order.','yellow','#14110c','humanoid',50,180,NULL,'medium',0,0,0,'2023-11-22 07:36:22','2023-11-22 07:36:22'),(1118,'cufant','If a job requires serious strength, this Pokémon\nwill excel at it. Its copper body tarnishes in the\nrain, turning a vibrant green color.','yellow','#271e17','quadruped',50,190,NULL,'medium',0,0,0,'2023-11-22 07:36:22','2023-11-22 07:36:22'),(1119,'copperajah','These Pokémon live in herds. Their trunks have\nincredible grip strength, strong enough to crush\ngiant rocks into powder.','green','#283228','quadruped',50,90,NULL,'medium',0,0,0,'2023-11-22 07:36:24','2023-11-22 07:36:24'),(1120,'copperajah-gmax','These Pokémon live in herds. Their trunks have\nincredible grip strength, strong enough to crush\ngiant rocks into powder.','green','#283228','quadruped',50,90,NULL,'medium',0,0,0,'2023-11-22 07:36:24','2023-11-22 07:36:24'),(1121,'dracozolt','The powerful muscles in its tail generate its\nelectricity. Compared to its lower body,\nits upper half is entirely too small.','green','#413821','upright',50,45,NULL,'slow',0,0,0,'2023-11-22 07:36:24','2023-11-22 07:36:24'),(1122,'arctozolt','This Pokémon lived on prehistoric seashores and\nwas able to preserve food with the ice on its\nbody. It went extinct because it moved so slowly.','blue','#303c39','upright',50,45,NULL,'slow',0,0,0,'2023-11-22 07:36:24','2023-11-22 07:36:24'),(1123,'dracovish','Its mighty legs are capable of running at\nspeeds exceeding 40 mph, but this Pokémon\ncan’t breathe unless it’s underwater.','green','#2c2d31','legs',50,45,NULL,'slow',0,0,0,'2023-11-22 07:36:25','2023-11-22 07:36:25'),(1124,'arctovish','The skin on its face is impervious to attack, but\nbreathing difficulties made this Pokémon go\nextinct anyway.','blue','#324051','fish',50,45,NULL,'slow',0,0,0,'2023-11-22 07:36:25','2023-11-22 07:36:25'),(1125,'duraludon','The special metal that composes its body is very\nlight, so this Pokémon has considerable agility.\nIt lives in caves because it dislikes the rain.','white','#363339','upright',50,45,NULL,'medium',0,0,0,'2023-11-22 07:36:26','2023-11-22 07:36:26'),(1126,'duraludon-gmax','The special metal that composes its body is very\nlight, so this Pokémon has considerable agility.\nIt lives in caves because it dislikes the rain.','white','#363339','upright',50,45,NULL,'medium',0,0,0,'2023-11-22 07:36:26','2023-11-22 07:36:26'),(1127,'dreepy','If this weak Pokémon is by itself, a mere child\ncould defeat it. But if Dreepy has friends to help\nit train, it can evolve and become much stronger.','green','#10130e','squiggle',50,45,NULL,'slow',0,0,0,'2023-11-22 07:36:26','2023-11-22 07:36:26'),(1128,'drakloak','Without a Dreepy to place on its head and\ncare for, it gets so uneasy it’ll try to substitute\nany Pokémon it finds for the missing Dreepy.','green','#1e2425','arms',50,45,NULL,'slow',0,0,0,'2023-11-22 07:36:27','2023-11-22 07:36:27'),(1129,'dragapult','Apparently the Dreepy inside Dragapult’s\nhorns eagerly look forward to being launched out\nat Mach speeds.','green','#2c3b3e','upright',50,45,NULL,'slow',0,0,0,'2023-11-22 07:36:27','2023-11-22 07:36:27'),(1130,'zacian','This Pokémon has slumbered for many years.\nSome say it’s Zamazenta’s elder sister—others\nsay the two Pokémon are rivals.','blue','#322b36','quadruped',0,10,NULL,'slow',0,1,0,'2023-11-22 07:36:27','2023-11-22 07:36:27'),(1131,'zacian-crowned','This Pokémon has slumbered for many years.\nSome say it’s Zamazenta’s elder sister—others\nsay the two Pokémon are rivals.','blue','#322b36','quadruped',0,10,NULL,'slow',0,1,0,'2023-11-22 07:36:27','2023-11-22 07:36:27'),(1132,'zamazenta','This Pokémon slept for aeons while in the form of\na statue. It was asleep for so long, people forgot\nthat it ever existed.','red','#362133','quadruped',0,10,NULL,'slow',0,1,0,'2023-11-22 07:36:28','2023-11-22 07:36:28'),(1133,'zamazenta-crowned','This Pokémon slept for aeons while in the form of\na statue. It was asleep for so long, people forgot\nthat it ever existed.','red','#362133','quadruped',0,10,NULL,'slow',0,1,0,'2023-11-22 07:36:28','2023-11-22 07:36:28'),(1134,'eternatus','It was inside a meteorite that fell 20,000 years\nago. There seems to be a connection between\nthis Pokémon and the Dynamax phenomenon.','purple','#291034','wings',0,255,NULL,'slow',0,1,0,'2023-11-22 07:36:28','2023-11-22 07:36:28'),(1135,'eternatus-eternamax','It was inside a meteorite that fell 20,000 years\nago. There seems to be a connection between\nth