apable\nof creating all Galar’s electricity.','yellow','#5d581d','humanoid',35,3,NULL,'slow',0,1,0,'2023-11-22 07:36:30','2023-11-22 07:36:30'),(1144,'regidrago','Its body is composed of crystallized dragon\nenergy. Regidrago is said to have the powers of\nevery dragon Pokémon.','green','#272228','humanoid',35,3,NULL,'slow',0,1,0,'2023-11-22 07:36:30','2023-11-22 07:36:30'),(1145,'glastrier','Glastrier has tremendous physical strength, and\nthe mask of ice covering its face is 100 times\nharder than diamond.','white','#383e48','quadruped',35,3,NULL,'slow',0,1,0,'2023-11-22 07:36:31','2023-11-22 07:36:31'),(1146,'spectrier','As it dashes through the night, Spectrier absorbs\nthe life-force of sleeping creatures. It craves\nsilence and solitude.','black','#221f32','quadruped',35,3,NULL,'slow',0,1,0,'2023-11-22 07:36:31','2023-11-22 07:36:31'),(1147,'calyrex','Calyrex is known in legend as a king that ruled\nover Galar in ancient times. It has the power to\ncause hearts to mend and plants to spring forth.','green','#182826','humanoid',100,3,NULL,'slow',0,1,0,'2023-11-22 07:36:32','2023-11-22 07:36:32'),(1148,'calyrex-ice','Calyrex is known in legend as a king that ruled\nover Galar in ancient times. It has the power to\ncause hearts to mend and plants to spring forth.','green','#182826','humanoid',100,3,NULL,'slow',0,1,0,'2023-11-22 07:36:32','2023-11-22 07:36:32'),(1149,'calyrex-shadow','Calyrex is known in legend as a king that ruled\nover Galar in ancient times. It has the power to\ncause hearts to mend and plants to spring forth.','green','#182826','humanoid',100,3,NULL,'slow',0,1,0,'2023-11-22 07:36:32','2023-11-22 07:36:32'),(1150,'wyrdeer','The black orbs shine with an uncanny light when the Pokémon is\nerecting invisible barriers. The fur shed from its beard retains\nheat well and is a highly useful material for winter clothing.','gray','#443b34','quadruped',NULL,135,NULL,'slow',0,0,0,'2023-11-22 07:36:32','2023-11-22 07:36:32'),(1151,'kleavor','A violent creature that fells towering trees with its crude axes\nand shields itself with hard stone. If one should chance upon\nthis Pokémon in the wilds, one\'s only recourse is to flee.','brown','#261e18','bug-wings',NULL,115,NULL,'medium',0,0,0,'2023-11-22 07:36:33','2023-11-22 07:36:33'),(1152,'ursaluna','I believe it was Hisui\'s swampy terrain that gave Ursaluna its\nburly physique and newfound capacity to manipulate peat\nat will.','brown','#29211d','quadruped',NULL,75,NULL,'medium',0,0,0,'2023-11-22 07:36:33','2023-11-22 07:36:33'),(1153,'ursaluna-bloodmoon','I believe it was Hisui\'s swampy terrain that gave Ursaluna its\nburly physique and newfound capacity to manipulate peat\nat will.','brown','#29211d','quadruped',NULL,75,NULL,'medium',0,0,0,'2023-11-22 07:36:33','2023-11-22 07:36:33'),(1154,'basculegion-male','Clads itself in the souls of comrades that perished before\nfulfilling their goals of journeying upstream. No other species\nthroughout all Hisui\'s rivers is Basculegion\'s equal.','green','#322023','fish',NULL,135,NULL,'medium',0,0,0,'2023-11-22 07:36:33','2023-11-22 07:36:33'),(1155,'basculegion-female','Clads itself in the souls of comrades that perished before\nfulfilling their goals of journeying upstream. No other species\nthroughout all Hisui\'s rivers is Basculegion\'s equal.','green','#322023','fish',NULL,135,NULL,'medium',0,0,0,'2023-11-22 07:36:33','2023-11-22 07:36:33'),(1156,'sneasler','Because of Sneasler\'s virulent poison and daunting physical\nprowess, no other species could hope to best it on the frozen\nhighlands. Preferring solitude, this species does not form packs.','gray','#23212d','upright',NULL,135,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:34','2023-11-22 07:36:34'),(1157,'overqwil','Its lancelike spikes and savage temperament have earned it the\nnickname ”sea fiend.” It slurps up poison to nourish itself.','black','#423138','fish',NULL,135,NULL,'medium',0,0,0,'2023-11-22 07:36:34','2023-11-22 07:36:34'),(1158,'enamorus-incarnate','When it flies to this land from across the sea, the bitter winter\ncomes to an end. According to legend, this Pokémon\'s love\ngives rise to the budding of fresh life across Hisui.','pink','#3a2f34','arms',NULL,3,NULL,'slow',0,1,0,'2023-11-22 07:36:34','2023-11-22 07:36:34'),(1159,'enamorus-therian','When it flies to this land from across the sea, the bitter winter\ncomes to an end. According to legend, this Pokémon\'s love\ngives rise to the budding of fresh life across Hisui.','pink','#3a2f34','arms',NULL,3,NULL,'slow',0,1,0,'2023-11-22 07:36:34','2023-11-22 07:36:34'),(1160,'sprigatito','The sweet scent its body gives off mesmerizes those around it. The scent grows stronger when this Pokémon is in the sun.','green','#13160f',NULL,50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:35','2023-11-22 07:36:35'),(1161,'floragato','The hardness of Floragato’s fur depends on the Pokémon’s mood. When Floragato is prepared to battle, its fur becomes pointed and needle sharp.','green','#141911',NULL,50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:36','2023-11-22 07:36:36'),(1162,'meowscarada','With skillful misdirection, it rigs foes with pollen-packed flower bombs. Meowscarada sets off the bombs before its foes realize what’s going on.','green','#1d261c',NULL,50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:36','2023-11-22 07:36:36'),(1163,'fuecoco','Its flame sac is small, so energy is always leaking out. This energy is released from the dent atop Fuecoco’s head and flickers to and fro.','red','#1d120d',NULL,50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:36','2023-11-22 07:36:36'),(1164,'crocalor','The valve in Crocalor’s flame sac is closely connected to its vocal cords. This Pokémon utters a guttural cry as it spews flames every which way.','red','#301b11',NULL,50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:37','2023-11-22 07:36:37'),(1165,'skeledirge','Skeledirge’s gentle singing soothes the souls of all that hear it. It burns its enemies to a crisp with flames of over 5,400 degrees Fahrenheit.','red','#47261e',NULL,50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:37','2023-11-22 07:36:37'),(1166,'quaxly','Its strong legs let it easily swim around in even fast-flowing rivers. It likes to keep things tidy and is prone to overthinking things.','white','#101a1d',NULL,50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:38','2023-11-22 07:36:38'),(1167,'quaxwell','The hardworking Quaxwell observes people and Pokémon from various regions and incorporates their movements into its own dance routines.','blue','#12181a',NULL,50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:38','2023-11-22 07:36:38'),(1168,'quaquaval','Dancing in ways that evoke far-away places, this Pokémon mesmerizes all that see it. Flourishes of its decorative water feathers slice into its foes.','blue','#1b212b',NULL,50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:38','2023-11-22 07:36:38'),(1169,'lechonk','This Pokémon spurns all but the finest of foods. Its body gives off an herblike scent that bug Pokémon detest.','gray','#0c0908',NULL,50,255,NULL,'medium',0,0,0,'2023-11-22 07:36:39','2023-11-22 07:36:39'),(1170,'oinkologne','It entrances female Pokémon with the sweet, alluring scent that wafts from all over its body.','gray','#171015',NULL,50,100,NULL,'medium',0,0,0,'2023-11-22 07:36:39','2023-11-22 07:36:39'),(1171,'oinkologne-female','It entrances female Pokémon with the sweet, alluring scent that wafts from all over its body.','gray','#171015',NULL,50,100,NULL,'medium',0,0,0,'2023-11-22 07:36:39','2023-11-22 07:36:39'),(1172,'tarountula','The thread it secretes from its rear is as strong as wire. The secret behind the thread’s strength is the topic of ongoing research.','white','#1b1c18',NULL,50,255,NULL,'slow-then-very-fast',0,0,0,'2023-11-22 07:36:39','2023-11-22 07:36:39'),(1173,'spidops','Spidops covers its territory in tough, sticky threads to set up traps for intruders.','green','#16180b',NULL,50,120,NULL,'slow-then-very-fast',0,0,0,'2023-11-22 07:36:40','2023-11-22 07:36:40'),(1174,'nymble','It’s highly skilled at a fighting style in which it uses its jumping capabilities to dodge incoming attacks while also dealing damage to opponents.','gray','#0c0d0e',NULL,20,190,NULL,'medium',0,0,0,'2023-11-22 07:36:40','2023-11-22 07:36:40'),(1175,'lokix','It uses its normally folded third set of legs when in Showdown Mode. This places a huge burden on its body, so it can’t stay in this mode for long.','gray','#151311',NULL,0,30,NULL,'medium',0,0,0,'2023-11-22 07:36:41','2023-11-22 07:36:41'),(1176,'pawmi','The pads of its paws are electricity-discharging organs. Pawmi fires electricity from its forepaws while standing unsteadily on its hind legs.','yellow','#201409',NULL,50,190,NULL,'medium',0,0,0,'2023-11-22 07:36:41','2023-11-22 07:36:41'),(1177,'pawmo','Pawmo uses a unique fighting technique in which it uses its forepaws to strike foes and zap them with electricity from its paw pads simultaneously.','yellow','#2a2113',NULL,50,80,NULL,'medium',0,0,0,'2023-11-22 07:36:42','2023-11-22 07:36:42'),(1178,'pawmot','Pawmot’s fluffy fur acts as a battery. It can store the same amount of electricity as an electric car.','yellow','#30230c',NULL,50,45,NULL,'medium',0,0,0,'2023-11-22 07:36:42','2023-11-22 07:36:42'),(1179,'tandemaus','The pair sticks together no matter what. They split any food they find exactly in half and then eat it together.','white','#2e2f30',NULL,50,150,NULL,'fast',0,0,0,'2023-11-22 07:36:43','2023-11-22 07:36:43'),(1180,'maushold','The larger pair protects the little ones during battles. When facing strong opponents, the whole group will join the fight.','white','#353537',NULL,50,75,NULL,'fast',0,0,0,'2023-11-22 07:36:43','2023-11-22 07:36:43'),(1181,'maushold-family-of-three','The larger pair protects the little ones during battles. When facing strong opponents, the whole group will join the fight.','white','#353537',NULL,50,75,NULL,'fast',0,0,0,'2023-11-22 07:36:43','2023-11-22 07:36:43'),(1182,'fidough','The yeast in Fidough’s breath is useful for cooking, so this Pokémon has been protected by people since long ago.','yellow','#242015',NULL,50,190,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:43','2023-11-22 07:36:43'),(1183,'dachsbun','The surface of this Pokémon’s skin hardens when exposed to intense heat, and its body has an appetizing aroma.','brown','#301d0f',NULL,50,90,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:44','2023-11-22 07:36:44'),(1184,'smoliv','This Pokémon converts nutrients into oil, which it stores in the fruit on its head. It can easily go a whole week without eating or drinking.','green','#0e1006',NULL,50,255,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:44','2023-11-22 07:36:44'),(1185,'dolliv','It basks in the sun to its heart’s content until the fruits on its head ripen. After that, Dolliv departs from human settlements and goes on a journey.','green','#151f0e',NULL,50,120,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:44','2023-11-22 07:36:44'),(1186,'arboliva','This Pokémon drives back enemies by launching its rich, aromatic oil at them with enough force to smash a boulder.','green','#212914',NULL,50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:45','2023-11-22 07:36:45'),(1187,'squawkabilly','Green-feathered flocks hold the most sway. When they’re out searching for food in the mornings and evenings, it gets very noisy.','green','#12150c',NULL,50,190,NULL,'slow-then-very-fast',0,0,0,'2023-11-22 07:36:45','2023-11-22 07:36:45'),(1188,'squawkabilly-blue-plumage','Green-feathered flocks hold the most sway. When they’re out searching for food in the mornings and evenings, it gets very noisy.','green','#12150c',NULL,50,190,NULL,'slow-then-very-fast',0,0,0,'2023-11-22 07:36:45','2023-11-22 07:36:45'),(1189,'squawkabilly-yellow-plumage','Green-feathered flocks hold the most sway. When they’re out searching for food in the mornings and evenings, it gets very noisy.','green','#12150c',NULL,50,190,NULL,'slow-then-very-fast',0,0,0,'2023-11-22 07:36:45','2023-11-22 07:36:45'),(1190,'squawkabilly-white-plumage','Green-feathered flocks hold the most sway. When they’re out searching for food in the mornings and evenings, it gets very noisy.','green','#12150c',NULL,50,190,NULL,'slow-then-very-fast',0,0,0,'2023-11-22 07:36:45','2023-11-22 07:36:45'),(1191,'nacli','The ground scrapes its body as it travels, causing it to leave salt behind. Salt is constantly being created and replenished inside Nacli’s body.','brown','#0e0b0b',NULL,50,255,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:45','2023-11-22 07:36:45'),(1192,'naclstack','It compresses rock salt inside its body and shoots out hardened salt pellets with enough force to perforate an iron sheet.','brown','#1b1716',NULL,50,120,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:46','2023-11-22 07:36:46'),(1193,'garganacl','Many Pokémon gather around Garganacl, hoping to lick at its mineral-rich salt.','brown','#3c3938',NULL,50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:46','2023-11-22 07:36:46'),(1194,'charcadet','Its firepower increases when it fights, reaching over 1,800 degrees Fahrenheit. It likes berries that are rich in fat.','red','#100808',NULL,50,90,NULL,'slow',0,0,0,'2023-11-22 07:36:47','2023-11-22 07:36:47'),(1195,'armarouge','This Pokémon clads itself in armor that has been fortified by psychic and fire energy, and it shoots blazing fireballs.','red','#331f0a',NULL,20,25,NULL,'slow',0,0,0,'2023-11-22 07:36:47','2023-11-22 07:36:47'),(1196,'ceruledge','An old set of armor steeped in grudges caused this Pokémon’s evolution. Ceruledge cuts its enemies to pieces without mercy.','blue','#1f2336',NULL,20,25,NULL,'slow',0,0,0,'2023-11-22 07:36:48','2023-11-22 07:36:48'),(1197,'tadbulb','It floats using the electricity stored in its body. When thunderclouds are around, Tadbulb will float higher off the ground.','yellow','#0e0b06',NULL,50,190,NULL,'medium',0,0,0,'2023-11-22 07:36:49','2023-11-22 07:36:49'),(1198,'bellibolt','What appear to be eyeballs are actually organs for discharging the electricity generated by Bellibolt’s belly-button dynamo.','green','#17211c',NULL,50,50,NULL,'medium',0,0,0,'2023-11-22 07:36:50','2023-11-22 07:36:50'),(1199,'wattrel','These Pokémon make their nests on coastal cliffs. The nests have a strange, crackling texture, and they’re a popular delicacy.','black','#0e0c09',NULL,50,180,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:50','2023-11-22 07:36:50'),(1200,'kilowattrel','It uses its throat sac to store electricity generated by its wings. There’s hardly any oil in its feathers, so it is a poor swimmer.','yellow','#120f09',NULL,50,90,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:50','2023-11-22 07:36:50'),(1201,'maschiff','Its well-developed jaw and fangs are strong enough to crunch through boulders, and its thick fat makes for an excellent defense.','brown','#180f0c',NULL,50,150,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:52','2023-11-22 07:36:52'),(1202,'mabosstiff','Mabosstiff loves playing with children. Though usually gentle, it takes on an intimidating look when protecting its family.','gray','#1d1b19',NULL,50,75,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:52','2023-11-22 07:36:52'),(1203,'shroodle','To keep enemies away from its territory, it paints markings around its nest using a poisonous liquid that has an acrid odor.','gray','#070708',NULL,50,190,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:53','2023-11-22 07:36:53'),(1204,'grafaiai','Each Grafaiai paints its own individual pattern, and it will paint that same pattern over and over again throughout its life.','gray','#18181b',NULL,50,90,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:54','2023-11-22 07:36:54'),(1205,'bramblin','Not even Bramblin knows where it is headed as it tumbles across the wilderness, blown by the wind. It loathes getting wet.','brown','#120d08',NULL,50,190,NULL,'medium',0,0,0,'2023-11-22 07:36:55','2023-11-22 07:36:55'),(1206,'brambleghast','Brambleghast wanders around arid regions. On rare occasions, mass outbreaks of these Pokémon will bury an entire town.','brown','#18120d',NULL,50,45,NULL,'medium',0,0,0,'2023-11-22 07:36:56','2023-11-22 07:36:56'),(1207,'toedscool','Though it looks like Tentacool, Toedscool is a completely different species. Its legs may be thin, but it can run at a speed of 30 mph.','yellow','#1d1612',NULL,50,190,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:56','2023-11-22 07:36:56'),(1208,'toedscruel','It coils its 10 tentacles around prey and sucks out their nutrients, causing the prey pain. The folds along the rim of its head are a popular delicacy.','black','#292413',NULL,50,90,NULL,'medium-slow',0,0,0,'2023-11-22 07:36:56','2023-11-22 07:36:56'),(1209,'klawf','This Pokémon lives on sheer cliffs. It sidesteps opponents’ attacks, then lunges for their weak spots with its claws.','red','#1f1511',NULL,50,120,NULL,'medium',0,0,0,'2023-11-22 07:36:57','2023-11-22 07:36:57'),(1210,'capsakid','Traditional Paldean dishes can be extremely spicy because they include the shed front teeth of Capsakid among their ingredients.','green','#0c100c',NULL,50,190,NULL,'medium',0,0,0,'2023-11-22 07:36:58','2023-11-22 07:36:58'),(1211,'scovillain','The green head has turned vicious due to the spicy chemicals stimulating its brain. Once it goes on a rampage, there is no stopping it.','green','#1c1c12',NULL,50,75,NULL,'medium',0,0,0,'2023-11-22 07:36:58','2023-11-22 07:36:58'),(1212,'rellor','It rolls its mud ball around while the energy it needs for evolution matures. Eventually the time comes for it to evolve.','brown','#16120d',NULL,50,190,NULL,'fast',0,0,0,'2023-11-22 07:36:59','2023-11-22 07:36:59'),(1213,'rabsca','An infant sleeps inside the ball. Rabsca rolls the ball soothingly with its legs to ensure the infant sleeps comfortably.','green','#29132b',NULL,50,45,NULL,'fast',0,0,0,'2023-11-22 07:37:00','2023-11-22 07:37:00'),(1214,'flittle','It spends its time running around wastelands. If anyone steals its beloved berries, it will chase them down and exact its revenge.','yellow','#14110b',NULL,50,120,NULL,'medium-slow',0,0,0,'2023-11-22 07:37:00','2023-11-22 07:37:00'),(1215,'espathra','It emits psychic power from the gaps between its multicolored frills and sprints at speeds greater than 120 mph.','yellow','#39312a',NULL,50,60,NULL,'medium-slow',0,0,0,'2023-11-22 07:37:02','2023-11-22 07:37:02'),(1216,'tinkatink','This Pokémon pounds iron scraps together to make a hammer. It will remake the hammer again and again until it’s satisfied with the result.','pink','#10090d',NULL,50,190,NULL,'medium-slow',0,0,0,'2023-11-22 07:37:04','2023-11-22 07:37:04'),(1217,'tinkatuff','These Pokémon make their homes in piles of scrap metal. They test the strength of each other’s hammers by smashing them together.','pink','#150f13',NULL,50,90,NULL,'medium-slow',0,0,0,'2023-11-22 07:37:04','2023-11-22 07:37:04'),(1218,'tinkaton','The hammer tops 220 pounds, yet it gets swung around easily by Tinkaton as it steals whatever it pleases and carries its plunder back home.','pink','#31262f',NULL,50,45,NULL,'medium-slow',0,0,0,'2023-11-22 07:37:05','2023-11-22 07:37:05'),(1219,'wiglett','Though it looks like Diglett, Wiglett is an entirely different species. The resemblance seems to be a coincidental result of environmental adaptation.','white','#110f10',NULL,50,255,NULL,'medium',0,0,0,'2023-11-22 07:37:06','2023-11-22 07:37:06'),(1220,'wugtrio','A variety of fish Pokémon, Wugtrio was once considered to be a regional form of Dugtrio.','red','#29181f',NULL,50,50,NULL,'medium',0,0,0,'2023-11-22 07:37:06','2023-11-22 07:37:06'),(1221,'bombirdier','Bombirdier uses the apron on its chest to bundle up food, which it carries back to its nest. It enjoys dropping things that make loud noises.','white','#282325',NULL,50,25,NULL,'slow',0,0,0,'2023-11-22 07:37:07','2023-11-22 07:37:07'),(1222,'finizen','Its water ring is made from seawater mixed with a sticky fluid that Finizen secretes from its blowhole.','blue','#0f191b',NULL,50,200,NULL,'slow',0,0,0,'2023-11-22 07:37:08','2023-11-22 07:37:08'),(1223,'palafin','Its physical capabilities are no different than a Finizen’s, but when its allies are in danger, it transforms and powers itself up.','blue','#0f191b',NULL,50,45,NULL,'slow',0,0,0,'2023-11-22 07:37:08','2023-11-22 07:37:08'),(1224,'palafin-hero','Its physical capabilities are no different than a Finizen’s, but when its allies are in danger, it transforms and powers itself up.','blue','#0f191b',NULL,50,45,NULL,'slow',0,0,0,'2023-11-22 07:37:08','2023-11-22 07:37:08'),(1225,'varoom','The steel section is Varoom’s actual body. This Pokémon clings to rocks and converts the minerals within into energy to fuel its activities.','gray','#0d0c0d',NULL,50,190,NULL,'medium',0,0,0,'2023-11-22 07:37:09','2023-11-22 07:37:09'),(1226,'revavroom','Revavroom viciously threatens others with the sound of its exhaust. It sticks its tongue out from its cylindrical mouth and sprays toxic fluids.','gray','#171517',NULL,50,75,NULL,'medium',0,0,0,'2023-11-22 07:37:10','2023-11-22 07:37:10'),(1227,'cyclizar','It can sprint at over 70 mph while carrying a human. The rider’s body heat warms Cyclizar’s back and lifts the Pokémon’s spirit.','green','#171e19',NULL,50,190,NULL,'medium-slow',0,0,0,'2023-11-22 07:37:10','2023-11-22 07:37:10'),(1228,'orthworm','This Pokémon lives in arid deserts. It maintains its metal body by consuming iron from the soil.','pink','#1f1414',NULL,50,25,NULL,'slow',0,0,0,'2023-11-22 07:37:11','2023-11-22 07:37:11'),(1229,'glimmet','Glimmet’s toxic mineral crystals look just like flower petals. This Pokémon scatters poisonous powder like pollen to protect itself.','blue','#090a0f',NULL,50,70,NULL,'medium-slow',0,0,0,'2023-11-22 07:37:11','2023-11-22 07:37:11'),(1230,'glimmora','Glimmora’s petals are made of crystallized poison energy. It has recently become evident that these petals resemble Tera Jewels.','blue','#111620',NULL,50,25,NULL,'medium-slow',0,0,0,'2023-11-22 07:37:12','2023-11-22 07:37:12'),(1231,'greavard','This friendly Pokémon doesn’t like being alone. Pay it even the slightest bit of attention, and it will follow you forever.','white','#212024',NULL,50,120,NULL,'medium-slow',0,0,0,'2023-11-22 07:37:12','2023-11-22 07:37:12'),(1232,'houndstone','A lovingly mourned Pokémon was reborn as Houndstone. It doesn’t like anyone touching the protuberance atop its head.','white','#2d2d2e',NULL,50,60,NULL,'medium-slow',0,0,0,'2023-11-22 07:37:12','2023-11-22 07:37:12'),(1233,'flamigo','Thanks to a behavior of theirs known as “synchronizing,” an entire flock of these Pokémon can attack simultaneously in perfect harmony.','pink','#180f12',NULL,50,100,NULL,'medium-slow',0,0,0,'2023-11-22 07:37:13','2023-11-22 07:37:13'),(1234,'cetoddle','It lives in frigid regions in pods of five or so individuals. It loves the minerals found in snow and ice.','white','#211e1f',NULL,50,150,NULL,'medium-slow',0,0,0,'2023-11-22 07:37:14','2023-11-22 07:37:14'),(1235,'cetitan','Ice energy builds up in the horn on its upper jaw, causing the horn to reach cryogenic temperatures that freeze its surroundings.','white','#3d3b3d',NULL,50,50,NULL,'medium-slow',0,0,0,'2023-11-22 07:37:14','2023-11-22 07:37:14'),(1236,'veluza','Veluza has excellent regenerative capabilities. It sheds spare flesh from its body to boost its agility, then charges at its prey.','gray','#180f18',NULL,50,100,NULL,'fast',0,0,0,'2023-11-22 07:37:14','2023-11-22 07:37:14'),(1237,'dondozo','It treats Tatsugiri like its boss and follows it loyally. Though powerful, Dondozo is apparently not very smart.','blue','#293a46',NULL,50,25,NULL,'slow',0,0,0,'2023-11-22 07:37:15','2023-11-22 07:37:15'),(1238,'tatsugiri','Tatsugiri is an extremely cunning Pokémon. It feigns weakness to lure in prey, then orders its partner to attack.','pink','#170e0b',NULL,50,100,NULL,'medium-slow',0,0,0,'2023-11-22 07:37:16','2023-11-22 07:37:16'),(1239,'tatsugiri-droopy','Tatsugiri is an extremely cunning Pokémon. It feigns weakness to lure in prey, then orders its partner to attack.','pink','#170e0b',NULL,50,100,NULL,'medium-slow',0,0,0,'2023-11-22 07:37:16','2023-11-22 07:37:16'),(1240,'tatsugiri-stretchy','Tatsugiri is an extremely cunning Pokémon. It feigns weakness to lure in prey, then orders its partner to attack.','pink','#170e0b',NULL,50,100,NULL,'medium-slow',0,0,0,'2023-11-22 07:37:16','2023-11-22 07:37:16'),(1241,'annihilape','It imbues its fists with the power of the rage that it kept hidden in its heart. Opponents struck by these imbued fists will be shattered to their core.','gray','#2f2f32',NULL,50,45,NULL,'medium',0,0,0,'2023-11-22 07:37:16','2023-11-22 07:37:16'),(1242,'clodsire','It lives at the bottom of ponds and swamps. It will carry Wooper on its back and ferry them across water from one shore to the other.','brown','#171313',NULL,50,90,NULL,'medium',0,0,0,'2023-11-22 07:37:16','2023-11-22 07:37:16'),(1243,'farigiraf','The hardened head from the tail protects the head of the main body as Farigiraf whips its long neck around to headbutt enemies.','brown','#261c13',NULL,50,45,NULL,'medium',0,0,0,'2023-11-22 07:37:18','2023-11-22 07:37:18'),(1244,'dudunsparce','It drives enemies out of its nest by sucking in enough air to fill its long, narrow lungs, then releasing the air in an intense blast.','yellow','#1c1f19',NULL,50,45,NULL,'medium',0,0,0,'2023-11-22 07:37:18','2023-11-22 07:37:18'),(1245,'dudunsparce-three-segment','It drives enemies out of its nest by sucking in enough air to fill its long, narrow lungs, then releasing the air in an intense blast.','yellow','#1c1f19',NULL,50,45,NULL,'medium',0,0,0,'2023-11-22 07:37:18','2023-11-22 07:37:18'),(1246,'kingambit','Though it commands a massive army in battle, it’s not skilled at devising complex strategies. It just uses brute strength to keep pushing.','black','#332621',NULL,50,25,NULL,'medium',0,0,0,'2023-11-22 07:37:19','2023-11-22 07:37:19'),(1247,'great-tusk','This creature resembles a mysterious Pokémon that, according to a paranormal magazine, has lived since ancient times.','purple','#2d222c',NULL,0,30,NULL,'slow',0,0,0,'2023-11-22 07:37:19','2023-11-22 07:37:19'),(1248,'scream-tail','It resembles a mysterious Pokémon described in a paranormal magazine as a Jigglypuff from one billion years ago.','pink','#22161a',NULL,0,50,NULL,'slow',0,0,0,'2023-11-22 07:37:19','2023-11-22 07:37:19'),(1249,'brute-bonnet','It bears a slight resemblance to a Pokémon described in a dubious magazine as a cross between a dinosaur and a mushroom.','gray','#2b2b21',NULL,0,50,NULL,'slow',0,0,0,'2023-11-22 07:37:20','2023-11-22 07:37:20'),(1250,'flutter-mane','It has similar features to a ghostly pterosaur that was covered in a paranormal magazine, but the two have little else in common.','gray','#191721',NULL,0,30,NULL,'slow',0,0,0,'2023-11-22 07:37:20','2023-11-22 07:37:20'),(1251,'slither-wing','This Pokémon somewhat resembles an ancient form of Volcarona that was introduced in a dubious magazine.','red','#3e2821',NULL,0,30,NULL,'slow',0,0,0,'2023-11-22 07:37:21','2023-11-22 07:37:21'),(1252,'sandy-shocks','It slightly resembles a Magneton that lived for 10,000 years and was featured in an article in a paranormal magazine.','gray','#21211f',NULL,0,30,NULL,'slow',0,0,0,'2023-11-22 07:37:22','2023-11-22 07:37:22'),(1253,'iron-treads','Sightings of this Pokémon have occurred in recent years. It resembles a mysterious object described in an old expedition journal.','gray','#211617',NULL,0,30,NULL,'slow',0,0,0,'2023-11-22 07:37:22','2023-11-22 07:37:22'),(1254,'iron-bundle','It resembles a mysterious object mentioned in an old book. There are only two reported sightings of this Pokémon.','red','#201a1a',NULL,0,50,NULL,'slow',0,0,0,'2023-11-22 07:37:22','2023-11-22 07:37:22'),(1255,'iron-hands','This Pokémon shares many similarities with Iron Hands, an object mentioned in a certain expedition journal.','gray','#524b2d',NULL,0,50,NULL,'slow',0,0,0,'2023-11-22 07:37:24','2023-11-22 07:37:24'),(1256,'iron-jugulis','It’s possible that Iron Jugulis, an object described in an old book, may actually be this Pokémon.','blue','#2a1e2d',NULL,0,30,NULL,'slow',0,0,0,'2023-11-22 07:37:24','2023-11-22 07:37:24'),(1257,'iron-moth','No records exist of this species being caught. Data is lacking, but the Pokémon’s traits match up with an object described in an old book.','yellow','#503927',NULL,0,30,NULL,'slow',0,0,0,'2023-11-22 07:37:24','2023-11-22 07:37:24'),(1258,'iron-thorns','Some of its notable features match those of an object named within a certain expedition journal as Iron Thorns.','green','#20321c',NULL,0,30,NULL,'slow',0,0,0,'2023-11-22 07:37:25','2023-11-22 07:37:25'),(1259,'frigibax','This Pokémon lives in forests and craggy areas. Using the power of its dorsal fin, it cools the inside of its nest like a refrigerator.','gray','#0f100e',NULL,50,45,NULL,'slow',0,0,0,'2023-11-22 07:37:25','2023-11-22 07:37:25'),(1260,'arctibax','It attacks with the blade of its frozen dorsal fin by doing a front flip in the air. Arctibax’s strong back and legs allow it to pull off this technique.','gray','#151b20',NULL,50,25,NULL,'slow',0,0,0,'2023-11-22 07:37:26','2023-11-22 07:37:26'),(1261,'baxcalibur','It launches itself into battle by flipping upside down and spewing frigid air from its mouth. It finishes opponents off with its dorsal blade.','gray','#293638',NULL,50,10,NULL,'slow',0,0,0,'2023-11-22 07:37:27','2023-11-22 07:37:27'),(1262,'gimmighoul','It lives inside an old treasure chest. Sometimes it gets left in shop corners since no one realizes it’s actually a Pokémon.','brown','#2f261a',NULL,50,45,NULL,'slow',0,0,0,'2023-11-22 07:37:28','2023-11-22 07:37:28'),(1263,'gimmighoul-roaming','It lives inside an old treasure chest. Sometimes it gets left in shop corners since no one realizes it’s actually a Pokémon.','brown','#2f261a',NULL,50,45,NULL,'slow',0,0,0,'2023-11-22 07:37:28','2023-11-22 07:37:28'),(1264,'gholdengo','It has a sturdy body made up of stacked coins. Gholdengo overwhelms its enemies by firing coin after coin at them in quick succession.','yellow','#31270d',NULL,50,45,NULL,'slow',0,0,0,'2023-11-22 07:37:28','2023-11-22 07:37:28'),(1265,'wo-chien','It drains the life-force from vegetation, causing nearby forests to instantly wither and fields to turn barren.','brown','#313126',NULL,0,6,NULL,'slow',0,1,0,'2023-11-22 07:37:28','2023-11-22 07:37:28'),(1266,'chien-pao','The hatred of those who perished by the sword long ago has clad itself in snow and become a Pokémon.','white','#323538',NULL,0,6,NULL,'slow',0,1,0,'2023-11-22 07:37:29','2023-11-22 07:37:29'),(1267,'ting-lu','It slowly brings its exceedingly heavy head down upon the ground, splitting the earth open with huge fissures that run over 160 feet deep.','brown','#231f1a',NULL,0,6,NULL,'slow',0,1,0,'2023-11-22 07:37:29','2023-11-22 07:37:29'),(1268,'chi-yu','The envy accumulated within curved beads that sparked multiple conflicts has clad itself in fire and become a Pokémon.','red','#20110c',NULL,0,6,NULL,'slow',0,1,0,'2023-11-22 07:37:30','2023-11-22 07:37:30'),(1269,'roaring-moon','According to an article in a dubious magazine, this Pokémon has some connection to a phenomenon that occurs in a certain region.','green','#403b42',NULL,0,10,NULL,'slow',0,0,0,'2023-11-22 07:37:30','2023-11-22 07:37:30'),(1270,'iron-valiant','It’s possible that this is the object listed as Iron Valiant in a certain expedition journal.','white','#322c30',NULL,0,10,NULL,'slow',0,0,0,'2023-11-22 07:37:31','2023-11-22 07:37:31'),(1271,'koraidon','This Pokémon resembles Cyclizar, but it is far burlier and more ferocious. Nothing is known about its ecology or other features.','red','#52393f',NULL,0,3,NULL,'slow',0,1,0,'2023-11-22 07:37:31','2023-11-22 07:37:31'),(1272,'koraidon-limited-build','This Pokémon resembles Cyclizar, but it is far burlier and more ferocious. Nothing is known about its ecology or other features.','red','#52393f',NULL,0,3,NULL,'slow',0,1,0,'2023-11-22 07:37:31','2023-11-22 07:37:31'),(1273,'koraidon-sprinting-build','This Pokémon resemble